        "body": "Hi,\r\nI've been using the Universal Sentence Encoders model and had a hard to track memory leak. I eventually found [this comment](https://github.com/tensorflow/tfjs/issues/4015#issuecomment-704335135)  which suggested setting \r\n```js\r\ntf.env().set(\"WEBGL_DELETE_TEXTURE_THRESHOLD\", 0);\r\n```\r\nWhich solved the issue. \r\nI don't know what it did but it worked and I suggest documenting it more prominently. \r\nI'd volunteer to do so myself but don't understand what this does so leaving it as a suggestion\r\nThanks !\r\n",
