        "active_lock_reason": null,
        "body": "When exporting an AutoML object detection model to Edge TensorFlowjs, the dict.txt shows all labels as `b'NNN'`. Also, why is there a random `background` label in the file?\r\n\r\nExample dict.txt\r\n```\r\nbackground\r\nb'flower'\r\nb'car'\r\nb'bike'\r\n```\r\n\r\nAlso the predicted objects show the same values:\r\n```\r\n[\r\n  {\r\n    \"box\": {\r\n      \"left\": 1072.9528427124023,\r\n      \"top\": -0.020751953125,\r\n      \"width\": 415.03761291503906,\r\n      \"height\": 530.7356262207031\r\n    },\r\n    \"label\": \"b'flower'\",\r\n    \"score\": 0.9463808536529541\r\n  },\r\n  {\r\n    \"box\": {\r\n      \"left\": 767.7276992797852,\r\n      \"top\": 312.42637634277344,\r\n      \"width\": 444.6556091308594,\r\n      \"height\": 618.1985473632812\r\n    },\r\n    \"label\": \"b'car'\",\r\n    \"score\": 0.8420096635818481\r\n  }\r\n]\r\n```\r\n\r\nHere is the code used to run them model:\r\n```\r\n<script src=\"https://unpkg.com/@tensorflow/tfjs\"></script>\r\n<script src=\"https://unpkg.com/@tensorflow/tfjs-automl\"></script>\r\n<img id=\"img\" src=\"sample.jpg\">\r\n<script>\r\n    async function run() {\r\n        const model = await tf.automl.loadObjectDetection('/model/model.json');\r\n        const img = document.getElementById('img');\r\n        const options = { score: 0.5, iou: 0.5, topk: 20 };\r\n        console.log(model.dictionary);\r\n        const predictions = await model.detect(img, options);\r\n        console.log(predictions);\r\n        // Show the resulting object on the page.\r\n        const pre = document.createElement('pre');\r\n        pre.textContent = JSON.stringify(predictions, null, 2);\r\n        document.body.append(pre);\r\n    }\r\n    run();\r\n</script>\r\n```\r\n\r\nThis seems like a bug. For now we are just handling by stripping out the extra characters from the labels.",
