        "body": "<em>Please make sure that this is a bug. As per our\r\n[GitHub Policy](https://github.com/tensorflow/tensorflow/blob/master/ISSUES.md),\r\nwe only address code/doc bugs, performance issues, feature requests and\r\nbuild/installation issues on GitHub. tag:bug_template</em>\r\n\r\n**System information**\r\n- Have I written custom code (as opposed to using a stock example script provided in TensorFlow.js): No\r\n- OS Platform and Distribution (e.g., Linux Ubuntu 16.04): Windows 10\r\n- Mobile device (e.g. iPhone 8, Pixel 2, Samsung Galaxy) if the issue happens on mobile device: No\r\n- TensorFlow.js installed from (npm or script link): npm\r\n- TensorFlow.js version (use command below): 2.1\r\n- Browser version: Chrome 86.0.4240.111\r\n- Tensorflow.js Converter Version: 2.1\r\n\r\n**Describe the current behavior**\r\nWhen I run the demo of the FaceMesh model and I cover my face partially, the gpu memory demand is steadily increasing with each frame. When the whole face is visible or the face isn't visible at all, the allocated memory remains the same. All this is only an issue with the webgl backend.\r\n**Describe the expected behavior**\r\nThe memory demand should not increase in any case.\r\n**Code to reproduce the issue**\r\nThe line following line can be added to the renderPrediction function to monitor gpu demand:\r\n`console.log(tf.backend().memory())`\r\n\r\n![facemesh](https://user-images.githubusercontent.com/69153609/97991946-5a50ef00-1de2-11eb-9406-aaab6d54ddf8.gif)",
