        "body": "**System information**\r\n- TensorFlow.js version (you are using): 2\r\n- Are you willing to contribute it (Yes/No): No, it's not mine\r\n\r\n**Describe the feature and the current behavior/state.**\r\n[This Google AI blog post](https://ai.googleblog.com/2020/10/background-features-in-google-meet.html?m=1) describes the background segmentation model used in Google Meet. This model would be an excellent complement to [the models in the tfjs-models collection](https://github.com/tensorflow/tfjs-models). (The existing BodyPix model can be (ab)used for background segmentation, but has quality and performance issues for this use-case. I expect the Google Meet model improves on this.)\r\n\r\n**Will this change the current api? How?**\r\nNo, it would be an addition to [tfjs-models](https://github.com/tensorflow/tfjs-models).\r\n\r\n**Who will benefit with this feature?**\r\nApps consuming and/or displaying a user-facing camera feed. WebRTC video chat apps are the most obvious, where background blur/replacement is becoming expected. I also expect it could be a useful preprocessing step before applying e.g. PoseNet. It can also be used creatively on images as a pre-processing step -- for example, [this recent app to enhance profile pictures](https://www.producthunt.com/posts/pfpmaker) integrates a background segmentation solution.",
