        "body": "Hi, I'm trying to use Blazeface in TFJS and see that the only version for tfjs available is the front camera version.\r\n\r\nThe model card states that two versions exist: https://drive.google.com/file/d/1f39lSzU5Oq-j_OXgS67KfN5wNsoeAZ4V/view\r\n\r\nHere are the two .tflite version of the model:\r\nhttps://github.com/google/mediapipe/blob/master/mediapipe/models/face_detection_front.tflite\r\nhttps://github.com/google/mediapipe/blob/master/mediapipe/models/face_detection_back.tflite\r\n\r\nThe first one (front) accepts images of 128x128 and can detect up to 2 meters. The second one (back) accepts images of 256x256 and can detect up to 5 meters.\r\n\r\nThe only version avaliable online on TFHub is the front one, is there some way that you could publish the back one too ? that would be very helpful.\r\n\r\nOtherwise if there are any way to convert the tflite to tfjs, directly or indirectly, please let me know.\r\n\r\nThank you.\r\n\r\nedit: this also means that https://github.com/tensorflow/tfjs-models/tree/master/blazeface does not work if you configure it to use image larger than 128x128: \"The shape of dict['input'] provided in model.execute(dict) must be [-1,128,128,3], but was [1,256,256,3]\"",
