        "body": "To see the logs from the Cloud Build CI, please join either our [discussion](https://groups.google.com/a/tensorflow.org/forum/#!forum/tfjs) or [announcement](https://groups.google.com/a/tensorflow.org/forum/#!forum/tfjs-announce) mailing list.\r\n\r\n<!-- Reviewable:start -->\r\n---\r\nThis change is [<img src=\"https://reviewable.io/review_button.svg\" height=\"34\" align=\"absmiddle\" alt=\"Reviewable\"/>](https://reviewable.io/reviews/tensorflow/tfjs/4203)\r\n<!-- Reviewable:end -->\r\n\r\nFill op defaults the \"dtype\" parameter to \"float\" according to the docs.\r\n\r\n```\r\n@param dtype\r\nThe type of an element in the resulting tensor. Defaults to 'float'.\r\n```\r\nHowever when switching to wasm backend you need to explicitly specify the parameter or it will show an error `Unknown dtype ${dtype}`\r\n\r\n",
