        "body": "tfjs-backend-wasm@2.7.0\r\ntf-backend-wasm.node.js\r\n\r\nI'm trying to use backend-wasm with bodypix. It's hard for me to provide a simple test case.\r\nAt some point \r\n\r\nBackendWasm.prototype.makeOutput = function (shape, dtype, memoryOffset) {\r\n        var dataId;\r\n        if (memoryOffset == null) {\r\n            dataId = this.write(null /* values */, shape, dtype);\r\n        \r\ncalls\r\n\r\nBackendWasm.prototype.write = function (values, shape, dtype) {\r\n        var dataId = {};\r\n        this.move(dataId, values, shape, dtype);\r\n \r\nwhich overwrites the memory holding the displayed html page and hangs.\r\n\r\nIt does not extend the heap or return a \"heap full\" error. (I don't know what it's supposed to do.)\r\n",
