        "author_association": "MEMBER",
        "active_lock_reason": null,
        "body": "As a follow-up investigating #4248 revealed that as of October, webpack 5 does not [require the sideEffects entry anymore](https://webpack.js.org/blog/2020-10-10-webpack-5-release/#side-effect-analysis).  \r\n\r\n- Investigate how well it (and our other target bundlers do) without that field\r\n- Understand how webpack 5 adoption is going and whether we just want to target that for the custom bundle flow.\r\n\r\nThis template is for miscellaneous issues not covered by the other issue categories.\r\n\r\nFor questions on how to work with TensorFlow.js, or support for problems that are not verified bugs in TensorFlow.js, please go to [StackOverflow](https://stackoverflow.com/tags/tensorflow.js).\r\n",
