        "body": "\r\n**System information**\r\n- OS Platform and Distribution (e.g., Linux Ubuntu 16.04): Windows 10\r\n- Mobile device : Honor7x\r\n- TensorFlow.js installed from (npm or script link): npm\r\n- TensorFlow.js version: 2.7.0\r\n\r\n\r\nDescription:\r\n\r\nImporting fetch from @tensorflow/tfjs-react-native resulting in above issue.\r\n\r\nI am getting this issue when I import only. I did follow the exact steps as in docs.\r\n\r\nPlease see the screenshot below:\r\n![WhatsApp Image 2020-11-19 at 2 57 16 PM](https://user-images.githubusercontent.com/49977739/99647365-af922f00-2a77-11eb-9683-8cebf1c2b4cd.jpeg)\r\n\r\nPackage  Dependencies : \r\n\r\n```javascript\r\n \"dependencies\": {\r\n    \"@react-native-async-storage/async-storage\": \"^1.13.2\",\r\n    \"@tensorflow-models/mobilenet\": \"^2.0.4\",\r\n    \"@tensorflow/tfjs\": \"^2.7.0\",\r\n    \"@tensorflow/tfjs-react-native\": \"^0.5.0\",\r\n    \"expo\": \"~39.0.2\",\r\n    \"expo-camera\": \"^9.0.0\",\r\n    \"expo-constants\": \"^9.2.0\",\r\n    \"expo-gl\": \"^9.1.1\",\r\n    \"expo-gl-cpp\": \"^9.1.2\",\r\n    \"expo-image-picker\": \"^9.1.1\",\r\n    \"expo-permissions\": \"^9.3.0\",\r\n    \"expo-status-bar\": \"~1.0.2\",\r\n    \"jpeg-js\": \"^0.4.2\",\r\n    \"react\": \"16.13.1\",\r\n    \"react-dom\": \"16.13.1\",\r\n    \"react-native\": \"https://github.com/expo/react-native/archive/sdk-39.0.4.tar.gz\",\r\n    \"react-native-fs\": \"^2.16.6\",\r\n    \"react-native-web\": \"~0.13.12\"\r\n  },\r\n``` \r\n\r\nPlease help me how to resolve this issue.\r\n",
