        "body": "Hello.\r\n\r\nI'm a beginner trying to train a GAN network. Found an example https://medium.com/datadriveninvestor/generative-adversarial-network-gan-using-keras-ce1c05cfdfd3\r\nIn python, the example works fine, but I need to run it under NodeJS.\r\nI rewrote it in JS - https://pastebin.com/RZt6AtZc\r\nAnd I get the error\r\n(node: 3988) UnhandledPromiseRejectionWarning: Error: Invalid TF_Status: 3\r\nMessage: Incompatible shapes: [784,1024] vs. [100,256]\r\n\r\nI began to understand, under the debugger I realized that the error occurs when the optimizer is running. I changed the optimizer to sgd and the code started executing without error.\r\n\r\nIt looks like the problem is that trainable = false / true is changing for a part of the network.\r\nIn @tensorflow \\tfjs-core\\src\\optimizers\\adam_optimizer.ts in line 67, only the index is used, but the problem is that the turkeys are the same and the layer names are different.\r\n",
