        "body": "<em>Please make sure that this is a bug. As per our\r\n[GitHub Policy](https://github.com/tensorflow/tensorflow/blob/master/ISSUES.md),\r\nwe only address code/doc bugs, performance issues, feature requests and\r\nbuild/installation issues on GitHub. tag:bug_template</em>\r\n\r\n**System information**\r\n- Have I written custom code (as opposed to using a stock example script provided in TensorFlow.js): True\r\n- OS Platform and Distribution (e.g., Linux Ubuntu 16.04): Mac \r\n- Mobile device (e.g. iPhone 8, Pixel 2, Samsung Galaxy) if the issue happens on mobile device: \r\n- TensorFlow.js installed from (npm or script link): npm \r\n- TensorFlow.js version (use command below): 2.7.0\r\n- Browser version: Chrome 87.0.4280.67\r\n- Tensorflow.js Converter Version: 2.7.0\r\n\r\n**Describe the current behavior**\r\nworks well when there is target object in video but crash when there is nothing.\r\n\r\n**Describe the expected behavior**\r\nworks well for video with/without target.\r\n\r\n**Standalone code to reproduce the issue**\r\nfirst I trainned my model and convert it to tfjs format. \r\n[model.json.zip](https://github.com/tensorflow/tfjs/files/5581107/model.json.zip)\r\n\r\nThen I integrated it to tfjs-models demo code using tfconv.loadGraphModel and executeAsync with webGL backend.\r\n```\r\n// pseudo code to reproduce the problem\r\nboundingBoxDetector = tfconv.loadGraphModel(HANDGDETECTIONV2_MODEL_PATH);\r\nconst detResult = await boundingBoxDetector.executeAsync(image) as tf.Tensor[];\r\n````\r\n\r\nI noticed the PR https://github.com/tensorflow/tfjs/pull/4122 but it does not fix my issue.\r\n\r\n**Other info / logs** Include any logs or source code that would be helpful to\r\ndiagnose the problem. If including tracebacks, please include the full\r\ntraceback. Large logs and files should be attached.\r\n\r\nError Stack.\r\nshader_compiler.ts:721 Uncaught (in promise) TypeError: Cannot read property '0' of undefined\r\n    at getPackedSampler2D (shader_compiler.ts:721)\r\n    at getPackedSamplerFromInInfo (shader_compiler.ts:118)\r\n    at getInputSamplingSnippet (shader_compiler.ts:131)\r\n    at shader_compiler.ts:56\r\n    at Array.map (<anonymous>)\r\n    at Object.makeShader (shader_compiler.ts:56)\r\n    at Object.compileProgram (gpgpu_math.ts:90)\r\n    at backend_webgl.ts:2384\r\n    at MathBackendWebGL.getAndSaveBinary (backend_webgl.ts:2428)\r\n    at MathBackendWebGL.runWebGLProgram (backend_webgl.ts:2383)\r\n\r\nFollowing is the gpu code I found that actually cause crash.\r\n\"PadPackedProgram_0,4_undefined_false100,4_100,4_false_\r\n      const ivec2 start = ivec2(0,0);\r\n      const ivec2 end = ivec2(0,4);\r\n\r\n      void main() {\r\n        ivec2 outputLoc = getOutputCoords();\r\n        vec4 result = vec4(0.);\r\n        \r\n        ivec2 rc = outputLoc;\r\n        if (any(lessThan(rc, start)) || any(greaterThanEqual(rc, end))) {\r\n          result[0] = float(0);\r\n        } else {\r\n          ivec2 source = rc - start;\r\n          result[0] = getChannel(getX(source.x,source.y), vec2(source.x,source.y));\r\n        }\r\n      \r\n        rc.y += 1;\r\n       if(rc.y < 4) {\r\n      \r\n        if (any(lessThan(rc, start)) || any(greaterThanEqual(rc, end))) {\r\n          result[1] = float(0);\r\n        } else {\r\n          ivec2 source = rc - start;\r\n          result[1] = getChannel(getX(source.x,source.y), vec2(source.x,source.y));\r\n        }\r\n      \r\n        }\r\n       rc = outputLoc;\r\n       rc.x += 1;\r\n       if(rc.x < 100) {\r\n        if (any(lessThan(rc, start)) || any(greaterThanEqual(rc, end))) {\r\n          result[2] = float(0);\r\n        } else {\r\n          ivec2 source = rc - start;\r\n          result[2] = getChannel(getX(source.x,source.y), vec2(source.x,source.y));\r\n        }\r\n      \r\n          rc.y += 1;\r\n         if(rc.y < 4) {\r\n        if (any(lessThan(rc, start)) || any(greaterThanEqual(rc, end))) {\r\n          result[3] = float(0);\r\n        } else {\r\n          ivec2 source = rc - start;\r\n          result[3] = getChannel(getX(source.x,source.y), vec2(source.x,source.y));\r\n        }\r\n      }}\r\n        setOutput(result);\r\n      }\r\n    \"",
