        "body": "**System information**\r\n- Have I written custom code (as opposed to using a stock example script provided in TensorFlow.js):\r\nn/a\r\n- OS Platform and Distribution (e.g., Linux Ubuntu 16.04):\r\nWindows 10, Version 1909 (OS Build 18363.1198)\r\n- Mobile device (e.g. iPhone 8, Pixel 2, Samsung Galaxy) if the issue happens on mobile device:\r\nn/a\r\n- TensorFlow.js installed from (npm or script link):\r\nnpm\r\n- TensorFlow.js version:\r\n2.7.0\r\n- Browser version:\r\nn/a\r\n- Tensorflow.js Converter Version:\r\nunknown\r\n\r\n\r\n**Describe the current behavior**\r\nTLDR: It appears the type definitions for tensor1-5d and tensor6d have inconsistent nested Uint8Array bracket counts. Please see the source at the bottom of this bug.\r\n\r\nFull Story:\r\nWhen creating tensors from nested Uint8Arrays, the results are not consistent across every supported rank (1-6). Specifically, rank 6 does not act like ranks 1-5.\r\n_Regarding depth, I will consider Uint8Array[] as one-dimensional in this write-up, as I would with boolean[] or number[]. It's confusing with typed arrays._\r\n\r\n- If you pass a 6d array of Uint8Array into tensor6d(), an error is thrown.\r\n- If you pass the same 6d array into the generic tensor(), a rank 7 tensor is returned.\r\n- If you pass a 5d array into tensor6d(), a rank 6 tensor is returned.\r\n\r\nThese cases may be perfectly valid (although they seem inconsistent). However, the behavior of the third case changes when applied to lower ranks.\r\n\r\n- If you attempt to pass a 4d array into tensor5d(), a TypeScript error is produced, showing that 'Uint8Array[][][][] not assignable to TensorLike5D'.\r\n\r\nIt appears that one of these problems exists:\r\n- The type for 6d Uint8Array is missing a pair of brackets.\r\nOR\r\n- The types for 1-5d Uint8Array each have an extra pair of brackets.\r\n\r\n_NOTE: I'd be happy to fix this one, but I'm not certain which behavior is preferred. Should tensor5() accept 4d or 5d arrays of Uint8Array? Should the generic tensor() ever produce a rank 7, or should that throw?_\r\n\r\n**Describe the expected behavior**\r\nThe generic call tensor() and the specific calls tensor<1-6>d() should return properly ranked tensors given identical Uint8Array input, and there should be no TypeScript errors.\r\n\r\n**Standalone code to reproduce the issue**\r\n```\r\nimport * as TF from '@tensorflow/tfjs-node';\r\n\r\nconst UI8_4: Uint8Array[][][][]     = [[[[new Uint8Array(3)]]]];\r\nconst UI8_5: Uint8Array[][][][][]   = [[[[[new Uint8Array(3)]]]]];\r\nconst UI8_6: Uint8Array[][][][][][] = [[[[[[new Uint8Array(3)]]]]]];\r\n\r\ntry {\r\n\t// using the generic tensor() call\r\n\tconst TENSOR_6_MADE_FROM_6D_AUTO = TF.tensor(UI8_6); // rank 7, shape [1, 1, 1, 1, 1, 1, 3]\r\n\tconst TENSOR_6_MADE_FROM_5D_AUTO = TF.tensor(UI8_5); // rank 6, shape [1, 1, 1, 1, 1, 3]\r\n\r\n\t// sending n-1 dimensions to the tensor<n>d() calls\r\n\tconst TENSOR_6_MADE_FROM_5D = TF.tensor6d(UI8_5); // rank 6, shape: [1, 1, 1, 1, 1, 3]\r\n\tconst TENSOR_5_MADE_FROM_4D = TF.tensor5d(UI8_4); // rank 5, shape: [1, 1, 1, 1, 3]; TypeScript: \"Argument of type 'Uint8Array[][][][]' is not assignable to parameter of type 'TensorLike5D'. ts(2345)\"\r\n\r\n\t// sending n dimensions to the tensor<n>d() calls\r\n\tconst TENSOR_6_MADE_FROM_6D = TF.tensor6d(UI8_6); // crash: \"Error: tensor6d() requires values to be number[][][][][][] or flat/TypedArray\"\r\n\tconst TENSOR_5_MADE_FROM_5D = TF.tensor5d(UI8_5); // crash: \"Error: tensor5d() requires values to be number[][][][][] or flat/TypedArray\"\r\n}\r\ncatch (e) {\r\n\tconsole.log(e);\r\n}\r\n```\r\n\r\n**Other info / logs**\r\n\r\nThis is the source in question (*.\\tfjs-core\\src\\types.ts, lines 136-159*):\r\n```\r\n/** @docalias TypedArray|Array */\r\nexport type TensorLike =\r\n    TypedArray|number|boolean|string|RecursiveArray<number|number[]|TypedArray>|\r\n    RecursiveArray<boolean>|RecursiveArray<string>|Uint8Array[];\r\nexport type ScalarLike = number|boolean|string|Uint8Array;\r\n/** @docalias TypedArray|Array */\r\nexport type TensorLike1D = TypedArray|number[]|boolean[]|string[]|Uint8Array[];\r\n/** @docalias TypedArray|Array */\r\nexport type TensorLike2D = TypedArray|number[]|number[][]|boolean[]|boolean[][]|\r\n    string[]|string[][]|Uint8Array[]|Uint8Array[][];\r\n/** @docalias TypedArray|Array */\r\nexport type TensorLike3D = TypedArray|number[]|number[][][]|boolean[]|\r\n    boolean[][][]|string[]|string[][][]|Uint8Array[]|Uint8Array[][][];\r\n/** @docalias TypedArray|Array */\r\nexport type TensorLike4D = TypedArray|number[]|number[][][][]|boolean[]|\r\n    boolean[][][][]|string[]|string[][][][]|Uint8Array[]|Uint8Array[][][][];\r\n/** @docalias TypedArray|Array */\r\nexport type TensorLike5D =\r\n    TypedArray|number[]|number[][][][][]|boolean[]|boolean[][][][][]|string[]|\r\n    string[][][][][]|Uint8Array[]|Uint8Array[][][][][];\r\n/** @docalias TypedArray|Array */\r\nexport type TensorLike6D =\r\n    TypedArray|number[]|number[][][][][][]|boolean[]|boolean[][][][][][]|\r\n    string[]|string[][][][][][]|Uint8Array[]|Uint8Array[][][][][];\r\n```",
