        "body": "**System information**\r\n- Have I written custom code (as opposed to using a stock example script provided in TensorFlow.js): close to stock example\r\n- OS Platform and Distribution (e.g., Linux Ubuntu 16.04): Ubuntu 18.04\r\n- TensorFlow.js version (use command below): \"@tensorflow/tfjs-node\": \"^2.1.0\"\r\n- Tensorflow.js Converter Version: tensorflowjs 2.7.0\r\n\r\n**Describe the current behavior**\r\n1. Added a layer`UpSampling2D` with interpolation as `bilinear` (tensorflow python model).\r\n\r\n`model.add(tf.keras.layers.UpSampling2D(size=(2,2), interpolation='bilinear'))`\r\n\r\n\r\n2. Converted the model (to be used in js) using tensorflowjs_converter\r\n\r\n`tensorflowjs_converter --control_flow_v2=True --input_format=tf_saved_model --saved_model_tags=serve --signature_name=serving_default --skip_op_check --strip_debug_ops=True --weight_shard_size_bytes=4194304 model_path output_path`\r\n\r\n\r\n3. Now, the output in tensorflow js (converted model) is significantly different than tensorflow python.\r\n\r\n**Note:** The outputs are same when we use `interpolation=nearest` (js vs python)\r\n\r\n\r\n**Describe the expected behavior**\r\nThere should not be significant difference when a model with a particular layer is converted from python to js.",
