        "author_association": "NONE",
        "active_lock_reason": null,
        "body": "I've run into an interesting situation.\r\n\r\nRecently, when Firefox upgraded from 82 to 83, performance on [my addon](https://github.com/wingman-jr-addon/wingman_jr) dropped sharply for myself and some other users as well. I traced the issue to the WebGL backend failing to load due to `failIfMajorPerformanceCaveat` exhibiting a change in behavior between the two versions. As this was negatively affecting my users, I quickly added in the WASM backend as an option. However, while this was [faster for some users](https://github.com/wingman-jr-addon/wingman_jr/issues/75#issuecomment-734822117) - thank you TF.js team for your awesome work! - for others like myself it seems to still be a blocking issue.\r\n\r\nWhen I [did a bisection and filed a bug with Mozilla](https://bugzilla.mozilla.org/show_bug.cgi?id=1679671), their initial response is that it is likely that `failIfMajorPerformanceCaveat` had a bug in FF 82 but that has now been fixed, and that the context creation *should* be failing by the spec.\r\n\r\nSo this puts me in an interesting spot. With the evidence I have so far, I believe there are a significant number of users that would still benefit from the WebGL backend - even with \"major performance caveats\" - over the WASM backend. Unfortunately, it appears that the `failIfMajorPerformanceCaveat` is [hardcoded](https://github.com/tensorflow/tfjs/blob/c537c813ba8234a909d1e0849abfd95998a8fb5b/tfjs-backend-webgl/src/canvas_util.ts#L27) rather than relying on say an environment variable or something I can tweak to allow for a different user experience.\r\n\r\nSo, I have a couple followup questions:\r\n\r\n1. Is the use of `failIfMajorPerformanceCaveat` solely about performance for the end user, or is there a correctness concern as well?\r\n2. If it is solely about performance, would the TF.js team consider making this controllable via, say, an environment variable?\r\n\r\nMaybe I'm missing something about the overall situation, but I've been battling this for about a week and a half now and I'm curious your perspective on the matter.\r\n\r\nThanks!",
