        "author_association": "NONE",
        "active_lock_reason": null,
        "body": "**System information**\r\n- TensorFlow.js version (you are using): tfjs@2.8.0\r\n- Are you willing to contribute it (Yes/No): No, not at this time\r\n\r\n**Describe the feature and the current behavior/state.**\r\n\r\nWhile tfjs currently supports [SeparableConv2D](https://js.tensorflow.org/api/latest/#layers.separableConv2d), it does not include [SeparableConv1D](https://www.tensorflow.org/api_docs/python/tf/keras/layers/SeparableConv1D). \r\n\r\nThe [Python implementation of SeparableConv1D](https://github.com/tensorflow/tensorflow/blob/582c8d236cb079023657287c318ff26adb239002/tensorflow/python/keras/layers/convolutional.py#L1891-L2065) can presumably be used as a reference, and [the existing js SeparableConv2D implentation](https://github.com/tensorflow/tfjs/blob/b94940d3b5c9c2645b039f056120378a9a439c5a/tfjs-layers/src/layers/convolutional.ts#L1054) could be a starting point for implementation [since it already has a note about not supporting SeparableConv1D yet](https://github.com/tensorflow/tfjs/blob/b94940d3b5c9c2645b039f056120378a9a439c5a/tfjs-layers/src/layers/convolutional.ts#L1005).\r\n\r\n**Will this change the current api? How?**\r\nIt will add an additional layer in tf.layers (next to the [other convolutional layers](https://js.tensorflow.org/api/latest/#Layers-Convolutional)).\r\n\r\n**Who will benefit with this feature?**\r\nAmong other uses, it will allow 1D [SepCNN](https://arxiv.org/pdf/1610.02357.pdf) to be implemented in tfjs ([as in this example for Python](https://developers.google.com/machine-learning/guides/text-classification/step-4)), and Tensorflow models that use it can be converted to js.\r\n\r\n**Any Other info.**\r\n",
