        "author_association": "NONE",
        "active_lock_reason": null,
        "body": "<em>Please make sure that this is a feature request. As per our [GitHub Policy](https://github.com/tensorflow/tensorflow/blob/master/ISSUES.md), we only address code/doc bugs, performance issues, feature requests and build/installation issues on GitHub. tag:feature_template</em>\r\n\r\n**Describe the feature and the current behavior/state.**\r\n\r\n\r\nTensorflow has added \r\nhttps://www.tensorflow.org/model_optimization/api_docs/python/tfmot/quantization/keras/quantize_model which has added QuantizeWrapper to nodes.  Converters like tflite support this but tfjs has trouble converting these nodes. \r\n- Are you willing to contribute it (Yes/No): Yes but will need significant guidance. \r\n\r\n**Will this change the current api? How?** No\r\n \r\n**Who will benefit with this feature?**\r\nAnyone who wants to deploy stuff in production. Quantization is super important in reducing memory footprint by 4x and improving inference speed. These are really important gains. However, without quantization aware training there is significant drop in  performance. TF-Lite converter is able to handle this.  We just the tfjs converter to convert \r\nthese quantized models\r\n\r\n**Any Other info.**\r\n",
