        "body": "I observed some backends are registered with the same priority, like [webgl](https://github.com/tensorflow/tfjs/blob/master/tfjs-backend-webgl/src/base.ts#L25) and [wasm](https://github.com/tensorflow/tfjs/blob/master/tfjs-backend-wasm/src/base.ts#L27), both with priority `2`. In this case, it is not trivial to predict which backend will be sorted with the highest priority, as per the [getSortedBackends](https://github.com/tensorflow/tfjs/blob/master/tfjs-core/src/engine.ts#L375) implementation.\r\nMore generally, a consumer may wish to manage backend priorities on its own.\r\n\r\nThis change proposes to include priorities in the array returned by `getSortedBackends`, and expose a new `prioritizeBackend`.\r\n\r\nUsage example:\r\n```js\r\nconst backends = tf.getSortedBackends();\r\n// [{name: 'wasm', priority: 2}, {name: 'webgl', priority: 2}, {name: 'cpu', priority: 1}]\r\n\r\n// favor webgl over wasm\r\ntf.prioritizeBackend('webgl', 3);\r\n// [{name: 'webgl', priority: 3}, {name: 'wasm', priority: 2}, {name: 'cpu', priority: 1}]\r\n\r\nawait tf.ready();\r\n```\n\n<!-- Reviewable:start -->\n---\nThis change is [<img src=\"https://reviewable.io/review_button.svg\" height=\"34\" align=\"absmiddle\" alt=\"Reviewable\"/>](https://reviewable.io/reviews/tensorflow/tfjs/4491)\n<!-- Reviewable:end -->\n",
