        "author_association": "NONE",
        "active_lock_reason": null,
        "body": "I trained a CNN on an MNIST dataset, and planned to use it for inference with tf.js.\r\n\r\nHowever, when checking the model's gradients with respect to one of the test images, I notice I keep getting a zero matrix. \r\n\r\nDoes anybody know why this issue occur?\r\n```\r\nfunction getGradient(img, yTrue) {\r\n    yTrue = tf.oneHot(tf.tensor1d([yTrue], 'int32'), 10);\r\n\r\n    function f(x) {\r\n        return tf.metrics.categoricalCrossentropy(yTrue, model.predict(x));    \r\n    }\r\n\r\n    var g = tf.grad(f);\r\n    var grad = g(img);\r\n\r\n    return grad;\r\n}\r\n```\r\n\r\nThe Python equivalent allowed me to succesfully compute the gradient.\r\n\r\n\r\n```\r\nloss_object = tf.keras.losses.CategoricalCrossentropy(from_logits=True)\r\n\r\n//already used one-hot encoding to convert the input_label\r\ndef getGradient(input_image, input_label):\r\n  with tf.GradientTape() as tape:\r\n    tape.watch(input_image)\r\n    prediction = model(input_image)\r\n    loss = loss_object(input_label, prediction)\r\n\r\n  gradient = tape.gradient(loss, input_image)\r\n\r\n  return gradient\r\n```",
