        "body": "I'm trying to finetune the bodypix model and I cannot for the life of me figure out how to generate the targets for the part_offsets output. Based on its shape ([H,W,48]) I presume it is a pair of numbers for each of the 24 body parts. Furthering that assumption, and the name, an X/Y offset? But it's clamped to 0->1. And body parts are regions, not points, so an offset for a bodypart makes no sense to me. Can you clear this up a little for me?",
