        "body": "As it is raised before, I am not able to load model as below. It gives `TypeError: Network request failed `error.  \r\n\r\n`const model = await tf.loadLayersModel('file://path/to/my-model/model.json');`\r\n\r\nI need to read model.json and model_weights.bin manually and bundle them together. I am able to read model.json without any issues but I am having troubles to get right type for bin file. \r\n\r\n```\r\nconst rootPath = Platform.OS === 'ios' ? RNFS.MainBundlePath : RNFS.DocumentDirectoryPath;\r\nconst modelWeights = await RNFS.readFile(`${rootPath}/model_weights.bin`, 'base64');\r\n```\r\n\r\nI am not sure how to convert modelWeights (string) into number to use `bundleResourceIO(modelJson: io.ModelJSON, modelWeightsId: number)`\r\n\r\nI saw suggestions to convert base64 string into Uint8Array but I couldn't find a way to convert it into 'number' type.\r\n\r\n```\r\nconst buffer = tf.util.encodeString(modelWeights, 'base64').buffer;\r\nconst arr = new Uint8Array(buffer);\r\n```\r\n\r\nAny suggestions how to bundle them together or any other ways loading model from native file system? \r\n\r\n\r\nPS: Statically bundle works without any issues. \r\n\r\n```\r\nimport modelJson from './assets/model.json';\r\nimport modelWeights from './assets/model_weights.bin';\r\n\r\nconst model = await tf.loadGraphModel(bundleResourceIO(modelJson, modelWeights));\r\n```\r\n\r\n\r\n**Standalone code to reproduce the issue**\r\n\r\n```\r\nimport React from 'react';\r\nimport {Button, View} from 'react-native';\r\nimport * as tf from '@tensorflow/tfjs';\r\nimport {bundleResourceIO} from '@tensorflow/tfjs-react-native';\r\nimport modelJson from './assets/model/model.json';\r\nimport modelGroup from './assets/model/group1-shard1of1.bin';\r\nimport RNFS from 'react-native-fs';\r\n\r\nclass Home extends React.Component {\r\n  triggerModel = async () => {\r\n    await tf.ready();\r\n\r\n    //Successful\r\n    const model = await tf.loadGraphModel(\r\n      bundleResourceIO(modelJson, modelGroup),\r\n    );\r\n\r\n    //model.json and group1-shard1of1.bin exists in file system\r\n    //returns model.json file successfully\r\n    const modelJson1 = await RNFS.readFile(\r\n      `${RNFS.DocumentDirectoryPath}/model/model.json`,\r\n    );\r\n\r\n    //Throws TypeError: Network request failed\r\n    const model1 = await tf.loadGraphModel(modelJson1, {\r\n      weightUrlConverter: async (weightFileName) => {\r\n        return `file://${RNFS.DocumentDirectoryPath}/model/group1-shard1of1.bin`;\r\n      },\r\n    });\r\n\r\n    //Throws TypeError: Network request failed\r\n    const model2 = await tf.loadGraphModel(\r\n      `${RNFS.DocumentDirectoryPath}/model/model.json`,\r\n    );\r\n  };\r\n\r\n  render() {\r\n    return (\r\n      <View>\r\n        <Button onPress={() => this.triggerModel()}>Trigger Model</Button>\r\n      </View>\r\n    );\r\n  }\r\n}\r\n\r\nexport default Home;\r\n\r\n```",
