        "body": "**System information**\r\n- TensorFlow.js version (you are using):\r\n- I'm willing to contribute, just want to make sure this makes sense for someone else, and/or maybe there is already some work in progress related to this\r\n\r\n**Describe the feature and the current behavior/state.**\r\n\r\n## Actual\r\n\r\nOn my current understanding, building a simple custom layer (like a sum layer) is made by creating a CustomLayer Class\r\n\r\n```js\r\nconst tf = require('../tf');\r\n\r\nclass SumLayer extends tf.layers.Layer {\r\n\tconstructor(config) {\r\n\t\tsuper(config);\r\n\t\tthis.axis = config.axis;\r\n\t\tthis.keepDims = config.keepDims;\r\n\t}\r\n\t/**\r\n\t* Call() contains the actual numerical computation of the layer.\r\n\t*\r\n\t* It is \"tensor-in-tensor-out\". I.e., it receives one or more\r\n\t* tensors as the input and should produce one or more tensors as\r\n\t* the return value.\r\n\t*\r\n\t* Be sure to use tidy() to avoid WebGL memory leak.\r\n\t*/\r\n\tcall(input) {\r\n\t\treturn tf.tidy(() => {\r\n\t\t\treturn tf.sum(input, this.axis, this.keepDims);\r\n\t\t});\r\n\t}\r\n\r\n\t/**\r\n\t* GetConfig() generates the JSON object that is used\r\n\t* when saving and loading the custom layer object.\r\n\t*/\r\n\tgetConfig() {\r\n\t\tconst config = super.getConfig();\r\n\t\tObject.assign(config, {axis: this.axis});\r\n\t\treturn config;\r\n\t}\r\n\r\n\t/**\r\n\t* The static className getter is required by the\r\n\t* registration step (see below).\r\n\t*/\r\n\tstatic get className() {\r\n\t\treturn 'SumLayer';\r\n\t}\r\n}\r\n/**\r\n * Regsiter the custom layer, so TensorFlow.js knows what class constructor\r\n * to call when deserializing an saved instance of the custom layer.\r\n */\r\ntf.serialization.registerClass(SumLayer);\r\n```\r\n\r\n## Expected\r\n\r\nMaybe we could directly create a custom layer like : \r\n```js\r\nconst axis = 2;\r\nconst keepDims = false;\r\nconst layer = tf.layers.fn((a) => tf.sum(a, axis, keepDims))\r\n```\r\n\r\n**Will this change the current api? How?**\r\n\r\nI do not feel it will change anything to current api\r\n\r\n**Who will benefit with this feature?**\r\n\r\nFaster prototyping, less code.",
