        "body": "**System information**\r\n- TensorFlow.js version (you are using): 3.0.0\r\n- Are you willing to contribute it (Yes/No): Yes\r\n\r\n**Describe the feature and the current behavior/state.**\r\n\r\nSupport complex64 input in tf.transpose\r\n\r\n**Will this change the current api? How?**\r\n\r\nIt will support the tf.transpose operation instead of throwing the error \"GPGPUProgram does not support complex64 input\", as seen at #4507\r\n\r\n**Who will benefit with this feature?**\r\n\r\nEveryone that needs to work with tf.transpose and complex64, f.e. trasposing the output of a STFT operation.\r\n\r\n**Any Other info.**\r\n\r\nCreating this issue as @pyu10055 asked me to in #4507. Also, this feature will close that issue.\r\n",
