        "body": "**System information**\r\nBrowser: Chrome `88.0.4324.96`\r\nOS: macOS `10.15.7`\r\n\r\nCopying and pasting the [Via a script tag](https://github.com/tensorflow/tfjs/blob/master/tfjs-backend-wasm/README.md#via-a-script-tag) section of the WASM readme throws the following errors:\r\n\r\n```html\r\n<script src=\"https://cdn.jsdelivr.net/npm/@tensorflow/tfjs@1.4.0/dist/tf.min.js\" type=\"text/javascript\"></script>\r\n<script src=\"https://cdn.jsdelivr.net/npm/@tensorflow/tfjs-backend-wasm/dist/tf-backend-wasm.js\"></script>\r\n<script>tf.setBackend('wasm').then(() => {});</script>\r\n```\r\n\r\n```\r\nkernel_registry.ts:111 Uncaught Error: The kernel 'undefined' for backend 'wasm' is already registered\r\n    at Object.c [as registerKernel] (kernel_registry.ts:111)\r\n    at register_all_kernels.ts:200\r\n    at tf-backend-wasm.js:20\r\n    at tf-backend-wasm.js:21\r\n```\r\n\r\n```\r\nengine.ts:235 Uncaught (in promise) Error: Backend name 'wasm' not found in registry\r\n    at t.<anonymous> (engine.ts:235)\r\n    at tf.min.js:2\r\n    at Object.next (tf.min.js:2)\r\n    at tf.min.js:2\r\n    at new Promise (<anonymous>)\r\n    at r (tf.min.js:2)\r\n    at t.setBackend (engine.ts:233)\r\n    at Object.t.setBackend (globals.ts:276)\r\n    at index.html:3\r\n```",
