        "body": "**System information**\r\n- TensorFlow.js version (you are using): 3.0.0\r\n- Are you willing to contribute it (Yes/No):\r\n\r\n**Describe the feature and the current behavior/state.**\r\nI am trying to convert a TF2 saved model using [sparse_dense_matmul](https://www.tensorflow.org/api_docs/python/tf/sparse/sparse_dense_matmul) (or alternatively [matmul](https://www.tensorflow.org/api_docs/python/tf/linalg/matmul) with `b_is_sparse=True`, but can't as tfjs does not support that yet.\r\n\r\n**Will this change the current api? How?** The only change will be a new transformation for people to use.\r\n\r\n**Who will benefit with this feature?**\r\n\r\nI am using this function in my TF model to multiply a tensor from my training batch against a transformation matrix (not dissimilar from a [DFT matrix](https://en.wikipedia.org/wiki/DFT_matrix)). My transformation matrix happens to be very sparse (full of 0s in my case) and is suitable to be converted to a sparse tensor. However, I would not get the speed boost (I would get the memory boost) that comes with a sparse tensor unless I use a function like sparse_dense_matmul or sparse matmul.\r\n\r\nFunctionality like this is very useful in signal processing, particularly audio processing (my use case) where transformation matrices like this exist.\r\n\r\n**Any Other info.**\r\n",
