        "author_association": "NONE",
        "active_lock_reason": null,
        "body": "<em>Please make sure that this is a feature request. As per our [GitHub Policy](https://github.com/tensorflow/tensorflow/blob/master/ISSUES.md), we only address code/doc bugs, performance issues, feature requests and build/installation issues on GitHub. tag:feature_template</em>\r\n\r\n\r\n**System information**\r\n- TensorFlow.js version (you are using): 3.0.0\r\n- Are you willing to contribute it (Yes/No): would if I could, but the scope's a bit beyond me right now\r\n\r\n\r\n\r\n**Describe the feature and the current behavior/state.**\r\n\r\nA version of tfjs that works within `WorkletGlobalScope` (for my use case, `AudioWorkletGlobalScope`) would be ideal for processing data off the main thread. Network requests [are disabled](https://github.com/WebAudio/web-audio-api/issues/1439) in this scope, and the global object (`self`) is undefined. The latter prevents a tfjs distribution from even being imported in this scope, and the former would prevent functions like `loadGraphModel` from working, as they rely on fetching data over the network.\r\n\r\nIn addition, TensorFlow and models can't be loaded on the main thread and transferred to an existing `WorkletNode` via `MessagePort` since the objects of course contain functions and hence can't be cloned.\r\n\r\n**Will this change the current api? How?**\r\n\r\nYes, in that model loading functions will need to be altered/added so that they accept prefetched data. I'm unclear on how much altering the use of `self` would change the API, or even how feasible that is.\r\n\r\n**Who will benefit with this feature?**\r\n\r\nAnyone looking to process data off the main thread in a `Worklet`. In my case, I'd like to do realtime audio processing using TensorFlow models in an [`AudioWorklet`](https://developers.google.com/web/updates/2017/12/audio-worklet).\r\n\r\n**Any Other info.**\r\n",
