        "body": "**System information**\r\n\r\n- Have I written custom code (as opposed to using a stock example script provided in TensorFlow.js): **yes**\r\n- OS Platform and Distribution (e.g., Linux Ubuntu 16.04): **Ubuntu 20.04.1 64 bit (kernel 5.8.0-43), GeForce GTX 980 Ti**\r\n- Mobile device (e.g. iPhone 8, Pixel 2, Samsung Galaxy) if the issue happens on mobile device: n/a\r\n- TensorFlow.js installed from (npm or script link): 2.8.5\r\n- TensorFlow.js version (use command below):\r\n- Browser version: **88.0.4324.182 (Official Build) (64-bit)**\r\n- Tensorflow.js Converter Version: n/a\r\n\r\n**Describe the current behavior**\r\n\r\nCaught an error\r\n\r\n![image](https://user-images.githubusercontent.com/1530410/108898900-a364c300-75cc-11eb-9f02-b34ec399189f.png)\r\n\r\nTraced it to `node_modules/@tensorflow/tfjs-backend-webgl/src/gpgpu_context.ts`:\r\n\r\n```ts\r\n  private createFence(gl: WebGLRenderingContext): FenceContext {\r\n    let query: WebGLQuery|WebGLSync;\r\n    let isFencePassed: () => boolean;\r\n\r\n    if (env().getBool('WEBGL_FENCE_API_ENABLED')) {\r\n      const gl2 = gl as WebGL2RenderingContext;\r\n\r\n      const sync = gl2.fenceSync(gl2.SYNC_GPU_COMMANDS_COMPLETE, 0);\r\n      gl.flush();\r\n\r\n      isFencePassed = () => {\r\n        const status = gl2.clientWaitSync(sync, 0, 0); // <----- failed here\r\n        return status === gl2.ALREADY_SIGNALED ||\r\n            status === gl2.CONDITION_SATISFIED;\r\n      };\r\n```\r\n\r\n**Describe the expected behavior**\r\n\r\n**Standalone code to reproduce the issue**\r\n\r\nUnfortunately it's almost impossible to create a good reproducible case for this kind of error.",
