        "body": "**System information**\r\n- Wrote custom code and tried stock examples.\r\n- macOS Big Sur 11.1\r\n- Safari iOS browser\r\n- TensorFlow.js installed from (npm and script link): 1.2 for script link & tfjs-core 3.1.0 npm version\r\n- Browser version: Safari Version 14.0.2 (16610.3.7.1.9)\r\n- Tensorflow.js Converter Version: 3.1.0\r\n\r\n\r\n\r\n**Describe the current behavior**\r\nOn Safari browsers when blurring the background of video tracks coming from a `navigator.mediaDevices.getUserMedia` stream, the blurred background seems stretched. \r\n\r\nAssuming this is a Safari only issue, I think an aspect ratio fix on the [cpuBlur](https://github.com/tensorflow/tfjs-models/blob/master/body-pix/src/blur.ts) function should do it. 😉\r\n\r\n**Describe the expected behavior**\r\ndrawBokehEffect expected behavior \r\n\r\n**Standalone code to reproduce the issue**\r\nOpening the codepen below in Safari should immediately reproduce the bug.\r\nhttps://codepen.io/guillaume250/pen/ZEBVPaG\r\n\r\n- Cheers\r\n",
