        "author_association": "NONE",
        "active_lock_reason": null,
        "body": "- OS Platform and Distribution (e.g., Linux Ubuntu 16.04): Only tried on Windows 10, Chrome 89.0.4389.82\r\n- TensorFlow.js installed from (npm or script link): from npm\r\n- TensorFlow.js version: 3.3.0\r\n\r\n\r\nI'm creating a library where some parts are using TensorFlow, and some aren't. I use Rollup to create my lib, and also to test it. The problem is that when I use classes from my lib that do not use TensorFlow, I still see the code from TensorFlow included in the bundle. The rest of my lib that I don't use is correctly tree shaken from the final bundle, but not tensorflow.\r\n\r\nBelow is the rollup config for generating my lib. Note that I'm generating an esm and umd version. I use the esm version in the test app where I'm expecting TensorFlow to be tree shaken.\r\n\r\n\r\n```\r\nimport typescript from '@rollup/plugin-typescript';\r\nimport commonjs from '@rollup/plugin-commonjs';\r\nimport { nodeResolve } from '@rollup/plugin-node-resolve';\r\nimport { terser } from \"rollup-plugin-terser\";\r\nimport nodePolyfills from 'rollup-plugin-node-polyfills';\r\nimport alias from 'rollup-plugin-alias';\r\nimport copy from 'rollup-plugin-copy';\r\nimport visualizer from 'rollup-plugin-visualizer';\r\n\r\nconst path = require('path');\r\n\r\nconst dev = (process.env.NODE_ENV !== 'production');\r\nconsole.log(`running in ${dev ? 'development' : 'production'} mode`);\r\n\r\nconst sourcemap = dev ? 'inline' : false;\r\n\r\n\r\nexport default [\r\n    {\r\n        input: 'src/sdk/index.ts',\r\n        output: [\r\n            {\r\n                file: 'dist/library/mylib.esm.js',\r\n                format: 'esm',\r\n                name: 'mylib',\r\n            },\r\n            {\r\n                file: 'dist/library/mylib.js',\r\n                format: 'umd',\r\n                name: 'mylib',\r\n            }\r\n        ],\r\n        watch: {\r\n            include: './src/sdk/**',\r\n            clearScreen: false,\r\n        },\r\n        plugins: [\r\n            alias({\r\n                entries: [\r\n                    {\r\n                        find: /@tensorflow\\/tfjs$/,\r\n                        replacement: path.resolve(__dirname, './custom_tfjs/custom_tfjs.js'),\r\n                    },\r\n                    {\r\n                        find: /@tensorflow\\/tfjs-core$/,\r\n                        replacement: path.resolve(__dirname, './custom_tfjs/custom_tfjs_core.js'),\r\n                    },\r\n                    {\r\n                        find: 'tensorflow/tfjs-core/dist/ops/ops_for_converter',\r\n                        replacement: path.resolve(__dirname, './custom_tfjs/custom_ops_for_converter.js'),\r\n                    },\r\n                ],\r\n            }),\r\n            nodePolyfills(),\r\n            nodeResolve({\r\n                browser: true,\r\n                preferBuiltins: false,\r\n            }),\r\n            commonjs(),\r\n            typescript(),\r\n            !dev && terser(),\r\n        ]\r\n    },\r\n];\r\n```\r\n\r\nWhen I inspect the lib output, I see some Object.defineProperty like this one for instance:\r\n```\r\nObject.defineProperty(Tensor, Symbol.hasInstance, {\r\n    value: (instance) => {\r\n        // Implementation note: we should use properties of the object that will be\r\n        // defined before the constructor body has finished executing (methods).\r\n        // This is because when this code is transpiled by babel, babel will call\r\n        // classCallCheck before the constructor body is run.\r\n        // See https://github.com/tensorflow/tfjs/issues/3384 for backstory.\r\n        return !!instance && instance.data != null && instance.dataSync != null &&\r\n            instance.throwIfDisposed != null;\r\n    }\r\n});\r\n```\r\nwhich from what I understand create side effects. \r\n\r\nI tried to play with the treeshake option of the nodeResolve plugin but that didn't help.\r\n\r\nI'm not super familiar with Rollup so maybe I'm missing something.\r\n\r\nAny help would be appreciated.\r\n\r\n",
