        "milestone": null,
        "comments": 1,
        "created_at": "2021-03-21T05:35:14Z",
        "updated_at": "2021-07-08T23:12:38Z",
        "closed_at": null,
        "author_association": "NONE",
        "active_lock_reason": null,
        "body": "<em>Please make sure that this is a bug. As per our\r\n[GitHub Policy](https://github.com/tensorflow/tensorflow/blob/master/ISSUES.md),\r\nwe only address code/doc bugs, performance issues, feature requests and\r\nbuild/installation issues on GitHub. tag:bug_template</em>\r\n\r\n**System information**\r\n- I used the code from the camera demo to extract the pose : https://github.com/tensorflow/tfjs/blob/master/tfjs-react-native/integration_rn59/components/webcam/realtime_demo.tsx\r\n- \r\n- OS Platform and Distribution (e.g., Linux Ubuntu 16.04): MacOS \r\n- Mobile device (e.g. iPhone 8, Pixel 2, Samsung Galaxy) if the issue happens on mobile device: iOS\r\n- TensorFlow.js installed from (npm or script link): npm\r\n- TensorFlow.js version (use command below): 2.7.0\r\n\r\n\r\n\r\n**Describe the current behavior**\r\nWhen I compile my app with expo, and display the performance monitor, I observe that every-time the app is fast refreshed, the RAM increases of 20MB.  So I start around 300 MB and after several fast refresh I reach +600 MB\r\n\r\nThe memory leak comes from the TensorCamera, since I don't observe any RAM increase when I comment it out. RAM increases steadily even when TensorCamera doesn't receive any prop.\r\n\r\n\r\n**Describe the expected behavior**\r\nNo increase of the RAM between two fast refresh. \r\n\r\n**Standalone code to reproduce the issue**\r\n\r\nhttps://github.com/tensorflow/tfjs/blob/master/tfjs-react-native/integration_rn59/components/webcam/realtime_demo.tsx\r\n\r\nthen\r\n```\r\nexpo start\r\n```\r\nand then fast refresh by saving several times the same file. \r\n\r\n",
