        "body": "<em>Please make sure that this is a feature request. As per our [GitHub Policy](https://github.com/tensorflow/tensorflow/blob/master/ISSUES.md), we only address code/doc bugs, performance issues, feature requests and build/installation issues on GitHub. tag:feature_template</em>\r\n\r\n\r\n**System information**\r\n- TensorFlow.js version (you are using):\r\n- Are you willing to contribute it (Yes/No):\r\n\r\n\r\n\r\n**Describe the feature and the current behavior/state.**\r\nCurrently the Tensorflow HOC available for React Native accepts an Expo Camera as a foundation for the component, the RNCamera and Expo camera share many similarities however.\r\n\r\n**Will this change the current api? How?**\r\nYes, but as RNCamera is heavily based on Expo camera, the fundamental behaviour should be the same\r\n \r\n**Who will benefit with this feature?**\r\nThis will allow many features for RNCamera to be used in conjuctio with tensorflow live image classification , including OCR, face recognition which is built into RNCamera\r\n**Any Other info.**\r\n",
