        "active_lock_reason": null,
        "body": "**System information**\r\n- Have I written custom code (as opposed to using a stock example script provided in TensorFlow.js): Yes\r\n- OS Platform and Distribution (e.g., Linux Ubuntu 16.04): React Native 0.63.4\r\n- Mobile device (e.g. iPhone 8, Pixel 2, Samsung Galaxy) if the issue happens on mobile device: iPhone 8 Plus\r\n- TensorFlow.js installed from (npm or script link): npm\r\n- TensorFlow.js version (use command below): 3.0.0\r\n- Browser version:\r\n- Tensorflow.js Converter Version:\r\n\r\n\r\n\r\n**Describe the current behavior**\r\nI have the [TensorCamera](https://js.tensorflow.org/api_react_native/0.5.0/#cameraWithTensors) for React Native mounted on a tab in my [Tab Navigator](https://reactnavigation.org/docs/bottom-tab-navigator/). Switching between tabs causes the total memory usage to increase every time TensorCamera is remounted. I've narrowed the memory leak down to the Tensorcamera as replacing it with Expo Camera caused no memory leaks when switching between tabs. I've also commented out the onReady function so it shouldn't be related to undisposed tensors.\r\n\r\n**Describe the expected behavior**\r\nRe-mouting the TensorCamera shouldn't cause memory leaks\r\n\r\n**Standalone code to reproduce the issue**\r\nProvide a reproducible test case that is the bare minimum necessary to generate\r\nthe problem. If possible, please share a link to Colab/CodePen/any notebook.\r\n```\r\nconst TensorCamera = cameraWithTensors(Camera);\r\n```\r\n...\r\n```\r\n               <TensorCamera\r\n                  ref={cameraRef}\r\n                  style={styles.camera}\r\n                  type={Camera.Constants.Type.back}\r\n                  zoom={0}\r\n                  cameraTextureHeight={textureDims.height}\r\n                  cameraTextureWidth={textureDims.width}\r\n                  resizeHeight={tensorDims.height}\r\n                  resizeWidth={tensorDims.width}\r\n                  resizeDepth={3}\r\n                  onReady={handleCameraStream}\r\n                  autorender={true}\r\n                />\r\n```\r\n**Other info / logs** Include any logs or source code that would be helpful to\r\ndiagnose the problem. If including tracebacks, please include the full\r\ntraceback. Large logs and files should be attached.\r\n![IMG_2767](https://user-images.githubusercontent.com/44853346/113497214-e40b0280-94cf-11eb-8042-7723f8b6c887.PNG)\r\n![IMG_2770](https://user-images.githubusercontent.com/44853346/113497220-e79e8980-94cf-11eb-85bb-5e5af8ef86c0.PNG)\r\n",
