        "active_lock_reason": null,
        "body": "Hi! I'm creating an Android application that performs image classification and OCR on the same image. My original plan was to use two separate cameras in the app; RNCamera to perform live OCR, and Tensor Camera to form image classification. I chose this approach because I haven't had success using Tensor Camera for live OCR, and RNCamera doesn't allow users to easily access the camera stream, making live image classification challenging. \r\n\r\nUpon implementing this idea, I ran into a dependency issue with expo-camera and RNCamera. Is there a way to run both in the same app? If not does Tensor Camera include support for live text recognition?",
