        "author_association": "CONTRIBUTOR",
        "active_lock_reason": null,
        "body": "`WASM` backend is supported in `NodeJS` environments as per  \r\n<https://blog.tensorflow.org/2020/03/introducing-webassembly-backend-for-tensorflow-js.html>\r\n\r\n> In Node.js, the WASM backend is a great solution for devices that don’t support the TensorFlow binary or you don’t want to build it from source.\r\n\r\nAnd yes, loading `tfjs` and `tfjs-backend-wasm` and setting backend to `wasm` works fine - but then how to use it?\r\n\r\n```js\r\ntf.loadGraphModel('file://models/model.json');\r\n```\r\n\r\n```error\r\nRuntimeError: abort(TypeError: Only HTTP(S) protocols are supported).\r\n```\r\n\r\nSo I've started a dev web server just to load models using *http://...* - and it works - but that really goes against idea of running NodeJS with WASM.\r\n\r\nI understand the scope of this issue is more of an enhancement, but since `WASM` is supported in `NodeJS`, expectation is that it should work natively.\r\n\r\nAlso, note that missing local file I/O handler is just for model loader as loading *.wasm files from local filesystem works just fine.\r\n\r\nJust as a test, I've tried loading `tfjs-node` with `tfjs-backend-wasm` as `tfjs-node` provides local file I/O handler, but that causes hard conflict.\r\n\r\nEnvironment: TFJS 3.3.0 on Ubuntu 20.10 with NodeJS 15.14.0\r\n",
