        "body": "Steps to reproduce:\r\n1. Access https://tensorflow.github.io/tfjs/e2e/benchmarks/local-benchmark/index.html\r\n2. Use the default backend `wasm` and click `Run benchmark`.\r\n3. See the left table\r\n\r\nPeak memory | 19.63 MB\r\n-- | --\r\n4. Switch to `webgl` backend. Change any flags, for example `webgl pack`. And then switch back to `wasm`.\r\n5. Click `Run benchmark` again. The peak memory increases as below:\r\n\r\nPeak memory | 33.51 MB\r\n-- | --\r\n6. If we repeat 4 and 5, you will find the peak memory gets bigger and bigger. However, if you don't change the flag, the peak memory won't change. It happens for all backends that the flag will affect the peak memory. It seems like a bug.\r\n\r\n\r\n",
