        "body": "**System information**\r\n- TensorFlow.js version 2.6.0:\r\n- Are you willing to contribute it No\r\n\r\n\r\n\r\n**Describe the feature and the current behavior/state.**\r\nReadVariableOp, DatasetToSingleElement, BatchDatasetV2, ParallelMapDatasetV2, SentencepieceOp, TensorSliceDataset, VarHandleOp, SentencepieceDetokenizeOp\r\nAre all currently not supported by tensorflow.js, but some of them have similar operations that already exist in tensorflow.js\r\n**Will this change the current api? How?**\r\nYes, It would add new operations to tensorflow.js\r\n**Who will benefit with this feature?**\r\nMany people working in the NLP space would be able to use these two operations to bundle tokenizers into their models on tensorflow.js with these operations\r\n**Any Other info.**\r\nI have not been able to sucessfully test the functionality of SentencePieceOp (it may already work) but TensorSliceDataset definitely does not exist, the closest existing function in tfjs being tf.data.CSVDataset.",
