        "milestone": null,
        "comments": 2,
        "created_at": "2021-05-08T06:58:06Z",
        "updated_at": "2021-05-12T15:28:54Z",
        "closed_at": null,
        "author_association": "COLLABORATOR",
        "active_lock_reason": null,
        "body": "There are too many duplicated codes in all backends. For example:\r\n1. Validation code. For the parameter validation, we can do it in the front end instead of doing it in all backends. \r\n2. For some ops, they are using *ImplCPU for all backends. \r\n3.  For some ops, they don't need a backend specific kernel. For example, `Identity`, `ExpandDims`.\r\n4. For some common optimizations, for example, in some situations, this operation is just return an Identity of itself or reshape. \r\n\r\nAll of above situations, maybe we can put them in the front end (`fjs-core/src/ops/`) instead of making a copy in all backends.\r\n\r\nTake #5025 as an example,  it seems that `SparseSegmentMean` is using a cpu implementation. I suppose it will be same for all backends although only cpu/webgl was covered in that PR.",
