        "body": "**System information**\r\n- Have I written custom code (as opposed to using a stock example script provided in TensorFlow.js): No\r\n- OS Platform and Distribution (e.g., Linux Ubuntu 16.04): iOS 14.5\r\n- Mobile device (e.g. iPhone 8, Pixel 2, Samsung Galaxy) if the issue happens on mobile device: iPhone 12\r\n- TensorFlow.js installed from (npm or script link): https://www.npmjs.com/package/@tensorflow/tfjs\r\n- TensorFlow.js version (use command below): 3.6.0\r\n- Browser version: n/a\r\n- Tensorflow.js Converter Version: @tensorflow/tfjs-react-native@0.5.0\r\n\r\n**Describe the current behavior**\r\nI'm trying to use tfjs-models/universal-sentence-encoder within a React Native app by following these instructions. However, I get the following error when I try to load the model:\r\n\r\n`TypeError: undefined is not an object (evaluating '_universalSentenceEncoder.default.load'`\r\n\r\n**Describe the expected behavior**\r\nIt should load the use model, compute embeddings, and print them to the console.\r\n\r\n**Standalone code to reproduce the issue**\r\n```\r\nimport React, { useEffect, useState } from 'react';\r\nrequire('@tensorflow/tfjs');\r\nconst use = require('@tensorflow-models/universal-sentence-encoder');\r\n\r\nexport default function App() {\r\n\r\n  useEffect(() => {\r\n    console.log(\"App is starting...\")\r\n    \r\n    const init = async () => {\r\n      // initialize state variables \r\n      // console.log(\"App is initializing services...\")\r\n      \r\n      // Load the model.\r\n      try {\r\n        use.load().then((model: any) => {\r\n          // Embed an array of sentences.\r\n          const sentences = [\r\n            'Hello.',\r\n            'How are you?'\r\n          ];\r\n          model.embed(sentences).then((embeddings: any) => {\r\n            // `embeddings` is a 2D tensor consisting of the 512-dimensional embeddings for each sentence.\r\n            // So in this example `embeddings` has the shape [2, 512].\r\n            embeddings.print(true /* verbose */);\r\n          });\r\n        });\r\n      }\r\n      catch (err) {\r\n        console.log(err);\r\n      }\r\n    };\r\n  }, []);`\r\n\r\n```",
