        "author_association": "NONE",
        "active_lock_reason": null,
        "body": "Tensorflow is a well known as an Open Source framework for machine learning.\r\nI believe it being Open Source is one of the main features of Tensorflow.\r\n\r\nIn: https://www.tensorflow.org/js/tutorials\r\nTensorflow refers users to ml5.js.\r\n\r\nml5.js used to be an Open Source library as well, but recently decided to use a proprietary license (https://medium.com/ml5js/ml5-js-code-of-conduct-4eb8fcae1ef7).\r\n\r\nSince Tensorflow is an important part of the Open Source community, I suggest that it should prefer avoiding to refer users to ml5.js.\r\n\r\nIf ml5.js is necessary to use Tensorflow.js easily, that's a problem, because it can no longer be done trough Open Source software (which is part of why one should use Tensorflow). In that case, it's hopeful an Open Source replacement for ml5.js will exist in the future, or that Tensorflow.js becomes easier to use, or some mixture of both.\r\nI believe, howerver, that ml5.js can no longer be considered part of the Tensorflow ecosystem.",
