        "author_association": "COLLABORATOR",
        "active_lock_reason": null,
        "body": "When we switch backend, for some global tensors, it needs to call [moveData](https://github.com/tensorflow/tfjs/blob/master/tfjs-core/src/engine.ts#L422) to move data from the original backend to the current backend by using [readSync](https://github.com/tensorflow/tfjs/blob/master/tfjs-core/src/engine.ts#L425). However, for webgpu backend, it doesn't support read data back synchronously from GPU to CPU. So if the data is already in GPU, and we switch backend from webgpu to other backends. The readSync error will be thrown.\r\n\r\nWe should provide a solution to support moving data asynchronously. \r\n",
