        "body": "<em>Please make sure that this is a feature request. As per our [GitHub Policy](https://github.com/tensorflow/tensorflow/blob/master/ISSUES.md), we only address code/doc bugs, performance issues, feature requests and build/installation issues on GitHub. tag:feature_template</em>\r\n\r\n\r\n**System information**\r\n- TensorFlow.js version (you are using): TFJS TFLite API 0.0.1-alpha.4\r\n- Are you willing to contribute it (Yes/No): I could, but I am yet to explore the TFJS TFLite API completely\r\n\r\n\r\n\r\n**Describe the feature and the current behavior/state.**\r\nAs of now, the TFJS TFLite API does not allow extracting metadata from TFLite models, which I think would be pretty useful.\r\n\r\n**Will this change the current api? How?**\r\nI believe this should not change the working of the current API, maybe we could have a new method in the [tflite.TFLiteModel](https://js.tensorflow.org/api_tflite/0.0.1-alpha.4/#class:TFLiteModel) class to extract the metadata.\r\n\r\n**Who will benefit with this feature?**\r\nI believe this would be quite useful for all users, especially for folks to use random TFLite models they find on the web with TFJS. This will also help convey the best practice when using the model. I am not sure if this is on the TFJS Roadmap (should I create a separate feature request for this?) but if a tool similar to Android Studio ML Model Binding Plugin or the TFLite Android Code Generator was to be made for TFJS, it would imply adding support to extract model metadata.\r\n\r\n**Any Other info.**\r\nThanks, @pyu10055 for suggesting to send this over as a feature request at TensorFlow.js Q&A at Google IO",
