        "body": "As subject line says, trivial math operation `tf.mod` is missing from `tfjs-backend-wasm`...\r\n\r\n```log\r\nindex.js:646 Error: Kernel 'Mod' not registered for backend 'wasm'\r\n    at Engine.runKernel (engine.ts:540)\r\n    at mod_ (mod.ts:63)\r\n    at mod__op (operation.ts:51)\r\n    at executeOp (arithmetic_executor.ts:45)\r\n    at operation_executor.ts:61\r\n    at engine.ts:467\r\n    at Engine.scopedRun (engine.ts:478)\r\n    at Engine.tidy (engine.ts:465)\r\n    at tidy (globals.ts:192)\r\n    at operation_executor.ts:60\r\n```\r\n\r\nIssue found during porting and optimizing MobileNet-v3 with CenterNet object detection model: <https://github.com/vladmandic/mb3-centernet>\r\n\r\nEnvironment: TFJS 3.6.1 with WASM backend with Edge/Chromium 90 on Windows 10\r\n",
