        "body": "<em>Please make sure that this is a bug. As per our\r\n[GitHub Policy](https://github.com/tensorflow/tensorflow/blob/master/ISSUES.md),\r\nwe only address code/doc bugs, performance issues, feature requests and\r\nbuild/installation issues on GitHub. tag:bug_template</em>\r\n\r\n**System information**\r\n- Have I written custom code (as opposed to using a stock example script provided in TensorFlow.js): Yes\r\n- OS Platform and Distribution (e.g., Linux Ubuntu 16.04): Windows 10\r\n- Mobile device (e.g. iPhone 8, Pixel 2, Samsung Galaxy) if the issue happens on mobile device: N/A\r\n- TensorFlow.js installed from (npm or script link): npm install @tensorflow/tfjs\r\n- TensorFlow.js version (use command below): 3.6.0\r\n- Browser version: Chrome 90 on Windows 10\r\n- Tensorflow.js Converter Version: 3.6.0\r\n\r\nHyperlinks are capitalized to prevent confusion(because the color settings(and blue filter) on my monitor make it hard to see the difference between them)\r\n\r\n**Describe the current behavior**\r\nI used transfer learning using a pretrained model from the Tensorflow Object Detection API, which i converted to tensorflow-js using the tensorflow-converter API in python. View the ipynb notebook [HERE](https://colab.research.google.com/drive/13NLcyDDHeenFDymqfiGMGeF4o_p1l-Wb). I then followed @hugozanini's [REPO](https://github.com/hugozanini/TFJS-object-detection) which had a template for using your tensorflow object detection models in javascript;  I copied the index.json file and put it into a sandbox, replacing his model.json file with mine. The repo which contains it can be found [here](https://github.com/dewball345/ear-model-test)\r\n\r\n**Describe the expected behavior**\r\nI was expecting the model to work and the program to run normally, like it did in this [DEMO](https://glitch.com/edit/#!/real-time-object-detection). Instead, I got \r\n\r\n```\r\nindex.js:1437 TypeError: Cannot read property 'children' of undefined\r\n    at operation_mapper.js:409\r\n    at Array.forEach (<anonymous>)\r\n    at operation_mapper.js:403\r\n    at Array.forEach (<anonymous>)\r\n    at OperationMapper.mapFunction (operation_mapper.js:401)\r\n    at operation_mapper.js:163\r\n    at Array.reduce (<anonymous>)\r\n    at OperationMapper.transformGraph (operation_mapper.js:162)\r\n    at GraphModel.loadSync (graph_model.js:159)\r\n    at GraphModel._callee$ (graph_model.js:119)\r\n    at tryCatch (runtime.js:62)\r\n    at Generator.invoke [as _invoke] (runtime.js:288)\r\n    at Generator.prototype.<computed> [as next] (runtime.js:114)\r\n    at asyncGeneratorStep (asyncToGenerator.js:3)\r\n    at _next (asyncToGenerator.js:25)\r\n```\r\n\r\n\r\n\r\n**Standalone code to reproduce the issue**\r\nProvide a reproducible test case that is the bare minimum necessary to generate\r\nthe problem. If possible, please share a link to Colab/CodePen/any notebook.\r\n\r\n[HERE](https://colab.research.google.com/drive/13NLcyDDHeenFDymqfiGMGeF4o_p1l-Wb) is the colab notebook I used to train my model\r\n[HERE](https://codesandbox.io/s/purple-dawn-n2nbh?file=/src/index.js) is the sandbox where I tried to use the tensorflow.js model \r\n\r\n**Other info / logs** Include any logs or source code that would be helpful to\r\ndiagnose the problem. If including tracebacks, please include the full\r\ntraceback. Large logs and files should be attached.\r\n\r\nError Message:\r\n\r\n```\r\nindex.js:1437 TypeError: Cannot read property 'children' of undefined\r\n    at operation_mapper.js:409\r\n    at Array.forEach (<anonymous>)\r\n    at operation_mapper.js:403\r\n    at Array.forEach (<anonymous>)\r\n    at OperationMapper.mapFunction (operation_mapper.js:401)\r\n    at operation_mapper.js:163\r\n    at Array.reduce (<anonymous>)\r\n    at OperationMapper.transformGraph (operation_mapper.js:162)\r\n    at GraphModel.loadSync (graph_model.js:159)\r\n    at GraphModel._callee$ (graph_model.js:119)\r\n    at tryCatch (runtime.js:62)\r\n    at Generator.invoke [as _invoke] (runtime.js:288)\r\n    at Generator.prototype.<computed> [as next] (runtime.js:114)\r\n    at asyncGeneratorStep (asyncToGenerator.js:3)\r\n    at _next (asyncToGenerator.js:25)\r\n```",
