        "body": "<em>Please make sure that this is a feature request. As per our [GitHub Policy](https://github.com/tensorflow/tensorflow/blob/master/ISSUES.md), we only address code/doc bugs, performance issues, feature requests and build/installation issues on GitHub. tag:feature_template</em>\r\n\r\n\r\n**System information**\r\n- TensorFlow.js version (you are using): 3.6.0\r\n- Are you willing to contribute it (Yes/No): Yes\r\n\r\n**Describe the feature and the current behavior/state.**\r\n\r\nCurrently one can save models to anywhere but there is no documentation or code on saving optimizer states.\r\n\r\n**Will this change the current api? How?**\r\n\r\nOptimizers should have a function to get state information to then write somewhere or a helpful save function that will use the same api the model saving functions use to save optimizer states.\r\n\r\n**Who will benefit with this feature?**\r\n\r\nPeople looking to use training checkpoints with optimizers like adam and rmsprop or use a checkpoint manager akin to the python api! This greatly helps us with reproducibility without having to start training from scratch again.\r\n\r\n**Any Other info.**\r\n\r\n\r\n",
