        "body": "I am having difficulty loading a model that has been converted using the 'TensorFlow.js converter' . Any help would be appreciated!\r\n\r\n**System information**\r\nGoogle Colab\r\nP5js\r\n\r\nTensorflow 2.5.0\r\nTensorFlow.js Converter v3.7.0\r\n\r\n**Describe the current behavior**\r\n\r\n- Unable to load a model that has been converted from 'keras_saved_model' into 'tfjs_layers_model' format using 'TensorFlow.js converter'. The following errors appear in console upon attempts to load via the P5.js editor & 'tf.loadLayersModel(MODEL_PATH)':\r\n\r\ninitializers.js:131 The shape of the input tensor ([null,148,148,256]) does not match the expectation of layer conv2d_1: [null,150,150,3]\r\ninitializers.js:131 The shape of the input tensor ([null,73,73,256]) does not match the expectation of layer conv2d_2: [null,150,150,3]\r\ninitializers.js:131 The shape of the input tensor ([null,69,69,128]) does not match the expectation of layer conv2d_3: [null,150,150,3]\r\ninitializers.js:131 The shape of the input tensor ([null,32,32,128]) does not match the expectation of layer conv2d_4: [null,150,150,3]\r\ninitializers.js:131 The shape of the input tensor ([null,30,30,64]) does not match the expectation of layer conv2d_5: [null,150,150,3]\r\ninitializers.js:131 The shape of the input tensor ([null,14,14,64]) does not match the expectation of layer conv2d_6: [null,150,150,3]\r\ninitializers.js:131 The shape of the input tensor ([null,5,5,32]) does not match the expectation of layer conv2d_7: [null,150,150,3]\r\n\r\nutil_base.js:154 Uncaught (in promise) Error: Based on the provided shape, [256], the tensor should have 256 values but has 0\r\n    at Wv (util_base.js:154)\r\n    at Mw (engine.js:1086)\r\n    at Lw (tape.js:54)\r\n    at Ww (engine.js:1190)\r\n    at RM (container.js:211)\r\n    at container.js:196\r\n    at c (runtime.js:63)\r\n    at Generator._invoke (runtime.js:293)\r\n    at Generator.next (runtime.js:118)\r\n    at bv (runtime.js:747)\r\n\r\n- Saving the model as 'keras' format (model.h5) and converting into 'tfjs_layers_model' format does not resolve the issue\r\n- Manually editting the model.json file resolves the \"initializers.js:131...\" errors but not the \"util_base.js:154...\" error\r\n\r\n**Standalone code to reproduce the issue**\r\nhttps://colab.research.google.com/drive/1EhMHvteiQqPGvZKti6cvjGuDspDXzDXP?usp=sharing\r\n\r\n**Other info / logs**\r\n[model.zip](https://github.com/tensorflow/tfjs/files/6598599/model.zip)\r\n[modelConverted.zip](https://github.com/tensorflow/tfjs/files/6598601/modelConverted.zip)\r\n[modelDescription.zip](https://github.com/tensorflow/tfjs/files/6598625/modelDescription.zip)\r\n",
