        "active_lock_reason": null,
        "body": "TFJS changed behavior several times how to deal with tree-shaking and side-effects,  \r\nbut it's still broken.\r\n\r\nFor example, `tfjs-backend-webgl:package.json` has this:\r\n\r\n```json\r\n  \"sideEffects\": [\r\n    \"./dist/register_all_kernels.js\",\r\n    \"./dist/flags_webgl.js\",\r\n    \"./dist/base.js\",\r\n    \"./dist/index.js\"\r\n  ]\r\n```\r\n\r\nWhat is the point of `sideEffects` pointing to JS files in `/dist/`? \r\n\r\n1. If user is using prebuilt bundles of tfjs from `/dist`, it's irrelevant\r\n2. If user is trying to build `@tensorflow/tfjs-backend-webgl`, it will be **broken**\r\n3. If user is trying to build `@tensorflow/tfjs`, then this is relevant  \r\n   since the meta-bundle imports from `@tensorflow/tfjs-backend-webgl/dist/index.js` which references `./dist`\r\n\r\nAt minimum, sideEffects should point to TS files in `./src`, as well as JS `./dist`  \r\n\r\nNote that `tfjs-backend-webgl:package.json` is used only as an example, same bad behavior is present in all `tfjs` packages.  \r\n\r\nProof that it's broken?  \r\nBuilding custom TFJS bundle and build works just fine, but then fails in runtime with.  \r\n\r\n```log\r\nUncaught Error: Cannot evaluate flag 'CPU_HANDOFF_SIZE_THRESHOLD': no evaluation function found.\r\n    at Environment.evaluateFlag (environment.ts:138)\r\n```\r\n\r\nWhy? Because entire import `./src/flags_webgl.ts` was dropped due to tree-shaking  \r\nand flags never got registered to start with.\r\n\r\nIf I re-run build with bundler set to simply ignore any `sideEffects` fiels within TFJS,  \r\nit works just fine, but bundle is massive.\r\n\r\nOn the other hand, even better solution is not to use `sideEffects` at all by moving flat code in those files into a method (e.g. `init()` and calling that method from single place in the parent code where needed. I don't see why should any code be immediately executed during import - that is just a bad practice.  \r\n\r\nEnvironment: TFJS 3.7.0 on Ubuntu 21.04\r\n",
