        "body": "<em>Please make sure that this is a bug. As per our\r\n[GitHub Policy](https://github.com/tensorflow/tensorflow/blob/master/ISSUES.md),\r\nwe only address code/doc bugs, performance issues, feature requests and\r\nbuild/installation issues on GitHub. tag:bug_template</em>\r\n\r\n**System information**\r\n- Have I written custom code (as opposed to using a stock example script provided in TensorFlow.js): No\r\n- OS Platform and Distribution (e.g., Linux Ubuntu 16.04):\r\n- Mobile device (e.g. iPhone 8, Pixel 2, Samsung Galaxy) if the issue happens on mobile device: N/A\r\n- TensorFlow.js installed from (npm or script link): Github\r\n- TensorFlow.js version (use command below): 11ea58c8fe2ba94d6cb27d9714a5941601ae62a7\r\n- Browser version: N/A\r\n- Tensorflow.js Converter Version: N/A\r\n\r\n\r\n\r\n**Describe the current behavior**\r\ntfjs-layers bundles contain a copy of tfjs-core.\r\n\r\nLooking at the node bundle, we see that it includes the full definition for the `Tensor` class (search for `class Tensor`), which is defined in tfjs-core. I'm pretty sure this should not be bundled in tfjs-layers. Strangely, the node bundle still `require`s tfjs-core in `var tfc = require('@tensorflow/tfjs-core');`. \r\n**Describe the expected behavior**\r\ntfjs-core should be external to the tfjs-layers bundle. None of the classes defined in tfjs-core should be duplicated in the tfjs-layers bundle.\r\n\r\n**Standalone code to reproduce the issue**\r\nProvide a reproducible test case that is the bare minimum necessary to generate\r\nthe problem. If possible, please share a link to Colab/CodePen/any notebook.\r\n\r\nAll commands run in `tfjs-layers`:\r\n\r\nTo enable visualization for all tfjs-layers bundles, replace `visualize` with `true` in the rollup config:\r\n`sed -i 's/if (visualize)/if (true)/g' rollup.config.js`\r\n\r\nThen, run `yarn build-deps && yarn build-npm` to build the bundles.\r\n\r\nThen, open the generated visualization website at `dist/tf-layers.*.html`\r\n\r\n**Other info / logs** Include any logs or source code that would be helpful to\r\ndiagnose the problem. If including tracebacks, please include the full\r\ntraceback. Large logs and files should be attached.\r\n",
