        "author_association": "COLLABORATOR",
        "active_lock_reason": null,
        "body": "Unlike other backends, webgpu is using compute shader to implement each ops. The advantage of compute shader is that we can randomly access any locations in input buffers and write to any position of output buffer. So for webgpu, it's more easier to implement some fused ops, which can help improve the performance greatly.\r\nThe problem is how we to provide the fused ops for webgpu and which level it should be happen: Provide a fused model or a normal model and parse it to fused ops and then call to webgpu?\r\n\r\nWe would like to discuss the details to achieve the target.",
