        "body": "**System information**\r\n- TensorFlow.js installed from (npm or script link): <script src=\"https://cdn.jsdelivr.net/npm/@tensorflow/tfjs@3.7.0/dist/tf.min.js\"></script>\r\n- TensorFlow.js version (use command below): 3.7.0\r\n- Tensorflow.js Converter Version: 3.7.0\r\n\r\n\r\n**Describe the current behavior**\r\nI'd like to use `tf.keras.backend.rnn` to build a model that can recurrently generate samples. When I use some `tf.keras.layers.Layer` in `step_function`, which is one of parameters of  `tf.keras.backend.rnn`, the model will raise errors in tensorflow.js, but can successfully run in python. \r\nI have simplified the source to build the model, my actual source uses more `tf.keras.layers.Layer` in `step`. The python code is as below:\r\n```\r\nimport numpy as np\r\nimport tensorflow as tf\r\nfrom tensorflow.keras.layers import Input, Layer, Embedding\r\nfrom tensorflow.keras import Model\r\nimport tensorflow.keras.backend as K\r\n\r\nclass TestLayer(Layer):\r\n    def __init__(self):\r\n        super().__init__()\r\n        self.embedding = Embedding(input_dim=3, output_dim=3)\r\n        \r\n    def step(self, _, params):\r\n        idx = params[0]\r\n        y = self.embedding(idx)\r\n        next_idx = tf.random.categorical(y, 1)[:, 0]\r\n        return next_idx, [next_idx]\r\n    \r\n    def call(self, max_len):\r\n        initial_idx = K.tile(K.constant([0], dtype='int64'), [K.shape(max_len)[0]])\r\n        unused = K.tile(K.constant([[[0]]]), [K.shape(max_len)[0], K.shape(max_len)[1], 1])\r\n        _, sample, _ = K.rnn(self.step, unused, [initial_idx], input_length=K.shape(max_len)[1])\r\n        return sample\r\n    \r\n\r\nmax_len = Input([None])\r\n\r\ntest_layer = TestLayer()\r\nsample = test_layer(max_len)\r\nmodel = Model(inputs=max_len, outputs=sample)\r\nprint(model.predict(np.zeros([4, 5])))\r\nmodel.save('test')\r\n```\r\nAnd my conversion command is as follow:\r\n```\r\ntensorflowjs_converter --input_format=tf_saved_model test <somewhere>/test\r\n```\r\nThe javascript/html code is as below:\r\n```\r\n<html>\r\n<head>\r\n    <script src=\"https://cdn.jsdelivr.net/npm/@tensorflow/tfjs@3.7.0/dist/tf.min.js\"></script>\r\n\r\n</head>\r\n<script>\r\n    tf.loadGraphModel('http://127.0.0.1:5000/test/model.json').then(\r\n        (model) => {\r\n            model.executeAsync(tf.zeros([4, 5]), ['Identity']).then(x=>x.print());\r\n        }\r\n    );\r\n</script>\r\n</html>\r\n```\r\nI use Flask to run a server to provide the files needed. The loaded model will raise errors like:\r\n`Uncaught (in promise) Error: Cannot compute the outputs [Identity] from the provided inputs [input_3:0]. Consider providing the following inputs: []. Alternatively, to avoid the dynamic ops, use model.execute() and specify the inputs [Identity]`\r\n\r\n\r\n**Describe the expected behavior**\r\nI wonder if there exist some ways to build this model in python and convert it to tensorflow.js without transplanting the source to javascript.\r\n\r\n\r\n**Standalone code to reproduce the issue**\r\nThe attachment is the related source. The `flask_run.py` should run before opening `test.html`.\r\n[test.zip](https://github.com/tensorflow/tfjs/files/6642492/test.zip)\r\n\r\n**Other info / logs** \r\nI ensure that the `output_node_name` 'Identity' is the final output node of model. And I have tried to use `tf.keras.backend.rnn` without any `tf.keras.layers.Layer` in `step`, the model can successfully return results. \r\n",
