        "active_lock_reason": null,
        "body": "**System information**\r\n\r\n- Have I written custom code (as opposed to using a stock example script provided in TensorFlow.js): Repo link below\r\n- OS Platform and Distribution (e.g., Linux Ubuntu 16.04): Darwin 20.5.0 x64 (macOS Big Sur 11.4)\r\n- TensorFlow.js installed from (npm or script link): npm\r\n- System information:\r\n\r\n```js\r\nconst os = require('os');\r\nconst { node, v8 } = process.versions;\r\nconst plat = `OS: ${os.type()} ${os.release()} ${os.arch()}\\nNode.js: ${node}\\nV8: ${v8}`;\r\nconst cpus = os.cpus().map(cpu => cpu.model).reduce((o, model) => {\r\n  o[model] = (o[model] || 0) + 1;\r\n  return o;\r\n}, {});\r\nconst cpusInfo = Object.keys(cpus).map((key) => {\r\n  return `${key} x ${cpus[key]}`;\r\n}).join('\\n');\r\n\r\nconsole.log(`${plat}\\nCPU: ${cpusInfo}\\nMemory: ${os.totalmem() / (1024 * 1024)} MiB\\n`);\r\n\r\n// OS: Darwin 20.5.0 x64\r\n// Node.js: 14.17.0\r\n// V8: 8.4.371.23-node.63\r\n// CPU: Intel(R) Core(TM) i9-9880H CPU @ 2.30GHz x 16\r\n// Memory: 32768 MiB\r\n```\r\n\r\n**Describe the current behavior**\r\n\r\n`Resident Set Size` keeps getting bigger.\r\n\r\n**Standalone code to reproduce the issue**\r\n\r\nhttps://github.com/SukkaW/tfjs-memory-leak-example\r\n\r\n**Other info / logs** Include any logs or source code that would be helpful to\r\n\r\n```sh\r\ngit clone https://github.com/SukkaW/tfjs-memory-leak-example && cd tfjs-memory-leak-example\r\nnpm i\r\nnode index.js\r\n```\r\n\r\n```\r\nPlatform info:\r\nOS: Darwin 20.5.0 x64\r\nNode.js: 14.17.0\r\nV8: 8.4.371.23-node.63\r\nCPU: Intel(R) Core(TM) i9-9880H CPU @ 2.30GHz x 16\r\nMemory: 32768 MiB\r\n\r\ndaisy 146083840 2035808\r\ndaisy 152354816 2035808\r\ndaisy 153202688 2035808\r\ndaisy 157728768 2035808\r\ndaisy 163180544 2035808\r\ndaisy 167120896 2035808\r\ndaisy 169332736 2035808\r\ndaisy 169385984 2035808\r\ndaisy 170770432 2035808\r\ndaisy 172281856 2035808\r\ndaisy 174080000 2035808\r\ndaisy 174120960 2035808\r\ndaisy 176160768 2035808\r\n.....\r\n```\r\n",
