        "body": "**System information**\r\n- OS Platform and Distribution - Windows 10\r\n- Browser: Chrome, Version 91.0.4472.106\r\n- Tensorflow.js Converter Version: 3.7.0\r\n\r\nMy model was trained using the tensorflow/models/research/object_detection/model_main.py script in TF 1.15 using the following command:\r\n`python model_main.py --logtostderr --model_dir=training --pipeline_config_path=training/ssdlite_mobilenet_v3_small_320x320_coco.config`\r\n\r\nI then exported the inference graph:\r\n`python export_inference_graph.py --input_type image_tensor --pipeline_config_path training/ssdlite_mobilenet_v3_large_320x320_coco.config --trained_checkpoint_prefix training/model.ckpt-400000 --output_directory inference_graph`\r\n\r\nThen converted it to tensorflowjs with tensorflowjs_converter version 3.7.0:\r\n`tensorflowjs_converter --input_format=tf_saved_model --output_node_names='detection_boxes,detection_classes,detection_features,detection_multiclass_scores,detection_scores,num_detections,raw_detection_boxes,raw_detection_scores' --saved_model_tags=serve --signature_name=serving_default --output_format=tfjs_graph_model ./inference_graph/saved_model ./inference_graph/web_model`\r\n\r\nThen when I try running it in the web:\r\n```\r\nasync function init() {\r\n        console.log(\"Start model load\");\r\n        model = await tf.loadGraphModel('./model.json');\r\n        console.log(\"Finish model load\");\r\n}\r\n\r\nasync function predict() {\r\n        console.log(\"executing model\");\r\n        const img = document.getElementById('img_example');\r\n\r\n        tf_img = tf.browser.fromPixels(img);\r\n        tf_img = tf_img.expandDims(0);\r\n\r\n        console.log(tf_img.shape)  // Image dimension is\r\n\tvidHeight = tf_img.shape[1];\r\n        vidWidth = tf_img.shape[2];\r\n\r\n        //Perform the detection with your layer model:\r\n        let predictions = await model.executeAsync(tf_img);\r\n\r\n        for (let i = 0; i < predictions.length; i++){\r\n            console.log(predictions[i].dataSync())\r\n        }\r\n\r\n        //Draw box around the detected object:\r\n        renderPredictionBoxes(predictions[4].dataSync(), predictions[1].dataSync(), predictions[2].dataSync());\r\n        //Dispose of the tensors (so it won't consume memory)\r\n        tf_img.dispose();    \r\n}\r\n```\r\n\r\nI get the broadcast shapes error:\r\n```\r\nUncaught (in promise) Error: Operands could not be broadcast together with shapes 1554 and 1554,2.\r\n    at iT (broadcast_util.js:81)\r\n    at where_ (where.js:61)\r\n    at where__op (operation.js:51)\r\n    at logical_executor.js:78\r\n    at operation_executor.js:83\r\n    at engine.js:467\r\n    at e.t.scopedRun (engine.js:478)\r\n    at e.t.tidy (engine.js:465)\r\n    at BI (globals.js:192)\r\n    at operation_executor.js:83\r\n```\r\n\r\nI assume that 2 is the number of classes, and 1554 is the derivative of the size of the picture.\r\nI tried another model with 3 classes and it was 3 at the end.\r\n\r\n[web_model.zip](https://github.com/tensorflow/tfjs/files/6732461/web_model.zip)\r\n",
