        "body": "This issue is part of the [Adopt Bazel](https://github.com/tensorflow/tfjs/projects/17) project and tracks converting the monorepo package to build with Bazel. For details on how to convert a package, take a look at the [Bazel Migration](https://github.com/tensorflow/tfjs/blob/master/BAZEL_MIGRATION.md) doc.\r\n\r\nThe following is the list of TensorFlow.js monorepo packages that need to be converted to build with Bazel. They are sorted in dependency order and split into different phases that can be worked on in parallel, however, **all packages in one phase do not necessarily need to be finished before the next phase**, and each issue lists its own dependencies. Packages higher up in each phase are more likely to unblock later packages.\r\n\r\nIf you're working on one of these issues, be sure to assign it to yourself or ask someone to assign it to you.\r\n\r\n#### Phase 0:\r\n- #5275 \r\n\r\n#### Phase 1:\r\n- #5276\r\n- #5277\r\n- #5282\r\n- #5284\r\n- #5278 (tests depend on webgl)\r\n\r\n#### Phase 2:\r\n- #5279\r\n\r\n#### Phase 3:\r\n- #5280 \r\n\r\n#### Phase 4:\r\n- #5281\r\n\r\n#### Phase 5:\r\n- #5285\r\n\r\n#### Other Packages to migrate later:\r\n- [ ] #5283",
