        "active_lock_reason": null,
        "body": "@rthadur @lina128\r\nI studied the object detection project of tfjs and found that the code of `tf.loadGraphModel(weights).executeAsync(input)` has some bugs when it is called.\r\nBug description:\r\nWhen there is a detected object in the input picture, the program is normal, as shown in the figure.\r\n![ksnip_20210705-103113](https://user-images.githubusercontent.com/41098760/124410046-27e60000-dd7c-11eb-8934-4bc6145d336f.png)\r\nAs can be seen from the above figure, the object has been detected normally, and there is no error message in the chrome console.Let's look at a bug, as shown in the figure below:\r\n![ksnip_20210705-103511](https://user-images.githubusercontent.com/41098760/124410277-b6f31800-dd7c-11eb-809d-822f94fc5d5a.png)\r\nWhen I upload a picture without an object to be detected by the detector, the `executeAsync` function will throw an error message and terminate the program at the same time.\r\nThis happened when I used the camera to detect it. When there is no object to be detected in the first frame or other frames in the camera, an error will be reported and the program will be terminated.\r\n##### This is my complete project code:https://drive.google.com/file/d/11uuOqKprEc5Ot30WuWRwwxMbSaDb7Lk-/view?usp=sharing\r\n- There is my code and model in this project\r\n- Have my profile\r\n- Steps for usage:\r\n```shell\r\n# 1. Unzip\r\n# 2. Install dependencies with yarn\r\nyarn\r\n# 3. Run\r\nyarn start\r\n```\r\nI want the program to not display this kind of error message in pictures without detected objects, and the program can run normally.I tried many exception catching methods, such as try catch, ErrorBoundary tag, etc., but nothing worked. I think it’s not Reactjs's problem, but tfjs's problem.\r\nSo please experts help me, thank you.",
