        "body": "**System information**\r\n- Have I written custom code (as opposed to using a stock example script provided in TensorFlow.js): No\r\n- OS Platform and Distribution (e.g., Linux Ubuntu 16.04): macOS Big Sur 11.2.1\r\n- Mobile device (e.g. iPhone 8, Pixel 2, Samsung Galaxy) if the issue happens on mobile device: iOS/Android\r\n- TensorFlow.js installed from: npm\r\n- TensorFlow.js version: \"@tensorflow/tfjs\" -> 3.7.0 / \"@tensorflow/tfjs-react-native\" -> 0.6.0\r\n\r\n**Describe the current behavior**\r\nI'm trying to user the back camera `Camera.Constants.Type.back` from the `cameraWithTensors` component. The main issue I'm facing is that the tensor image returned back from the callback is flipped horizontally, so my model cant detect the text properly, since it's not a real text. I tried to flip the tensor with `tf.image.flipLeftRight(tensor);` but nothing is happening. I believe the issue is happening when the tensor is generated from the GL texture but I can't tell where since my knowledge of GL is very limited.\r\n\r\n**Describe the expected behavior**\r\nImage tensor to be returned with the proper orientation as seen on the preview. As you can see on the image below, preview is on the right orientation but when converting the tensor to an image to see the result, it's flipped. This doesnt happen with `Camera.Constants.Type.front`\r\n\r\n![Screenshot_20210707-111202_Stamp Free Carrier](https://user-images.githubusercontent.com/19332669/124753973-8b5d6280-df21-11eb-9b91-b8592d04f083.jpg)\r\n\r\n\r\n**Standalone code to reproduce the issue**\r\n```\r\n<TensorCamera\r\n          // Standard Camera props\r\n          style={styles.camera}\r\n          type={Camera.Constants.Type.back}\r\n          zoom={0}\r\n          // tensor related props\r\n          cameraTextureHeight={textureDims.height}\r\n          cameraTextureWidth={textureDims.width}\r\n          resizeHeight={840}\r\n          resizeWidth={400}\r\n          resizeDepth={3}\r\n          onReady={handleImageTensorReady}\r\n          autorender={AUTORENDER}\r\n        />\r\n```\r\n\r\n\r\n\r\n",
