        "author_association": "MEMBER",
        "active_lock_reason": null,
        "body": "This bug tracks a group of possibly related failures in continuous integration that seem to be caused by network connectivity issues.\r\n\r\nYarn fails to fetch a package due to \"trouble with [the] network connection\"\r\n- https://console.cloud.google.com/cloud-build/builds/37c7c9fa-7722-4da1-b1cf-a87551b0a652;step=0?project=learnjs-174218\r\n- https://console.cloud.google.com/cloud-build/builds/82e4de50-5b99-4ca6-b2af-ec1d332fff1d;step=6?project=learnjs-174218\r\n\r\nBrowserstack disconnects during a test. These errors are mostly suppressed by [run_flaky.js](https://github.com/tensorflow/tfjs/blob/master/scripts/run_flaky.js), but a network issue may be the root cause of them.\r\n- TODO(mattsoulanille): Add an example of this type of error.",
