        "body": "\r\n**System information**\r\n- Have I written custom code (as opposed to using a stock example script provided in TensorFlow.js): Yes (in the following gist)\r\n- OS Platform and Distribution: Chrome OS 91.0.4472.147 (64 bits)\r\n- Mobile device: ASUS ZenPhone Max Pro\r\n- TensorFlow.js installed from: script link\r\n- TensorFlow.js version: 3.8.0\r\n- Browser version: Chrome 91.0.4472.147 (64 bits)\r\n\r\n**Describe the current behavior**\r\n  - When backend is WASM, the result of tf.pool() with windowShape (filter size) [ 1, 1 ] seems wrong (compared to backend cpu or webgl). However, if windowShape is not [ 1, 1 ] (e.g. [ 1, 2 ] or [ 2, 1 ] or [ 2, 2 ] or ...), the result is correct.\r\n\r\n**Describe the expected behavior**\r\n  - Even if windowShape is [ 1, 1 ], tf.pool() in backend WASM should produce the same result as in backend cpu or webgl.\r\n\r\n**Standalone code to reproduce the issue**\r\n  - https://gist.github.com/ColorfulCakeChen/23cc2b6ad89eac100e68150bb134ae1e\r\n  - (The code could be pasted into any example console box of Tensorflow.js API web page (https://js.tensorflow.org/api/3.8.0/) to run.\r\n\r\n**Other info / logs** \r\n<pre>\r\nLoading \"https://cdn.jsdelivr.net/npm/@tensorflow/tfjs-backend-wasm/dist/tf-backend-wasm.js\"\r\nwindowShape = 1,1\r\nbackend = wasm\r\nTensor \r\n    [ [[0  , 0  , 200],],         // WRONG!\r\n\r\n      [[201, 102, 210],]]         // WRONG!\r\nbackend = cpu\r\nTensor\r\n    [ [[100, 101, 102],],\r\n\r\n      [[300, 301, 302],]]\r\nbackend = webgl\r\nTensor\r\n    [ [[100, 101, 102],],\r\n\r\n      [[300, 301, 302],]]\r\n\r\nwindowShape = 1,2\r\nbackend = wasm\r\nTensor\r\n    [ [[110, 111, 112],],\r\n\r\n      [[310, 311, 312],]]\r\nbackend = cpu\r\nTensor\r\n    [ [[110, 111, 112],],\r\n\r\n      [[310, 311, 312],]]\r\nbackend = webgl\r\nTensor\r\n    [ [[110, 111, 112],],\r\n\r\n      [[310, 311, 312],]]\r\n\r\nwindowShape = 2,1\r\nbackend = wasm\r\nTensor\r\n    [ [[200, 201, 102],],\r\n\r\n      [[300, 301, 302],]]\r\nbackend = cpu\r\nTensor\r\n    [ [[200, 201, 102],],\r\n\r\n      [[300, 301, 302],]]\r\nbackend = webgl\r\nTensor\r\n    [ [[200, 201, 102],],\r\n\r\n      [[300, 301, 302],]]\r\n</pre>",
