        "body": "Good day!\r\n\r\nI have integrated Unity WebGL with TensorflowJS.\r\nWhen calling the JavaScript script from Unity, I need to return the search result for objects detection.\r\nThe result must be obtained synchronously, since it is used in Unity for post-processing (realtime, in the same frame).\r\n\r\nHow can I use execute instead of executeAsync for object detection (mobilenet v3)?\r\n\r\nNow, when I try to call executeAsync, I get the error:\r\nUncaught (in promise) Error: This execution contains the node 'Postprocessor/BatchMultiClassNonMaxSuppression/map/while/Exit_2', which has the dynamic op 'Exit'. Please use model.executeAsync() instead. Alternatively, to avoid the dynamic ops, specify the inputs [Postprocessor/BatchMultiClassNonMaxSuppression/map/TensorArrayStack/TensorArrayGatherV3]",
