        "body": "<em>Please make sure that this is a feature request. As per our [GitHub Policy](https://github.com/tensorflow/tensorflow/blob/master/ISSUES.md), we only address code/doc bugs, performance issues, feature requests and build/installation issues on GitHub. tag:feature_template</em>\r\n\r\n\r\n**System information**\r\n- TensorFlow.js version (you are using): tensorflowjs==3.8.0\r\n- Are you willing to contribute it (Yes/No): No\r\n\r\n\r\n\r\n**Describe the feature and the current behavior/state.**\r\n* I tried to convert pretrained tensorflow model from [here](https://github.com/soCzech/TransNetV2/tree/master/inference) to tfjs, but I get following error,\r\n`ValueError: Unsupported Ops in the model before optimization\r\nUnsortedSegmentSum, RightShift, LeftShift`\r\n* So I used `--skip_op_check` option and converted as tfjs successfully, but when I run it on browser , I get following error.\r\n  * with `webgl` backend: `Error: spaceToBatchND for rank > 4 with a WebGL backend not implemented yet`\r\n  * with `cpu` backend: `TypeError: Unknown op 'LeftShift'`\r\n\r\n\r\n**Will this change the current api? How?**\r\n* The ops that stated above can be handled.\r\n\r\n**Who will benefit with this feature?**\r\n* Anyone who uses tfjs\r\n\r\n**Any Other info.**\r\nThank you for this great work. 🙏 🙏 ",
