        "body": "FATAL ERROR, tf.softmax may compute incorrect output when webgl mode is set, such as tf.setBackend('webgl');\r\n\r\nBefore softmax.\r\nTensor\r\n```\r\n    [[[[-0.0293463, -1000000000, -1000000000, ..., -1000000000, -1000000000, -1000000000],\r\n       [-0.2220541, 0.231505   , -1000000000, ..., -1000000000, -1000000000, -1000000000],\r\n       [0.0011374 , -0.0965061 , -0.0123992 , ..., -1000000000, -1000000000, -1000000000],\r\n       ...,\r\n       [0.0958247 , 0.0556024  , 0.1016628  , ..., -0.0275311 , -1000000000, -1000000000],\r\n       [-0.0398366, 0.0641379  , 0.1550138  , ..., -0.1018429 , -0.216876  , -1000000000],\r\n       [0.259409  , -0.5869865 , 0.1881166  , ..., 0.4390099  , -0.0278636 , 0.0095359  ]],\r\n```\r\n\r\nAfter softmax...\r\n\r\nprint.js:34 Tensor\r\n\r\n```\r\n    [[[[3.4028234663852886e+38, 3.4028234663852886e+38, 3.4028234663852886e+38, ..., 3.4028234663852886e+38, 3.4028234663852886e+38, 3.4028234663852886e+38],\r\n       [0.3885149             , 0.6114851             , 0                     , ..., 0                     , 0                     , 0                     ],\r\n       [0.345599              , 0.3134487             , 0.3409523             , ..., 0                     , 0                     , 0                     ],\r\n       ...,\r\n       [0.0180443             , 0.0173329             , 0.01815               , ..., 0.0159502             , 0                     , 0                     ],\r\n```",
