        "author_association": "CONTRIBUTOR",
        "active_lock_reason": null,
        "body": "Recently due to tint changed the shared memory size policy, all webgpu conformance should fail. However, e2e failed to catch this error. There are two reasons for this:\r\n1. The predict results of most models are objects, instead of arrays. Current implementation assumes that the predict results are arrays, which results in some fake pass. This can be fixed by https://github.com/tensorflow/tfjs/pull/5384.\r\n2. Models with tensor input still got passed with https://github.com/tensorflow/tfjs/pull/5384 applied, though they are indeed failed due to tint change. This is because the input for tensor are some special values(such as zeros), and so does the predict results. We should change those tensor values to guarantee the test is valid. ",
