        "author_association": "MEMBER",
        "active_lock_reason": null,
        "body": "As discussed, it would be very valuable to the community to have a point of reference somewhere for a table that summarizes all supported TFJS ops and on which backends each has been implemented or not, and if so, if that is full or partial support.\r\n\r\nSomething like this:\r\n\r\n```\r\nOp Name   |   JS   |   WASM   |   WebGL   |   React Native   |   Node.js   |   WebGPU   |   etc...\r\n----------------------------------------------------------------------------------------------------\r\nRelu           |  Yes   |   Partial   |      Yes       |           Yes          |      Yes       |         No       |    No\r\n```\r\n\r\n\r\nThis would help requests like this to be able to identify the offending op:\r\n\r\nhttps://discuss.tensorflow.org/t/weird-output-with-tfjs-on-wasm-backend-with-no-warnings/3326\r\n\r\n",
