        "author_association": "CONTRIBUTOR",
        "active_lock_reason": null,
        "body": "Hi, I'm getting following error when trying to use `tensorflowjs_converter` to convert a Bidirectional LSTM-CRF model that uses the [CRF from TensorFlow addons](https://www.tensorflow.org/addons/api_docs/python/tfa/layers/CRF):\r\n\r\nCommand:\r\n```\r\ntensorflowjs_converter --input_format=tf_saved_model --output_format=tfjs_graph_model <tf_model> <tfjs_model>\r\n```\r\n\r\nOutput:\r\n```\r\ntensorflowjs/converters/tf_saved_model_conversion_v2.py\", line 154, in optimize_graph\r\n    ', '.join(unsupported))\r\nValueError: Unsupported Ops in the model before optimization\r\nReverseSequence\r\n```\r\nCan `tensorflowjs_converter` please support this operation? Thanks!\r\n",
