        "author_association": "COLLABORATOR",
        "active_lock_reason": null,
        "body": "To resolve #5205, we are using uniforms instead of constants to reduce shader variants. There are two kinds of uniforms. One is shapes uniforms, which is behind a flag `WEBGL_USE_SHAPES_UNIFORMS` and is for shaders common parts used in `shader_compiler`. The other is the custom uniforms `customUniforms`, which is used for each kernel's `userCode` part. So to make a kernel whole uniform, we need to 1) enable shapes uniform 2) use custom uniforms. Currently, below kernels have supported whole uniform.\r\n1. unary ops\r\n2. binary ops\r\n3. im2col program\r\n4. encode/decode [packed] matrix program\r\n5. depthwiseconv2d\r\n6. reshape\r\n\r\nSince webgl supports lots of kernels, we'd like to support the most frequently used kernels list instead of all of them. Once we confirm that uniforms do bring big warmup time advantages and small impact for the predict time, we will finish all of them and totally switch to uniforms by default. Here I'd like to collect the ops that are heavily used, but haven't been supported with uniforms.\r\n\r\nmatmul is the ono we are working on, but we met some [perf issue](https://github.com/tensorflow/tfjs/pull/5297/files#diff-ae73f9d8e507323398a73f338b6cba08e197afddf6595e7d9ab20161dcd526a1R88)\r\n",
