        "body": "I cannot figure out how to set the MoveNet tracking type to be a bounding box instead of keypoints. I can see it is an option in the source code, but have not been successful at setting it correctly in the detectorConfig. \r\nThis is the code I have right now. How do I edit the detectorConfig variable to specify the bounding box tracker type?\r\n\r\n`const detectorConfig = {modelType: poseDetection.movenet.modelType.SINGLEPOSE_LIGHTNING};\r\nconst detector = await poseDetection.createDetector(poseDetection.SupportedModels.MoveNet, detectorConfig);`\r\n ",
