        "author_association": "CONTRIBUTOR",
        "active_lock_reason": null,
        "body": "as subject line says, operation `RotateWithOffset` is missing from `tfjs-node` backend:\r\n\r\n```log\r\nUncaught (in promise) Error: Kernel 'RotateWithOffset' not registered for backend 'tensorflow'\r\n    at Engine.runKernel (engine.ts:548)\r\n    at rotateWithOffset_ (rotate_with_offset.ts:58)\r\n    at Object.rotateWithOffset__op [as rotateWithOffset] (operation.ts:51)\r\n    at HandPipeline.estimateHands (/Users/../Documents/.././node_modules/@vladmandic/human/dist/human.node.js:7901)\r\n    at async predict5 (/Users/../Documents/../../node_modules/@vladmandic/human/dist/human.node.js:7958)\r\n    at async /Users/../Documents/../../node_modules/@vladmandic/human/dist/human.node.js:11687\r\n```\r\n\r\nthis is a known item originally reported in #4606 which is closed as author has switched to solution not based on nodejs  \r\n\r\nhowever, discussion in original pr #3560 that implemented op for other kernels suggests that it should be doable for `tfjs-node` as well, but there was never any follow-up\r\n\r\nenvironment: tfjs-node 3.8.0\r\n",
