        "body": "Change `x < 0 ? scale * alpha * (exp(x) - 1) : x` to `x < 0 ? scale * alpha * (exp(x) - 1) : scale * x`.\r\nFollow the definition in [this paper](https://arxiv.org/pdf/1706.02515.pdf).\r\n\r\nTo see the logs from the Cloud Build CI, please join either our [discussion](https://groups.google.com/a/tensorflow.org/forum/#!forum/tfjs) or [announcement](https://groups.google.com/a/tensorflow.org/forum/#!forum/tfjs-announce) mailing list.\n\n<!-- Reviewable:start -->\n---\nThis change is [<img src=\"https://reviewable.io/review_button.svg\" height=\"34\" align=\"absmiddle\" alt=\"Reviewable\"/>](https://reviewable.io/reviews/tensorflow/tfjs/5489)\n<!-- Reviewable:end -->\n",
