        "active_lock_reason": null,
        "body": "**System information**\r\n- Have I written custom code (as opposed to using a stock example script provided in TensorFlow.js):\r\n  Yes, I am using the estimateFace function of blazeface to detect the actual face in the image uploaded. Here is my code for reference:\r\n\r\n```\r\n  const detectFace = async () => {\r\n    const p = document.getElementById('result');\r\n\r\n    p.innerHTML = \"Detecting ...\";\r\n    console.log('Loading model...')\r\n    const model = await blazeface.load({scoreThreshold: 0.9});\r\n    console.log('Loaded model...')\r\n\r\n    var predictions;\r\n    var t0, t1;\r\n\r\n    for (j = 0; j < 5; j++) {\r\n        var t0 = performance.now()\r\n        // Pass in a video stream (or an image, canvas, or 3D tensor) to obtain an\r\n        // array of detected faces from the MediaPipe graph. If passing in a video\r\n        // stream, a single prediction per frame will be returned.\r\n        predictions = await model.estimateFaces(canvas, false);\r\n        console.log(predictions);\r\n        var t1 = performance.now()\r\n    }\r\n    if (predictions.length > 0) {\r\n        var prediction = predictions[0]\r\n        var text = \"The face detection completed in \" + (t1 - t0) + \" ms.<br>The face matched with predictions of \" + predictions[0].probability[0];\r\n        text += \"<br>\"\r\n        text += `<strong>Right Eye:</strong> <br> x = ${prediction.landmarks[0][0]}; y = ${prediction.landmarks[0][1]}<br>`\r\n        text += `<strong>Left Eye:</strong> <br> x = ${prediction.landmarks[1][0]}; y = ${prediction.landmarks[1][1]}<br>`\r\n        text += `<strong>Nose:</strong> <br> x = ${prediction.landmarks[2][0]}; y = ${prediction.landmarks[2][1]}<br>`\r\n        text += `<strong>Mouth:</strong> <br> x = ${prediction.landmarks[3][0]}; y = ${prediction.landmarks[3][1]}<br>`\r\n        text += `<strong>Right Ear:</strong> <br> x = ${prediction.landmarks[4][0]}; y = ${prediction.landmarks[4][1]}<br>`\r\n        text += `<strong>Left Ear:</strong> <br> x = ${prediction.landmarks[5][0]}; y = ${prediction.landmarks[5][1]}<br>`\r\n        renderPrediction(predictions);\r\n    } else {\r\n        var text = \"No face found in the image.\";\r\n    }\r\n    p.innerHTML = text;\r\n}\r\n```\r\n\r\n- OS Platform and Distribution (e.g., Linux Ubuntu 16.04):\r\n  This behaviour is reproducible across multiple OS of both desktop & mobile devices.\r\n\r\n- TensorFlow.js installed from (npm or script link):\r\n  https://cdn.jsdelivr.net/npm/@tensorflow/tfjs@3.1.0\r\n\r\n- TensorFlow.js version (use command below):\r\n  3.1.0  \r\n\r\n- Browser version:\r\n  this behavior is reproducible across multiple Browser versions including latest Chrome 92\r\n\r\n\r\n\r\n**Describe the current behavior**\r\nI am using the estimateFace function of blazeface to detect the actual face in the image uploaded. It is giving `0.9804430603981018` probability when I placed the mobile device image to detect. If the face is present in the frame, then it detects properly the face and results are as expected. But if we don't have any face in the frame, in that case the blazeface detection results shows that face exists while it is Mobile device with `0.9804430603981018` probability with 0.9 scoreThreshold. (Attaching the image for reference)\r\n\r\n**Describe the expected behavior**\r\nIt should show result of face detected only if any face is present in frame. If there is no face in frame, then there is no point to show face detected with such high probability i.e. of 98% for mobile device on frame.\r\n\r\n**Standalone code to reproduce the issue**\r\nYou can use the following codepen link to reproduce: https://codepen.io/deepanshusharma012/pen/MWmRaLW\r\nAttaching the mobile device pic on which the issue is reproducible, Also the blazeface models that I'm using for face detection.\r\n\r\n`Issue Reproducible Snapshot:` \r\n![Screenshot from 2021-08-14 17-17-12](https://user-images.githubusercontent.com/41855523/129445669-3d1142af-9f78-49ad-b085-b82153f84f39.png)\r\n\r\n`Image to reproduce the issue`\r\n![Proctoring Snapshot - 2021-08-12T11_03_56 388Z](https://user-images.githubusercontent.com/41855523/129445676-30295d7a-04b3-4b12-9da5-3056877a7174.jpeg)\r\n\r\n`Blazeface models used in face detection:`\r\n[blazeface models.zip](https://github.com/tensorflow/tfjs/files/6986431/blazeface.models.zip)\r\n\r\n",
