        "closed_at": null,
        "author_association": "NONE",
        "active_lock_reason": null,
        "body": "Hello,\r\n\r\nI trained ssd mobilenet v3 (large minimalistic), non-quantized standard model (tflite).\r\nThe execution time of this model in a native android application (google pixel 4a 5g) is 15 ms.\r\n\r\nUsing tensorflow.js version 3.3.0 (on later versions the model doesn't work) the time is:\r\ncpu backend - 2600 ms\r\nwebgl backend - 220 ms\r\nwasm backend - 180 ms\r\n\r\nI also tried the alpha version of tf-js tflite and it showed the best results - around 115-130 ms in any backend. But this is also very slow.\r\n\r\n1. Is it possible to somehow speed up these models?\r\n2. If not, what ssd models should be trained to have high performance on mobile phones?\r\n\r\nThanks.",
