        "author_association": "NONE",
        "active_lock_reason": null,
        "body": "When calling onBatchEnd with a batchSize = 1, and outputting the batch number, it counts to a number ~5x less than the number of input samples each epoch. I have confirmed the input tensor shape is correct. \r\n\r\n\r\n```javascript\r\n\r\nconst model = tf.sequential();\r\n\r\nmodel.add(tf.layers.lstm({ units: numLSTMCells, batchInputShape: [batchSize, windowSize, numInputs], returnSequences: true, dropout: 0.2, recurrentDropout: 0.2 }));\r\nmodel.add(tf.layers.lstm({ units: numLSTMCells, dropout: 0.2, recurrentDropout: 0.2 }));\r\nmodel.add(tf.layers.dense({ units: numOutputs, activation: 'linear' }));\r\n\r\nconst loss = tf.losses.meanSquaredError;\r\nconst optimizer = tf.train.sgd(learningRate);\r\nconst metrics = 'mse';\r\nmodel.compile({\r\n    loss: loss,\r\n    optimizer: optimizer,\r\n    metrics: [metrics]\r\n});\r\n\r\n// Train model\r\nconst hist = await model.fit(x, y,\r\n    {\r\n        batchSize: batchSize,\r\n        epochs: numEpochs,\r\n        validationSplit: 0.8,\r\n        callbacks: [tf.node.tensorBoard('/tmp/fit_logs' + logDir), new tf.CustomCallback({\r\n\r\n            onEpochEnd: async (epoch, logs) => {\r\n\r\n                // Save model weights after 100 epochs\r\n                if (epoch % 100 == 0) {\r\n\r\n                    // Save model\r\n                    await model.save('file://C://tmp/lstm');\r\n\r\n\r\n                    // Validate on unseen data\r\n                    let outputValidPred = await makePredictions(model, inputValidTensor);\r\n                    let expectedOuput = await outputValidTensor.array()\r\n\r\n                    for (i = 0; i < outputValidPred.length; i++) {\r\n                        console.log(outputValidPred[i], expectedOuput[i])\r\n                    }\r\n\r\n                }\r\n            },\r\n\r\n            onBatchEnd: async (batch, logs) => {\r\n                console.log(batch)\r\n            }\r\n\r\n        })\r\n\r\n        ]\r\n\r\n    });\r\n```",
