        "body": "This PR updates TypeScript from 3.5.3 to 4.4.2. It is still a work in progress:\r\n\r\n- [x] tfjs-converter: ~Tests need to be rewritten to avoid [spying on properties of imported objects](https://github.com/tensorflow/tfjs/blob/master/tfjs-converter/src/operations/executors/basic_math_executor_test.ts#L52-L59)~ This is done.\r\n- [ ] tfjs-vis: ~There's a test failure with TypeScript 4.4.2~: This is now fixed\r\n```\r\nChrome 92.0.4515.159 (Linux x86_64) perClassAccuracy renders histogram FAILED\r\n\tError: Expected 0 to be 1.\r\n\t    at <Jasmine>\r\n\t    at src/show/tensor_test.ts:32:61 <- src/show/tensor_test.js:58:65\r\n\t    at Generator.next (<anonymous>)\r\n\t    at fulfilled (src/show/tensor_test.js:40:58)\r\n```\r\n\r\n- [x] tfjs (union package): Depends on converter\r\n- [x] tfjs-node(-gpu), e2e: Depends on tfjs union.\r\n- [x] tfjs-backend-webgpu: Done.\r\n- [ ] tfjs-react-native: Haven't tried this package yet.\r\n- [ ] Add the `useUnknownInCatchVariables` flag to the tsconfig.\r\n\r\nTo see the logs from the Cloud Build CI, please join either our [discussion](https://groups.google.com/a/tensorflow.org/forum/#!forum/tfjs) or [announcement](https://groups.google.com/a/tensorflow.org/forum/#!forum/tfjs-announce) mailing list.\r\n\r\n<!-- Reviewable:start -->\r\n---\r\nThis change is [<img src=\"https://reviewable.io/review_button.svg\" height=\"34\" align=\"absmiddle\" alt=\"Reviewable\"/>](https://reviewable.io/reviews/tensorflow/tfjs/5561)\r\n<!-- Reviewable:end -->\r\n",
