        "body": "I am trying to load a tensorflow model in React Native. If I use tfjs in normal React, everything works fine, but in React Native the app crashes (strangely without an error).\r\n\r\n**System information**\r\n- OS Platform and Distribution (e.g., Linux Ubuntu 16.04): Windows 10\r\n- Mobile device (e.g. iPhone 8, Pixel 2, Samsung Galaxy) if the issue happens on mobile device: Android emulator as well as physical device\r\n- TensorFlow.js installed from (npm or script link): npm\r\n- TensorFlow.js version (use command below): \"@tensorflow/tfjs\": \"^3.9.0\", \"@tensorflow/tfjs-react-native\": \"^0.6.0\"\r\n- React Native 'Flavour': React Native CLI\r\n\r\n**Describe the current behavior**\r\nWhen the code (example below) is executed, the app crashes, but no error is provided, leaving me wondering where to search for help.\r\n\r\n**Describe the expected behavior**\r\nModel is loaded.\r\n\r\n**Standalone code to reproduce the issue**\r\n```\r\nimport * as tf from '@tensorflow/tfjs'\r\nimport '@tensorflow/tfjs-react-native'\r\nimport { bundleResourceIO } from '@tensorflow/tfjs-react-native'\r\n\r\nconst modelJson = require('./model.json');\r\nconst modelWeights = require('./group1-shard1of1.bin');\r\nconsole.log(modelJson)\r\nconsole.log(modelWeights)\r\nmodel = await tf.loadLayersModel(bundleResourceIO(modelJson, modelWeights));\r\n```\r\n\r\nHere are my model.json and group1-shard1of1.bin:\r\n[model_files.zip](https://github.com/tensorflow/tfjs/files/7095160/model_files.zip)\r\n\r\nThank you for your help.\r\n\r\n",
