        "body": "<em>Please make sure that this is a bug. As per our\r\n[GitHub Policy](https://github.com/tensorflow/tensorflow/blob/master/ISSUES.md),\r\nwe only address code/doc bugs, performance issues, feature requests and\r\nbuild/installation issues on GitHub. tag:bug_template</em>\r\n\r\n**System information**\r\n- Have I written custom code (as opposed to using a stock example script provided in TensorFlow.js): No\r\n- OS Platform and Distribution (e.g., Linux Ubuntu 16.04): Windows\r\n- Mobile device (e.g. iPhone 8, Pixel 2, Samsung Galaxy) if the issue happens on mobile device:\r\n- TensorFlow.js installed from (npm or script link):\r\n- TensorFlow.js version (use command below):\r\n- Browser version: 95.0.4629.2 (Official Build) canary (64-bit) (cohort: Clang-64)\r\n- Tensorflow.js Converter Version:\r\n\r\n\r\n\r\n**Describe the current behavior**\r\nUnit test has 14 failures on WebGL1 backend, most of them related to NaN propagation \r\n\r\n**Describe the expected behavior**\r\nAll passed\r\n\r\n**Standalone code to reproduce the issue**\r\nProvide a reproducible test case that is the bare minimum necessary to generate\r\nthe problem. If possible, please share a link to Colab/CodePen/any notebook.\r\n`cd tfjs-backend-webgl && yarn && yarn karma start --testEnv webgl1`\r\n\r\n**Other info / logs** Include any logs or source code that would be helpful to\r\ndiagnose the problem. If including tracebacks, please include the full\r\ntraceback. Large logs and files should be attached.\r\n```\r\nChrome 95.0.4629.2 (Windows 10) step kernel webgl1 {\"WEBGL_VERSION\":1,\"WEBGL_CPU_FORWARD\":false,\"WEBGL_SIZE_UPLOAD_UNIFORM\":0} propagates NaNs FAILED\r\n        Error: Arrays differ: actual[4] = 0, expected[4] = NaN.\r\n            at <Jasmine>\r\n            at expectArraysPredicate (C:/Users/haoyunfe/AppData/Local/Temp/karma-typescript-bundle--14664-0rZftuXqFvZf-.js:77834:23)\r\n            at expectArraysClose (C:/Users/haoyunfe/AppData/Local/Temp/karma-typescript-bundle--14664-0rZftuXqFvZf-.js:77788:16)\r\n            at C:/Users/haoyunfe/AppData/Local/Temp/karma-typescript-bundle--14664-0rZftuXqFvZf-.js:65502:28\r\n            at step (C:/Users/haoyunfe/AppData/Local/Temp/karma-typescript-bundle--14664-0rZftuXqFvZf-.js:65425:23)\r\n            at Object.next (C:/Users/haoyunfe/AppData/Local/Temp/karma-typescript-bundle--14664-0rZftuXqFvZf-.js:65406:53)\r\n            at fulfilled (C:/Users/haoyunfe/AppData/Local/Temp/karma-typescript-bundle--14664-0rZftuXqFvZf-.js:65397:58)\r\n......\r\n\r\n```",
