        "body": "**My Environment**\r\n\r\nTensorflow.js version: 3.9.0\r\n\r\nEnvironment: Google Colab GPU Instance\r\n\r\nImported libraries during conversion: tensorflow, tensorflowjs, tensorflow_io, tensorflow_text\r\n\r\n---\r\n\r\n**Model Structure**\r\n\r\n```\r\nmodel = tf.keras.Sequential([\r\n    encoder,\r\n    tf.keras.layers.Embedding(input_dim=len(encoder.get_vocabulary()),output_dim=64,mask_zero=True),\r\n    tf.keras.layers.Bidirectional(tf.keras.layers.LSTM(64)),\r\n    tf.keras.layers.Dense(64, activation='relu'),\r\n    tf.keras.layers.Dense(7)\r\n])\r\n```\r\n\r\n---\r\n\r\n**The Problem**\r\n\r\nI tried to convert a tensorflow saved model to a tensorflowjs model with\r\n```\r\n!tensorflowjs_converter \\\r\n    --input_format=tf_saved_model \\\r\n    --output_format=tfjs_graph_model \\\r\n    --signature_name=serving_default \\\r\n    --saved_model_tags=serve \\\r\n    /content/drive/MyDrive/textClassificationModel4/ \\\r\n    /content/drive/MyDrive/JSModels/textClassificationJS\r\n```\r\n\r\nIt failed due to unsupported ops\r\n\r\n```\r\nTraceback (most recent call last):\r\n  File \"/usr/local/bin/tensorflowjs_converter\", line 8, in <module>\r\n    sys.exit(pip_main())\r\n  File \"/usr/local/lib/python3.7/dist-packages/tensorflowjs/converters/converter.py\", line 813, in pip_main\r\n    main([' '.join(sys.argv[1:])])\r\n  File \"/usr/local/lib/python3.7/dist-packages/tensorflowjs/converters/converter.py\", line 817, in main\r\n    convert(argv[0].split(' '))\r\n  File \"/usr/local/lib/python3.7/dist-packages/tensorflowjs/converters/converter.py\", line 804, in convert\r\n    weight_shard_size_bytes, metadata_map)\r\n  File \"/usr/local/lib/python3.7/dist-packages/tensorflowjs/converters/converter.py\", line 533, in _dispatch_converter\r\n    metadata=metadata_map)\r\n  File \"/usr/local/lib/python3.7/dist-packages/tensorflowjs/converters/tf_saved_model_conversion_v2.py\", line 691, in convert_tf_saved_model\r\n    metadata=metadata)\r\n  File \"/usr/local/lib/python3.7/dist-packages/tensorflowjs/converters/tf_saved_model_conversion_v2.py\", line 154, in optimize_graph\r\n    ', '.join(unsupported))\r\nValueError: Unsupported Ops in the model before optimization\r\nStringSplitV2, RaggedTensorToTensor, StringLower, StaticRegexReplace\r\n```\r\n\r\n---\r\n\r\nCan you please help me with this?",
