        "body": "This is very low priority, and might not even be considered a bug. I discovered this while working on the Bazel refactor, and thought it should be documented. Feel free to close it if this seems unimportant.\r\n\r\n**Describe the current behavior**\r\nJasmine tests must be run in-order to pass. For example, see the [WEBGL_FLUSH_THRESHOLD tests\r\n](https://github.com/tensorflow/tfjs/blob/86d89eef18b0ac8c81faa4cced70603cb835945a/tfjs-backend-webgl/src/flags_webgl_test.ts#L365-L376). The second of these tests sets WEBGL_FLUSH_THRESHOLD to -2 ([even though it throws an error](https://github.com/tensorflow/tfjs/blob/86d89eef18b0ac8c81faa4cced70603cb835945a/tfjs-core/src/environment.ts#L131-L134)), so if it runs before the first test, the first test fails.\r\n\r\n**Describe the expected behavior**\r\nTests can be run in any order (i.e. without `jasmine: {random: false}` in the karma config).\r\n\r\n**Standalone code to reproduce the issue**\r\nRemove `jasmine: {random: false}` from `tfjs-backend-webgl/karma.conf.js` and run `yarn test` a few times. It should randomly fail a few tests, including the one above.\r\n\r\n**Other info / logs** Include any logs or source code that would be helpful to\r\ndiagnose the problem. If including tracebacks, please include the full\r\ntraceback. Large logs and files should be attached.\r\n",
