        "active_lock_reason": null,
        "body": "**System information**\r\n- Custom code\r\n- OS Platform and Distribution (MacOs BigSur):\r\n- TensorFlow.js installed from npm (latest)\r\n- Browser version: Chrome 93 Stable\r\n\r\nFrom my package.json:\r\n```\r\n \"dependencies\": {\r\n    \"@material-ui/core\": \"^4.12.3\",\r\n    \"@material-ui/icons\": \"^4.11.2\",\r\n    \"@tensorflow-models/face-landmarks-detection\": \"0.0.1\",\r\n    \"@tensorflow/tfjs-backend-cpu\": \"^3.8.0\",\r\n    \"@tensorflow/tfjs-backend-wasm\": \"^3.8.0\",\r\n    \"@tensorflow/tfjs-backend-webgl\": \"^2.4.0\",\r\n    \"@tensorflow/tfjs-converter\": \"^2.4.0\",\r\n    \"@tensorflow/tfjs-core\": \"^2.4.0\",\r\n    \"axios\": \"^0.21.1\",\r\n    \"react\": \"^17.0.2\",\r\n    \"react-dom\": \"^17.0.2\",\r\n    \"react-redux\": \"^7.2.4\",\r\n    \"react-router-dom\": \"^5.2.0\",\r\n    \"react-scripts\": \"^4.0.3\"\r\n  },\r\n```\r\n\r\nI have an image uploader using reactJs. All I'm doing is selecting an image file, creating an image element from with the img.src as the base64 encoded data of the image and passing it through the model to detect the landmark coordinates for that image.\r\n\r\n```\r\nasync function predictImage(file) {\r\n      return new Promise((rs, rj) => {\r\n        try {\r\n          const imageElement = document.createElement(\"img\");\r\n          imageElement.src = file;\r\n\r\n          imageElement.onload = async () => {\r\n           const preds = await model.estimateFaces({\r\n             input: imageElement,\r\n           });\r\n          return rs();\r\n        };\r\n        } catch (err) {\r\n          return rj(err);\r\n        }\r\n      });\r\n    }\r\n```\r\n\r\nI then store a selected set from the scaled mesh obj in a database for later comparison.\r\n\r\nGiven image A and image B;\r\nImage A: \r\n![jackie1](https://user-images.githubusercontent.com/5845311/133072304-a54731e8-5463-4cf6-a2c8-d5ef5dd1774a.jpeg)\r\nImage B: \r\n![salma1](https://user-images.githubusercontent.com/5845311/133072332-22fead35-b7e5-4d14-b845-b59c79947d0a.jpg)\r\n\r\nIf I run image A for the first time after loading the model I get a set of values, say from key point 6 from the [face mesh](https://github.com/tensorflow/tfjs-models/blob/master/face-landmarks-detection/mesh_map.jpg) provided, `[674.8491821289062,452.3935241699219,-8.618978500366211]`. I then upload image B and run it through the model without restarting or refreshing the page. If I then upload image A again, the values for the same key point 6 are now different from the first prediction of image A, `[336.6038818359375,387.3382263183594,-14.38083553314209]`.\r\n\r\nMore extensive list of the key point values from initial upload and secondary upload:\r\n![Screenshot 2021-09-13 at 12 03 11](https://user-images.githubusercontent.com/5845311/133072756-7c681f50-dfd1-4828-b9e8-8e37cd05e66a.png)\r\n\r\nIf I then refresh my page and upload image A, the values will match the first upload from the previous attempt.\r\n\r\nI have checked my upload logic to make sure I am not overlapping my images in any way and that I am passing a clean image to the model.\r\n\r\nIs this the expected behaviour? What would explain this behaviour? Has anyone else encountered this issue?\r\n",
