        "body": "<em>Please make sure that this is a build/installation issue. As per our [GitHub Policy](https://github.com/tensorflow/tensorflow/blob/master/ISSUES.md), we only address code/doc bugs, performance issues, feature requests and build/installation issues on GitHub. tag:build_template</em>\r\n\r\n**System information**\r\n- OS Platform and Distribution (e.g., Linux Ubuntu 16.04): Windows\r\n- Mobile device (e.g. iPhone 8, Pixel 2, Samsung Galaxy) if the issue happens on mobile device:\r\n- TensorFlow.js installed from (npm or script link): tfjs-node\r\n- TensorFlow.js version: 3.9.0\r\n- CUDA/cuDNN version: NA\r\n\r\n\r\nWhen installing qna model using npm install @tensorflow-models/qna, the package installed is referencing tensor v1.3.3 and NOT last major release v3.0.0 as indicated inside the last version of the source package.json. I assume NPM registry is NOT referencing the last commit of your sources.\r\n\r\nThanks\r\n",
