        "author_association": "CONTRIBUTOR",
        "active_lock_reason": null,
        "body": "can someone take a look at the **tfjs build issues**? none are fatal,  \r\nbut sheer number and variety is *not a good indicator*\r\n\r\nusing `tfjs` from main branch...\r\n\r\n- obsolete packages:\r\n\r\n```log\r\nwarning @babel/polyfill@7.12.1: 🚨 This package has been deprecated in favor of separate inclusion of a polyfill and regenerator-runtime (when needed). See the @babel/polyfill docs (https://babeljs.io/docs/en/babel-polyfill) for more information.\r\nwarning @babel/polyfill > core-js@2.6.12: core-js@<3.3 is no longer maintained and not recommended for usage due to the number of issues. Because of the V8 engine whims, feature detection in old core-js versions could cause a slowdown up to 100x even if nothing is polyfilled. Please, upgrade your dependencies to the actual version of core-js.\r\nwarning rollup > fsevents@2.1.3: \"Please update to latest v2.3 or v2.2\"\r\nwarning rollup-plugin-babel@4.4.0: This package has been deprecated and is no longer maintained. Please use @rollup/plugin-babel.\r\n```\r\n\r\n- incorrectly marked external packages:  \r\n  (this one is related to #4745 which did not resolve it fully)\r\n\r\n```log\r\nsrc/index.ts → dist/tf-backend-wasm.node.js...\r\nWARNING:  'os' is imported by wasm-out/tfjs-backend-wasm-threaded-simd.js, but could not be resolved – treating it as an external dependency\r\nWARNING:  'os' is imported by os?commonjs-external, but could not be resolved – treating it as an external dependency\r\ncreated dist/tf-backend-wasm.node.js in 9.9s\r\n```\r\n- obsolete api:\r\n\r\n```log\r\nwarning karma-typescript > url > querystring@0.2.0: The querystring API is considered Legacy. new code should use the URLSearchParams API instead.\r\n(node:3683) [DEP0150] DeprecationWarning: Setting process.config is deprecated. In the future the property will be read-only.\r\n```\r\n\r\n- incorrect dependencies:\r\n\r\n```log\r\nwarning \" > @rollup/plugin-typescript@3.1.1\" has incorrect peer dependency \"rollup@^1.20.0\".\r\n```\r\n\r\n- missing dependencies:\r\n\r\n```log\r\nwarning \" > @rollup/plugin-typescript@3.1.1\" has unmet peer dependency \"tslib@*\".\r\n```\r\n\r\n- incorrect exports:\r\n\r\n```log\r\nWARNING:  ../link-package-core/node_modules/@tensorflow/tfjs-core/dist/hash_util.js (23:12) 'default' is not exported by '../link-package-core/node_modules/long/src/long.js'\r\n```\r\n\r\n- incorrect imports:\r\n\r\n```log\r\nWARNING:  'setBackend' and 'pow' are imported from external module '@tensorflow/tfjs-core' but never used\r\n```\r\n\r\n- bad code:\r\n\r\n```log\r\n > tfjs-layers/src/layers/normalization.ts:586:22: warning: Comparison using the \"!==\" operator here is always true\r\n    586 │             this.axis !== [nDims - 1]) {\r\n```\r\n\r\n- incorrect tree shaking:\r\n\r\nthis was mentioned numerous times and never properly resolved. latest (still open) is #5182.\r\n\r\nand as a final note, build process works only with `yarn` - but then scripts sometimes call `npm instead`!?\r\n",
