        "body": "<em>Please make sure that this is a bug. As per our\r\n[GitHub Policy](https://github.com/tensorflow/tensorflow/blob/master/ISSUES.md),\r\nwe only address code/doc bugs, performance issues, feature requests and\r\nbuild/installation issues on GitHub. tag:bug_template</em>\r\n\r\n**System information**\r\n- Have I written custom code (as opposed to using a stock example script provided in TensorFlow.js): No\r\n- OS Platform and Distribution (e.g., Linux Ubuntu 16.04): Debian 5.10\r\n- Mobile device (e.g. iPhone 8, Pixel 2, Samsung Galaxy) if the issue happens on mobile device:\r\n- TensorFlow.js installed from (npm or script link): Local build\r\n- TensorFlow.js version (use command below): Tried on [fe0dcb738daec71f950d93fd466825e21a915e25](https://github.com/tensorflow/tfjs/commit/fe0dcb738daec71f950d93fd466825e21a915e25) and [19ca872919c196787c2fbf9a8aa57000cd12dff0](https://github.com/tensorflow/tfjs/commit/19ca872919c196787c2fbf9a8aa57000cd12dff0).\r\n- Browser version: Chrome 93\r\n- Tensorflow.js Converter Version: n/a\r\n\r\n**Describe the current behavior**\r\n[Switching WebGL + CPU backends](https://github.com/tensorflow/tfjs/blob/master/tfjs-core/src/engine_test.ts#L587-L601) tests do not run when running `karma start` (or `yarn test-dev`) in `tfjs-backend-webgl`. They seem to not run because `_engine.ENGINE.backendNames()` does not contain `webgl` even though the webgl tests are being run.\r\n\r\n**Describe the expected behavior**\r\nThe above tests run.\r\n\r\n**Standalone code to reproduce the issue**\r\nIn `tfjs-backend-webgl`, \r\n```\r\nyarn build-deps\r\nyarn karma start\r\n```\r\nThen, in the Chrome debugger, open `engine_test.js` and set a breakpoint in the `predicate` function of the `Switching WebGL + CPU backends` tests. Check `_engine.ENGINE.backendNames()` and you'll see that `webgl` is missing.\r\n\r\n**Other info / logs** Include any logs or source code that would be helpful to\r\ndiagnose the problem. If including tracebacks, please include the full\r\ntraceback. Large logs and files should be attached.\r\n\r\n\r\n![webgl-no-test](https://user-images.githubusercontent.com/1474501/133653885-d68894d7-b523-4344-84f3-723895a63ec4.png)\r\n\r\n",
