        "author_association": "COLLABORATOR",
        "active_lock_reason": null,
        "body": "Refactor the preconfigured_browser.json benchmark field to an array of benchmarks, with each benchmark defining config for one model, such as\r\n```\r\n{\r\n    “benchmarks”: [\r\n        “1”: {\r\n            “model”: “mobilenet_v2”,\r\n            “backend”: “webgl”,\r\n            “numRuns”: 10,\r\n            “browsers”: []\r\n        }\r\n        ...\r\n    ] \r\n}\r\n```\r\nAccording to this serialization, refactor the benchmarkAll function, which takes in the JSON object of the preconfigured_browser.json file. Make sure the benchmark test still works. And add a test for benchmarkAll to test it can return all results.\r\n",
