        "author_association": "NONE",
        "active_lock_reason": null,
        "body": "**System information**\r\n- Have I written custom code (as opposed to using a stock example script provided in TensorFlow.js): yes\r\n- OS Platform and Distribution (e.g., Linux Ubuntu 16.04): Linux Ubuntu 18.04 LTS\r\n- Mobile device (e.g. iPhone 8, Pixel 2, Samsung Galaxy) if the issue happens on mobile device: N/A\r\n- TensorFlow.js installed from (npm or script link): <script> link\r\n- TensorFlow.js version (use command below): commit cb283fde98 (Date: 2021-09-23 16:54:08 UTC+08)\r\n- Browser version: Google Chrome 92\r\n- Tensorflow.js Converter Version: N/A\r\n\r\n\r\n**Describe the current behavior**\r\nWhen we uses the WebAssembly backend, calling `tf.fill()` function without explicitly giving the `dtype` parameter will make it throw an error.\r\n\r\n**Describe the expected behavior**\r\nAs [the official document says](https://js.tensorflow.org/api/latest/#fill), the `dtype` parameter should default to `float` if it is not explicitly given.\r\n\r\n**Standalone code to reproduce the issue**\r\nProvide a reproducible test case that is the bare minimum necessary to generate\r\nthe problem. If possible, please share a link to Colab/CodePen/any notebook.\r\n\r\nThe error can be reproduced by the following steps. First compile the source code and obtain the `tf-core.min.js` and `tf-backend-wasm.min.js` files, along with the WebAssembly module files (i.e. the `.wasm` files). Then put these library files and the following `main.html` file under the same folder. Finally run a Web server and open `main.html` in a browser and the error will show in the JavaScript console.\r\n\r\nThe source code of `main.html`:\r\n```HTML\r\n<html>\r\n\t<head>\r\n\t\t<script src=\"tf-core.min.js\"></script>\r\n\t\t<script src=\"tf-backend-wasm.min.js\"></script>\r\n\t</head>\r\n\t<body>\r\n\t\t<script>\r\n\t\t\tasync function main(){\r\n\t\t\t\tawait tf.setBackend(\"wasm\");\r\n\t\t\t\ttf.fill([10], 0);\r\n\t\t\t}\r\n\t\t\tmain();\r\n\t\t</script>\r\n\t</body>\r\n</html>\r\n```\r\n\r\n**Other info / logs** Include any logs or source code that would be helpful to\r\ndiagnose the problem. If including tracebacks, please include the full\r\ntraceback. Large logs and files should be attached.\r\n\r\nHere is the stack trace shown in JS console:\r\n```\r\nUncaught (in promise) Error: Unknown dtype undefined\r\n    at Object._ [as bytesPerElement] (util_base.ts:520)\r\n    at a.move (backend_wasm.ts:82)\r\n    at a.write (backend_wasm.ts:54)\r\n    at a.makeOutput (backend_wasm.ts:183)\r\n    at Object.pe [as kernelFunc] (Fill.ts:25)\r\n    at n (engine.ts:644)\r\n    at engine.ts:711\r\n    at e.scopedRun (engine.ts:478)\r\n    at e.runKernelFunc (engine.ts:707)\r\n    at e.runKernel (engine.ts:551)\r\n```\r\n",
