        "body": "<em>Please make sure that this is a bug. As per our\r\n[GitHub Policy](https://github.com/tensorflow/tensorflow/blob/master/ISSUES.md),\r\nwe only address code/doc bugs, performance issues, feature requests and\r\nbuild/installation issues on GitHub. tag:bug_template</em>\r\n\r\nSystem information\r\n\r\nHave I written custom code (as opposed to using a stock example script provided in TensorFlow.js): Yes\r\nOS Platform and Distribution (e.g., Linux Ubuntu 16.04): Windows 10 Professionnal (build 19041.1110)\r\nMobile device (e.g. iPhone 8, Pixel 2, Samsung Galaxy) if the issue happens on mobile device: Not on Mobile device, but here are the laptop's specs :\r\n        Intel Core i7-10875H CPU 2.30GHz\r\n        32Go RAM\r\n        NVIDIA GeForce RTX 2060 6GB\r\n        Operating System x64\r\n\r\nTensorFlow.js installed from (npm or script link): npm\r\nTensorFlow.js version (use command below): 3.7.0\r\nBrowser version: -\r\nTensorflow.js Converter Version: -\r\n\r\n**Describe the expected behavior**\r\nWhen trying to compute gradients, I am using the node backend since complex numbers are not well supported on other backends and tfjs-node or tfjs-node-gpu seem to be the only backends with proper complex numbers support.\r\n\r\nAs mentioned in the title, this gradient computation does not work properly: for a function f : C -> C, the derivative should be f' : C -> C. However, the framework returns real tensors instead of complex ones as shown with the example below.\r\n\r\nFor instance with a one-variable function :\r\nf(z) = z^2\r\nIn our example, z is a complex Tensor with values [1 + 1j, 2 + 3j, 1 + 0j, 1 + 4j].\r\nf(z) is then a tensor with values [0 + 2j, -5 + 12j, 1 + 0j, -15 + 8j].\r\nOur derivative (since we only have one variable for now) should be g(z) = df/dz = 2*z = [2 + 2j, 4 + 6j, 2 + 0j, 2+ 8j] but, the result is only a Real tensor containing only the real part of the derivative: [2, 4, 2, 2].\r\n\r\nWith a more advanced function, let's say f(z, y) = sqrt(z) / (z\\*y), gradients should be the results of formulas df/dz = -1/(2\\* x^(3/2) \\* y) and df/dy = -1/(sqrt(z)\\*y^2).\r\n\r\nLet's say z = [1 + 1j, 2 + 3j] and y = [4 + 3j, 0 + 5j]\r\nf(z, y) = [ 0.0856863 + -0.144714j, -0.0496999 + -0.0928651j], that is a tensor with DType Complex64.\r\nnow let's compute:\r\n```\r\ng = tf.grads(f)\r\n[dz, dy] = g([z, y])\r\n```\r\n\r\nand we have dz = [0.591557, -0.0235702] and dy = [0.0228893, -0.0267864], which are tensors of DType Float32.\r\nThese values seem to come out of the blue since the expected result should be:\r\ndz = [0.0147569 + 0.0576001j, 0.0145383 + 0.00140887j] and dy = [-0.00365588 - 0.0334366j, -0.0187573 + 0.00993998j].\r\n\r\n**Standalone code to reproduce the issue**\r\nBoth examples are written in typescript.\r\nFirst, compile the source with `tsc` then execute with `node [program.js]`.\r\nHere is the example for the square derivative:\r\n```\r\nimport * as tf from \"@tensorflow/tfjs-node\"\r\nimport {Tensor} from \"@tensorflow/tfjs-node\";\r\n\r\nfunction square(x : Tensor) {\r\n    //x**2\r\n    //derivative = 2*x\r\n    return tf.tidy( () => {\r\n        return x.square();\r\n    });\r\n}\r\n\r\nasync function main() {\r\n    const z: Tensor = tf.complex([1, 2, 1, 1], [1, 3, 0, 4]);\r\n    z.print(); //[1 + 1j, 2 + 3j, 1 + 0j, 1 + 4j]\r\n    const f_z: Tensor = square(z);\r\n    f_z.print(); //[0 + 2j, -5 + 12j, 1 + 0j, -15 + 8j]\r\n\r\n    const g = tf.grads(square);\r\n    const [dz]: Tensor[] = g([z]);\r\n    dz.print(); //[2, 4, 2, 2]\r\n}\r\nmain().then();\r\n```\r\n\r\nSecond (advanced) example :\r\n```\r\nimport * as tf from \"@tensorflow/tfjs-node\"\r\nimport {Tensor} from \"@tensorflow/tfjs-node\";\r\n\r\nfunction sqrtDivmul(x : Tensor, y : Tensor) {\r\n    //sqrt(x)/(x*y)\r\n    //grad for a should be d/dx = -1/(2*(x^3/2)*y)\r\n    //                     d/dy = -1/(sqrt(x)*y^2)\r\n    return tf.tidy( () => {\r\n        return x.sqrt().div(x.mul(y));\r\n    });\r\n}\r\n\r\nasync function main() {\r\n    const z: Tensor = tf.complex([1, 2], [1, 3]);\r\n    const y: Tensor = tf.complex([4, 0], [3, 5]);\r\n    z.print(); //[1 + 1j, 2 + 3j]\r\n    y.print(); //[4 + 3j, 0 + 5j]\r\n    const f_zy: Tensor = sqrtDivmul(z, y);\r\n    f_zy.print(); //[0.0856863 + -0.144714j, -0.0496999 + -0.0928651j]\r\n\r\n    const g = tf.grads(sqrtDivmul);\r\n    const [dz, dy] = g([z, y]);\r\n    dz.print() //[0.591557, -0.0235702] should be [0.0147569 + 0.0576001j, 0.0145383 + 0.00140887j]\r\n    dy.print(); //[0.0228893, -0.0267864] should be [-0.00365588 - 0.0334366j, -0.0187573 + 0.00993998j]\r\n}\r\nmain().then();\r\n```\r\n\r\n**Other info / logs** Include any logs or source code that would be helpful to\r\ndiagnose the problem. If including tracebacks, please include the full\r\ntraceback. Large logs and files should be attached.\r\n\r\nThe same behavior is observed with tfjs-node and tfjs-node-gpu. For other backends, the  gradients function for complex64 is not supported (as well as some operators documented at https://github.com/tensorflow/tfjs/issues/2409).\r\n\r\nIn the second example, dz and dy are the only Tensors in g([z, y]) as shown with `console.log(g(z, y]))`:\r\n```\r\n[\r\n  Tensor {\r\n    kept: false,\r\n    isDisposedInternal: false,\r\n    shape: [ 2 ],\r\n    dtype: 'float32',\r\n    size: 2,\r\n    strides: [],\r\n    dataId: {},\r\n    id: 62,\r\n    rankType: '1',\r\n    scopeId: 34\r\n  },\r\n  Tensor {\r\n    kept: false,\r\n    isDisposedInternal: false,\r\n    shape: [ 2 ],\r\n    dtype: 'float32',\r\n    size: 2,\r\n    strides: [],\r\n    dataId: {},\r\n    id: 56,\r\n    rankType: '1',\r\n    scopeId: 34\r\n  }\r\n].\r\n```",
