        "body": "**System information**\r\n- Have I written custom code (as opposed to using a stock example script provided in TensorFlow.js): yes\r\n- OS Platform and Distribution (e.g., Linux Ubuntu 16.04): MacOS 11.4\r\n- TensorFlow.js version (use command below): tfjs@3.9.0\r\n- Browser version: Google Chrome Version 94.0.4606.71\r\n- Tensorflow.js Converter Version: ???\r\n\r\n\r\n**Describe the current behavior**\r\nUpon using the \"tf.einsum\" method in a custom layer, I get the following message :\r\n\r\ntape.js:152 Uncaught (in promise) Error: Cannot compute gradient: gradient function not found for Einsum.\r\n    at a (tape.js:152)\r\n    at tape.js:136\r\n    at engine.js:1120\r\n    at engine.js:467\r\n    at e.t.scopedRun (engine.js:478)\r\n    at e.t.tidy (engine.js:465)\r\n    at e.t.gradients (engine.js:1115)\r\n    at GT (gradients.js:308)\r\n    at t.n.computeGradients (optimizer.js:111)\r\n    at t.n.minimize (optimizer.js:61)\r\n\r\n**Describe the expected behavior**\r\n\r\nI see einsum was added recently, so maybe gradients are still not supported. But it would be great to be abl \r\n\r\n\r\n**Standalone code to reproduce the issue**\r\nProvide a reproducible test case that is the bare minimum necessary to generate\r\nthe problem. If possible, please share a link to Colab/CodePen/any notebook.\r\n\r\n[My current project is fairly big to share, but happy to produce a small snippet that will result in this error, if this was not expected]",
