        "body": "While installing tfjs-react-native on my expo project, i've got this error\r\n```\r\n➜  smartstudio-app git:(feat/A410) ✗ npm install @tensorflow/tfjs-react-native\r\nnpm ERR! code ERESOLVE\r\nnpm ERR! ERESOLVE unable to resolve dependency tree\r\nnpm ERR! \r\nnpm ERR! While resolving: undefined@undefined\r\nnpm ERR! Found: expo-asset@8.3.3\r\nnpm ERR! node_modules/expo-asset\r\nnpm ERR!   expo-asset@\"~8.3.3\" from the root project\r\nnpm ERR! \r\nnpm ERR! Could not resolve dependency:\r\nnpm ERR! peer expo-asset@\"^7.0.0\" from @tensorflow/tfjs-react-native@0.7.0\r\nnpm ERR! node_modules/@tensorflow/tfjs-react-native\r\nnpm ERR!   @tensorflow/tfjs-react-native@\"*\" from the root project\r\n\r\n```\r\nmy config\r\n```\r\n   \"expo\": \"^42.0.0\",\r\n    \"expo-asset\": \"~8.3.3\",\r\n    \"expo-auth-session\": \"~3.3.1\",\r\n    \"expo-av\": \"~9.2.3\",\r\n    \"expo-camera\": \"~11.2.2\",\r\n    \"expo-constants\": \"~11.0.1\",\r\n```\r\n\r\ni also believe this library not to be comptabile with expo-camera over version 7 while i have version 11.\r\nforcing peer deps doesn't look like a good idea, but maybe we can write dependencies of tfjs-react-native like\r\n    \"expo-camera\": \">=7.0.0\",\r\nif expo does not break api between major version\r\n\r\nThanks a lot for the good work, team !\r\n\r\n",
