        "active_lock_reason": null,
        "body": "**System information**\r\n- TensorFlow.js v3.9.0 (Windows 10), `tfjs-node-gpu`\r\n- Are you willing to contribute it (Yes/No): Possibly if not overly complex changes\r\n\r\n\r\n\r\n**Describe the feature and the current behavior/state.**\r\n\r\nOn average most model training greatly underutilizes the GPU, due to the nature of how GPU's scale. We all know that large models (tens or hundreds of millions of params) perform far more efficient (ops/watt) than smaller models (< 10M params), that is simply the nature of accelerators. The issue with tfjs is that there is no way for these smaller models to be trained in parallel (across multiple worker processes) OR concurrently with any significant benefits (more on this later).\r\n\r\nLet's take a look at the state of parallel vs concurrent training in tensorflow:\r\n\r\n**Multi-process**\r\n\r\nMulti-process scales linearly in the case of multiple GPU's, but this story is about the utilization of each of those individual GPU's. Due to tfjs lack of memory allocation limits, multi-process training on a GPU is not possible today. The simple solution would be to add a [similar interface to manage memory in Tensorflow 2 core](https://www.tensorflow.org/guide/gpu#limiting_gpu_memory_growth)\r\n\r\n**Concurrency**\r\n\r\nUnlike multi-process training on a single GPU, concurrent training of models within a single process is actually possible today. In fact I've trained dozens and even hundreds of (<10M param) models, concurrently. While I can't speak to exactly why the performance and GPU utilization is so poor, I've run dozens of simple tests where-in at best I'll see 50-70% **increase** in GPU utilization (not to be confused with total utilization). While these benefits sound nice, it's quite devastating when we're talking sub 10% GPU utilization. It's not clear to me if this is a bug (or design flaw) in tfjs or tfcore, but I see no reason why we should not be able to fully utilize a GPU if we have enough models to saturate the GPU.\r\n\r\nConsider this contrived example (based on actual testing):\r\n\r\n* I can train a single ~130M param model to exceed 85% of GPU utilization (rtx 3080 ti for reference)\r\n* But training two ~65M param models concurrently will utilize less than 55% of the GPU\r\n* Adding additional ~65M param models may see slightly higher GPU utilization, but never more than 60%\r\n* For even smaller models, any amount of concurrency (even in the hundreds) will never even see 25% utilization\r\n\r\nThe expectation is that so long as we've not run out of GPU memory, or have some sort of model or CPU inefficiency that prevents full utilization, we should be able to take full advantage of the GPU by running 2 or more models, concurrently.\r\n\r\n\r\n**Will this change the current api? How?**\r\n\r\n1. Enable multi-process GPU training by adding a [similar interface to manage memory in Tensorflow 2 core](https://www.tensorflow.org/guide/gpu#limiting_gpu_memory_growth).\r\n2. Resolve concurrency performance -- unclear if this would require an interface change or bug fix\r\n\r\n\r\n**Who will benefit with this feature?**\r\n\r\nThis could benefit a lot of engineers, especially those that need to improve GPU utilization with smaller models.\r\n\r\n**Any Other info.**\r\n\r\nI've put hundreds of hours into tfjs and **love** it! Would love to make tfjs a more serious real-world training solution and a true first-class alternative to Python-based training. Thank you!",
