        "body": "**System information**\r\n- Have I written custom code (as opposed to using a stock example script provided in TensorFlow.js):\r\n   `custom code`\r\n- OS Platform and Distribution (e.g., Linux Ubuntu 16.04):\r\n   `MacOS 11.6 (20G165)`\r\n- Mobile device (e.g. iPhone 8, Pixel 2, Samsung Galaxy) if the issue happens on mobile device:\r\n   `Samsung Galaxy A40`\r\n- TensorFlow.js installed from (npm or script link):\r\n   `npm`\r\n- TensorFlow.js version (use command below):\r\n   `\"@tensorflow/tfjs\": \"3.9.0\"`, `\"@tensorflow/tfjs-react-native\": \"0.7.0\",`\r\n- Browser version:\r\n   `\"react-native\": \"0.66.4\", ejected from expo`\r\n- Tensorflow.js Converter Version:\r\n   `TensorFlow.js Converter v3.9.0`\r\n\r\n**Describe the current behavior**\r\nWhen building with `npx react-native run-android --variant=release` I am unable to load model. But it works fine when building with `npx react-native run-android`\r\nInvoking `tf.loadGraphModel(bundleResourceIO(modelJson, modelWeights))` causes:\r\n\r\n```\r\n    ArrayBuffer length minus the byteOffset is not a multiple of the element size\r\n```\r\n\r\nSame when releasing APK. But the model assets are included in APK.\r\n\r\n**Standalone code to reproduce the issue**\r\n```\r\n import React, {Component} from 'react';\r\n import { Text, View, Button, ScrollView } from 'react-native';\r\n \r\n import * as tf from '@tensorflow/tfjs';\r\n import { bundleResourceIO } from '@tensorflow/tfjs-react-native';\r\n \r\n export default class MainScreen extends Component {\r\n   constructor(props) {\r\n\t super(props);\r\n\t this.tfReady = false;\r\n\t this.model = null;\r\n   }\r\n\r\n   componentDidMount() {\r\n\t tf.ready().then(() => {\r\n\t   this.tfReady = true;\r\n\t   this.onStatus({ status: `TF loaded, backend: ${tf.getBackend()}` });\r\n\t });\r\n   }\r\n \r\n   loadComponentConfig = async () => {\r\n\t if (this.tfReady) {\r\n\t   const modelJson = require('./assets/model.json');\r\n\t   const modelWeights = require('./assets/group1-shard1of1.bin');\r\n\t   tf.loadGraphModel(bundleResourceIO(modelJson, modelWeights)).then(model => {\r\n\t\t this.model = model;\r\n\t\t this.onStatus({ status: `TF Model loaded` });\r\n\t   }).catch(e => {\r\n\t\t this.onError({ error: `TF Model failed to load: ${e}` });\r\n\t   });\r\n\t }\r\n   };\r\n...\r\n```\r\n\r\n**Other info / logs**\r\nProvided code produces following output:\r\n```\r\n Status: TF loaded, backend: rn-webgl\r\n Error: TF Model failed to load: RangeError: ArrayBuffer length minus the byteOffset is not a multiple of the element size\r\n```\r\n\r\nfrom package.json\r\n```\r\n\"dependencies\": {\r\n    \"@react-native-async-storage/async-storage\": \"~1.15.0\",\r\n    \"@tensorflow/tfjs\": \"^3.9.0\",\r\n    \"@tensorflow/tfjs-backend-wasm\": \"^3.9.0\",\r\n    \"@tensorflow/tfjs-react-native\": \"^0.7.0\",\r\n    \"expo\": \"~42.0.1\",\r\n    \"expo-camera\": \"~11.2.2\",\r\n    \"expo-gl\": \"~10.4.2\",\r\n    \"expo-gl-cpp\": \"~10.4.1\",\r\n    \"expo-splash-screen\": \"~0.11.2\",\r\n    \"expo-status-bar\": \"~1.0.4\",\r\n    \"expo-updates\": \"~0.8.1\",\r\n    \"next-frame\": \"^0.2.3\",\r\n    \"react\": \"16.13.1\",\r\n    \"react-dom\": \"^17.0.2\",\r\n    \"react-native\": \"~0.63.4\",\r\n    \"react-native-async-storage\": \"^0.0.1\",\r\n    \"react-native-fs\": \"^2.18.0\",\r\n    \"react-native-gesture-handler\": \"~1.10.2\",\r\n    \"react-native-progress\": \"^5.0.0\",\r\n    \"react-native-reanimated\": \"~2.2.0\",\r\n    \"react-native-screens\": \"~3.4.0\",\r\n    \"react-native-threads\": \"^0.0.19\",\r\n    \"react-native-unimodules\": \"0.14.10\",\r\n    \"react-native-web\": \"^0.17.5\"\r\n  },\r\n```\r\n",
