        "state": "open",
        "locked": false,
        "assignee": null,
        "assignees": [],
        "milestone": null,
        "comments": 3,
        "created_at": "2021-10-31T13:59:21Z",
        "updated_at": "2021-11-10T06:53:15Z",
        "closed_at": null,
        "author_association": "NONE",
        "active_lock_reason": null,
        "body": "<em>Please make sure that this is a feature request. As per our [GitHub Policy](https://github.com/tensorflow/tensorflow/blob/master/ISSUES.md), we only address code/doc bugs, performance issues, feature requests and build/installation issues on GitHub. tag:feature_template</em>\r\n\r\n\r\n**System information**\r\n- TensorFlow.js version (you are using): Latest\r\n- Are you willing to contribute it (Yes/No): yes\r\n\r\n**Describe the feature and the current behavior/state.**\r\n\r\nSince on Keras, parameters are like `kernel_initializer' and on tfjs parameters are in Camel-case, it is sometimes confusing if the parameter has been set correctly. I suggest console.log warnings for unused layer-(and possibly everything else)-options, so that when you enter \"kernel_initializer\" instead of \"kernelInitializer\", it will tell you that the parameter \"kernel_initializer\" was ignored. This would make debugging programs in tfjs way more easy.\r\n\r\n**Will this change the current api? How?**\r\n\r\nNo.\r\n\r\n**Who will benefit with this feature?**\r\n\r\nAnybody who has experience with Keras in Python and now tries to do things the tfjs-way.\r\n\r\n**Any Other info.**\r\n\r\nI've modified the tf.js for the dense-layer in this way, just as a test if this would work:\r\n\r\n```\r\n\r\n\t  function Dense(args) {\r\n\t    var _this4;\r\n\t    var args_keys = Object.keys(args);\r\n\r\n\t    _this4 = _Layer2.call(this, args) || this; // Default activation: Linear (none).\r\n\r\n\t    _this4.activation = null;\r\n\t    _this4.useBias = true;\r\n\t    _this4.kernel = null;\r\n\t    _this4.bias = null;\r\n\t    _this4.DEFAULT_KERNEL_INITIALIZER = 'glorotNormal';\r\n\t    _this4.DEFAULT_BIAS_INITIALIZER = 'zeros';\r\n\r\n\t    if (args.batchInputShape == null && args.inputShape == null && args.inputDim != null) {\r\n\t      // This logic is copied from Layer's constructor, since we can't\r\n\t      // do exactly what the Python constructor does for Dense().\r\n\t      var batchSize = null;\r\n\r\n\t      if (args.batchSize != null) {\r\n\t        batchSize = args.batchSize;\r\n\t      }\r\n\r\n\t      _this4.batchInputShape = [batchSize, args.inputDim];\r\n\t    }\r\n\r\n\t    _this4.units = args.units;\r\n\t    assertPositiveInteger(_this4.units, 'units');\r\n\t    _this4.activation = getActivation(args.activation);\r\n\r\n\t    if (args.useBias != null) {\r\n\t      _this4.useBias = args.useBias;\r\n\t    }\r\n\r\n\t    _this4.kernelInitializer = getInitializer(args.kernelInitializer || _this4.DEFAULT_KERNEL_INITIALIZER);\r\n\t    _this4.biasInitializer = getInitializer(args.biasInitializer || _this4.DEFAULT_BIAS_INITIALIZER);\r\n\t    _this4.kernelConstraint = getConstraint(args.kernelConstraint);\r\n\t    _this4.biasConstraint = getConstraint(args.biasConstraint);\r\n\t    _this4.kernelRegularizer = getRegularizer(args.kernelRegularizer);\r\n\t    _this4.biasRegularizer = getRegularizer(args.biasRegularizer);\r\n\t    _this4.activityRegularizer = getRegularizer(args.activityRegularizer);\r\n\t    _this4.supportsMasking = true;\r\n\t    _this4.inputSpec = [{\r\n\t      minNDim: 2\r\n\t    }];\r\n\t    var layer_keys = Object.keys(_this4);\r\n\t    for (var layer_keys_counter = 0; layer_keys_counter != layer_keys.length; layer_keys_counter++) {\r\n\t\t    var this_key = layer_keys[layer_keys_counter];\r\n\t\t    var this_key_index = args_keys.indexOf(this_key);\r\n\t\t    if (this_key_index != -1) {\r\n\t\t\targs_keys.splice(this_key_index, 1);\r\n\t\t    }\r\n\t    }\r\n\t    if(args_keys.length) {\r\n\t\t    console.log(\"Unused args for dense layer:\", args_keys);\r\n\t    }\r\n\t    return _this4;\r\n\t  }\r\n```\r\n\r\nFor `var dense = tf.layers.dense({units: 10, activation: 'softmax', bla: 20});` this now reports:\r\n\r\n`Unused args for dense layer: Array [ \"bla\" ]`, which was exactly what I wanted, since \"bla\" is not a valid key.\r\n\r\nThis method relies on the idea that the layer-object's names are the same as the parameter names. I have not checked whether this is true for all functions or not, so there may be more work that results from this as it seems, but it would be *really* useful.",
