        "active_lock_reason": null,
        "body": "Hello i'm working with `tfjs_converter` on a saved model via the following command\r\n\r\n`tensorflowjs_converter --input_format=tf_saved_model --signature_name=serving_default --saved_model_tags=serve ./saved_model ./tfjs_model\r\n`\r\nThis seems to convert my model fine however there is some oddity in the outputs when looking at the output tensors from the saved model.json.\r\n\r\nIf I run the following command I get the following output tensors from the original saved model:\r\n\r\n```\r\nsaved_model_cli show --dir ./saved_model --all\r\n```\r\n\r\n```\r\nMetaGraphDef with tag-set: 'serve' contains the following SignatureDefs:\r\n\r\nsignature_def['__saved_model_init_op']:\r\n  The given SavedModel SignatureDef contains the following input(s):\r\n  The given SavedModel SignatureDef contains the following output(s):\r\n    outputs['__saved_model_init_op'] tensor_info:\r\n        dtype: DT_INVALID\r\n        shape: unknown_rank\r\n        name: NoOp\r\n  Method name is:\r\n\r\nsignature_def['serving_default']:\r\n  The given SavedModel SignatureDef contains the following input(s):\r\n    inputs['input_tensor'] tensor_info:\r\n        dtype: DT_UINT8\r\n        shape: (1, -1, -1, 3)\r\n        name: serving_default_input_tensor:0\r\n  The given SavedModel SignatureDef contains the following output(s):\r\n    outputs['detection_anchor_indices'] tensor_info:\r\n        dtype: DT_FLOAT\r\n        shape: (1, 100)\r\n        name: StatefulPartitionedCall:0\r\n    outputs['detection_boxes'] tensor_info:\r\n        dtype: DT_FLOAT\r\n        shape: (1, 100, 4)\r\n        name: StatefulPartitionedCall:1\r\n    outputs['detection_classes'] tensor_info:\r\n        dtype: DT_FLOAT\r\n        shape: (1, 100)\r\n        name: StatefulPartitionedCall:2\r\n    outputs['detection_multiclass_scores'] tensor_info:\r\n        dtype: DT_FLOAT\r\n        shape: (1, 100, 3)\r\n        name: StatefulPartitionedCall:3\r\n    outputs['detection_scores'] tensor_info:\r\n        dtype: DT_FLOAT\r\n        shape: (1, 100)\r\n        name: StatefulPartitionedCall:4\r\n    outputs['num_detections'] tensor_info:\r\n        dtype: DT_FLOAT\r\n        shape: (1)\r\n        name: StatefulPartitionedCall:5\r\n    outputs['raw_detection_boxes'] tensor_info:\r\n        dtype: DT_FLOAT\r\n        shape: (1, 51150, 4)\r\n        name: StatefulPartitionedCall:6\r\n    outputs['raw_detection_scores'] tensor_info:\r\n        dtype: DT_FLOAT\r\n        shape: (1, 51150, 3)\r\n        name: StatefulPartitionedCall:7\r\n  Method name is: tensorflow/serving/predict\r\n```\r\nNow using the converted tfjs model in node, I run the following command to get the outputNodes with the following output.\r\n\r\n```\r\nlet model = await tf.loadGraphModel(handler);\r\nconsole.log(model.outputNodes)\r\n```\r\n\r\n```\r\n[\r\n  'detection_multiclass_scores',\r\n  'raw_detection_boxes',\r\n  'Identity:0',\r\n  'Identity_2:0',\r\n  'detection_boxes',\r\n  'raw_detection_scores',\r\n  'num_detections',\r\n  'Identity_4:0'\r\n]\r\n```\r\n\r\nYou can see that some of the output tensors didn't carry the names from the save model, they are also not ordered as the original saved model. Why do the output tensors: `'Identity:0', 'Identity_2:0', 'Identity_4:0'` not have the same names as  `detection_anchor_indices, detection_scores, detection_classes`. It's difficult to determine the output. This seems like a bug in the converter. Any insight on this issue is appreciated. \r\n",
