        "body": "BUG #5689\r\n\r\nThis PR adds `WEBGPU_PARALLEL_COMPILATION_PASS` flag. With this flag enabled, all kernels will be compiled parallelly. But all executions will be delayed until the user calls `tensor.data()`.  It's very useful to speed up the first warmup pass. For the following prediction, the user can set `WEBGPU_PARALLEL_COMPILATION_PASS` to false to fall back to the original way.\r\nThis PR also ensures that users can get correct result even `WEBGPU_PARALLEL_COMPILATION_PASS` is always on.\r\n\r\nThe suggested usage will be like below:\r\n```\r\ntf.env().set('WEBGPU_PARALLEL_COMPILATION_PASS', true);\r\nconst data = await model.predict(zeroInput);\r\nawait data.data() // for warmup\r\ntf.env().set('WEBGPU_PARALLEL_COMPILATION_PASS', false);\r\nconst result = await model.predict()\r\n...\r\n```\r\nPaste some benchmarks warmup time here:\r\nWith `WEBGPU_PARALLEL_COMPILATION_PASS` on:\r\nmobilenetv2: 634.6 ms\r\nhand_detector: 937.9 ms\r\nWith `WEBGPU_PARALLEL_COMPILATION_PASS` off:\r\nmobilenetv2: 2374.7 ms\r\nhand_detector: 2135.9 ms\r\n\r\nTo see the logs from the Cloud Build CI, please join either our [discussion](https://groups.google.com/a/tensorflow.org/forum/#!forum/tfjs) or [announcement](https://groups.google.com/a/tensorflow.org/forum/#!forum/tfjs-announce) mailing list.\r\n\r\n<!-- Reviewable:start -->\r\n---\r\nThis change is [<img src=\"https://reviewable.io/review_button.svg\" height=\"34\" align=\"absmiddle\" alt=\"Reviewable\"/>](https://reviewable.io/reviews/tensorflow/tfjs/5815)\r\n<!-- Reviewable:end -->\r\n",
