        "author_association": "CONTRIBUTOR",
        "active_lock_reason": null,
        "body": "**System information**\r\n- TensorFlow.js version (you are using): 3.11.0\r\n- Are you willing to contribute it (Yes/No): Depends on how hard this is to implement - I don't know my way around the tfjs codebase.\r\n\r\n**Describe the feature and the current behavior/state.**\r\nCurrently we can load the wasm backend with script tags like this:\r\n```html\r\n<script src=\"https://cdn.jsdelivr.net/npm/@tensorflow/tfjs@3.11.0/dist/tf.js\"></script>\r\n<script src=\"https://cdn.jsdelivr.net/npm/@tensorflow/tfjs-backend-wasm@3.11.0/dist/tf-backend-wasm.js\"></script>\r\n```\r\nI've tried doing something similar with the new JS module import syntax like this:\r\n```js\r\nimport * as tf from \"https://cdn.jsdelivr.net/npm/@tensorflow/tfjs@3.11.0/dist/tf.fesm.js\";\r\nimport \"https://cdn.jsdelivr.net/npm/@tensorflow/tfjs-backend-wasm@3.11.0/dist/tf-backend-wasm.fesm.js\";\r\n```\r\nBut this gives the following error related to `tf-backend-wasm.fesm.js`: \r\n```\r\nUncaught TypeError: Failed to resolve module specifier \"@tensorflow/tfjs-core\". Relative references must start with either \"/\", \"./\", or \"../\".\r\n```\r\nSo importing `tf` works fine, but the wasm backend doesn't import properly. I think this is because it's expecting that I'd use a bundler? It would be nice if this worked without bundling. The script tag approach is nice and simple, and it would be nice if the wasm backend worked in a similarly simple way with the new module import syntax.\r\n\r\n\r\n",
