        "active_lock_reason": null,
        "body": "**System information**\r\n- Have I written custom code (as opposed to using a stock example script provided in TensorFlow.js): Yes\r\n- OS Platform and Distribution (e.g., Linux Ubuntu 16.04): Ubuntu 20.04\r\n- Mobile device (e.g. iPhone 8, Pixel 2, Samsung Galaxy) if the issue happens on mobile device: Only tested on desktop\r\n- TensorFlow.js installed from (npm or script link): https://cdn.jsdelivr.net/npm/@tensorflow/tfjs@3.11.0/dist/tf.js\r\n- TensorFlow.js version (use command below): 3.11.0\r\n- Browser version: Chrome 95\r\n- Tensorflow.js Converter Version: tensorflowjs 3.11.0; Dependency versions: keras 2.7.0, tensorflow 2.7.0\r\n\r\n\r\n**Describe the current behavior**\r\nI have an ONNX file [here](https://github.com/josephrocca/anime-gan-v2-web/blob/main/anime-gan-v2.onnx) and I've converted it to both tfjs and tflite (using Google Colab) as shown at the bottom of [this ipynb file](https://github.com/josephrocca/anime-gan-v2-web/blob/main/Export_PyTorch_AnimeGANv2_%E2%86%92_ONNX_%E2%86%92_TensorFlow_SavedModel_%E2%86%92_TF_js_%2B_tflite.ipynb) ([here's a direct link](https://colab.research.google.com/github/josephrocca/anime-gan-v2-web/blob/main/Export_PyTorch_AnimeGANv2_%E2%86%92_ONNX_%E2%86%92_TensorFlow_SavedModel_%E2%86%92_TF_js_%2B_tflite.ipynb) to the Colab notebook). The relevant lines are:\r\n```py\r\n!onnx-tf convert -i anime-gan-v2.onnx -o anime-gan-v2-tf\r\n!tensorflowjs_converter --input_format tf_saved_model ./anime-gan-v2-tf ./anime-gan-v2-tfjs\r\ntflite_model = tf.lite.TFLiteConverter.from_saved_model(\"./anime-gan-v2-tf\") .convert()\r\n```\r\n* Here's a working demo of the [ONNX Runtime Web](https://github.com/microsoft/onnxruntime/tree/master/js/web) executing the model: https://josephrocca.github.io/anime-gan-v2-web/onnx.html\r\n* Here's a demo of the tfjs version (see error in console `GatherV2: the index value 0 is not in [0, -1]`): https://josephrocca.github.io/anime-gan-v2-web/tfjs.html (Using the webgl backend also gives an error, but it's `Cannot infer the missing size in [-1,0] when there are 0 elements`)\r\n* Here's a demo of the tflite version (see error in console `abort(undefined). Build with -s ASSERTIONS=1 for more info.`): https://josephrocca.github.io/anime-gan-v2-web/tflite.html\r\n\r\nYou can grab the code and play around with it like this:\r\n```bash\r\ngit clone https://github.com/josephrocca/anime-gan-v2-web\r\ncd anime-gan-v2-web\r\n# start static file server, e.g.:\r\ndeno run --allow-net --allow-read=. https://raw.githubusercontent.com/josephrocca/denoSimpleStatic/master/main.ts --port=3001\r\n```\r\n\r\n**Describe the expected behavior**\r\nSince the model works with ONNX Runtime Web, I'd have expected it to work in tfjs and tflite without errors. That said, it could be a problem with the `onnx-tensorflow` or `tensorflowjs` converters.\r\n\r\n**Standalone code to reproduce the issue**\r\n * Working: https://josephrocca.github.io/anime-gan-v2-web/onnx.html\r\n * Not working: https://josephrocca.github.io/anime-gan-v2-web/tfjs.html\r\n * Not working: https://josephrocca.github.io/anime-gan-v2-web/tflite.html\r\n\r\n**Other info / logs** Include any logs or source code that would be helpful to\r\ntfjs **cpu** backend:\r\n![image](https://user-images.githubusercontent.com/1167575/141190568-59cab36c-079e-4d2c-a7ae-da7ff09a8a85.png)\r\n\r\ntfjs **webgl** backend:\r\n![image](https://user-images.githubusercontent.com/1167575/141190692-dab56e41-8ca1-43a4-91da-c4d1ceddad6a.png)\r\n\r\ntflite:\r\n![image](https://user-images.githubusercontent.com/1167575/141190644-26be487e-e7ab-4978-83dd-551b6433fb98.png)\r\n\r\n\r\n\r\n",
