        "body": "**System information**\r\n- TensorFlow.js version (you are using): 3.11.0\r\n- Are you willing to contribute it (Yes/No): No\r\n\r\n**Describe the feature and the current behavior/state.**\r\n\r\nBatch Normalization (BN) in 5D tensors (NxDxHxWxC) is needed to handle models dealing with single- or multi-channel gridded 3D data, like 3D CT or MR medical images.\r\n\r\nCurrently BN is limited up to 4D tensors, and with 5D ones it fails with the following error in <a href=\"https://github.com/tensorflow/tfjs/blob/bec2196c8861470f929a3afee74eef1f10a2258c/tfjs-layers/src/layers/normalization.ts#L66\">normalization.ts</a>:\r\n`Error: batchNormalization is not implemented for array of rank 5 yet`\r\n\r\nThis is basically a re-open of the closed issue #2504, which said: \r\n> Ssupport for 5D tensors/3D ops has been added to several components recently (#767 #1035 #1985), so I am filing this hoping that someone with free time will consider adding 5D tensor support for BatchNorm too.\r\n\r\n**Will this change the current api? How?**\r\nThis will **not** change the current API.\r\n\r\n**Who will benefit with this feature?**\r\nAnyone willing to use 3D tensors in their models (e.g., medical imaging).\r\n\r\n**Any Other info.**\r\nAt first vision of the source code, to me it wouldn't take too long to implement, but I can't do it right now because I have problems in rebuilding the whole repo.\r\n",
