        "active_lock_reason": null,
        "body": "**System information**\r\n- TensorFlow.js version (you are using): 3.11.0\r\n- Are you willing to contribute it (Yes/No): Yes, willing to help where possible\r\n\r\n**Describe the feature and the current behavior/state.**\r\nWhile attempting to convert a TF SavedModel to tflite for use on the web, I got this error:\r\n```\r\nSome ops are not supported by the native TFLite runtime, you can enable TF kernels fallback using TF Select. See instructions: https://www.tensorflow.org/lite/guide/ops_select \r\nTF Select ops: AddV2, ArgMax, BatchMatMulV2, Cast, GatherV2, MatMul, Mul, Range, RealDiv, Sigmoid, Softmax, StridedSlice, Transpose\r\n```\r\nAnd for another model, these were the missing ops:\r\n```\r\nAddV2, BatchMatMulV2, Cast, ConcatV2, Conv2D, Fill, GatherV2, MatMul, Mul, RealDiv, Sigmoid, Softmax, StridedSlice, Transpose\r\n```\r\n [The linked docs](https://www.tensorflow.org/lite/guide/ops_select) don't show how to run inference with the tflite web runtime (only Android, iOS, C++ and Python. I take this to imply that it's not currently possible to use the extended set of ops with the tflite web runtime.\r\n\r\n**Will this change the current api? How?**\r\nUnsure if this will be an API change or a build step in the tflite web runtime.\r\n\r\n**Who will benefit with this feature?**\r\nPresumably the \"Select TensorFlow operators\" feature exists on other platforms due to developer demand. Web developers like myself would get the same benefits as developers on the other platforms.\r\n",
