        "body": "**System information**\r\n- TensorFlow.js version: 3.10.0\r\n\r\n**Describe the current behavior**\r\nI created a tf.data.Dataset called validationDataset :\r\n```\r\n let csvDataset: tf.data.Dataset<any> = (tf.data.csv(\r\n            myPath, {\r\n            configuredColumnsOnly: true,\r\n            delimiter: options.delimiter,\r\n            columnConfigs: {\r\n                [options.userColumn]: {\r\n                    required: true,\r\n                    // dtype: \"float32\"\r\n                },\r\n                [options.itemColumn]: {\r\n                    required: true,\r\n                    // dtype: \"float32\"\r\n                },\r\n                [options.ratingColumn]: {\r\n                    isLabel: true,\r\n                    // dtype: \"float32\"\r\n                }\r\n            }\r\n        })).shuffle( 100 ).map((x: any) => (\r\n            { xs: { user: this.datasetInfo.userToModelMap.get(`${x.xs[options.userColumn]}`), item: this.datasetInfo.itemToModelMap.get(`${x.xs[options.itemColumn]}`) }, ys: { rating: Number(x.ys[options.ratingColumn]) } }\r\n        ))\r\n\r\nlet validationPercentage = 0.1;\r\nthis.validationDataset = csvDataset.skip(trainSize).batch(this.batchSize);\r\nthis.validationDataset = this.validationDataset.map((x: Idataset) => ({ xs: { user: x.xs.user.reshape([-1, 1]), item: x.xs.item.reshape([-1, 1]) }, ys: { rating: x.ys.rating.reshape([-1, 1]) } }))\r\n```\r\nBut when I try to get the size of the validationDataset i get null:\r\n```\r\nconsole.log(this.validationDataset.size)\r\n```\r\nI know for a fact when I log the validationDataset that there are many elements in it yet it returns null.\r\n\r\nThank you\r\n\r\n",
