        "body": "**System information**\r\n- Have I written custom code (as opposed to using a stock example script provided in TensorFlow.js): `yes`\r\n- OS Platform and Distribution (e.g., Linux Ubuntu 16.04): `iOS 15.0.2`\r\n- Mobile device (e.g. iPhone 8, Pixel 2, Samsung Galaxy) if the issue happens on mobile device: `iPad 7th gen`\r\n- TensorFlow.js installed from (npm or script link): `npm`\r\n- TensorFlow.js version (use command below): tfjs: `3.11.0` , tfjs-tflite: `0.0.1-alpha.7`\r\n- Browser version: `Safari 15.0`\r\n- Tensorflow.js Converter Version: `None`\r\n\r\n**Describe the current behavior**\r\n`tflite.loadTFLiteModel()` report the error on the console.\r\n\r\n```\r\n[Warning] INFO: Created TensorFlow Lite XNNPACK delegate for CPU. (tflite_web_api_cc.js, line 9)\r\n[Warning] ERROR: failed to create XNNPACK runtime (tflite_web_api_cc.js, line 9, x50)\r\n[Warning] ERROR: failed to delegate ADD node #2234 (tflite_web_api_cc.js, line 9)\r\n[Warning] ERROR: failed to create XNNPACK runtime (tflite_web_api_cc.js, line 9)\r\n[Warning] ERROR: failed to delegate ADD node #2247 (tflite_web_api_cc.js, line 9)\r\n[Warning] ERROR: failed to create XNNPACK runtime (tflite_web_api_cc.js, line 9)\r\n[Warning] ERROR: failed to delegate ADD node #2260 (tflite_web_api_cc.js, line 9)\r\n[Warning] ERROR: failed to delegate MUL node #2269 (tflite_web_api_cc.js, line 9)\r\n[Warning] ERROR: failed to create XNNPACK runtime (tflite_web_api_cc.js, line 9)\r\n[Warning] ERROR: failed to delegate ADD node #2273 (tflite_web_api_cc.js, line 9)\r\n[Warning] ERROR: failed to delegate FULLY_CONNECTED node #2728 (tflite_web_api_cc.js, line 9)\r\n[Warning] ERROR: Node number 2762 (TfLiteXNNPackDelegate) failed to prepare. (tflite_web_api_cc.js, line 9)\r\n[Warning] ERROR: Restored original execution plan after delegate application failure. (tflite_web_api_cc.js, line 9)\r\n```\r\n\r\nThen `model.predict()` failed. \r\n\r\n```\r\nRuntimeError: abort(undefined). Build with -s ASSERTIONS=1 for more info.\r\n```\r\n\r\nI used pretrained `Onsets and Frames` model from magenta project.\r\nhttps://github.com/magenta/magenta/tree/main/magenta/models/onsets_frames_transcription/realtime \r\n\r\n**Standalone code to reproduce the issue**\r\nsee https://github.com/SIY1121/tflite-worker-bug-test",
