        "body": "<em>Please make sure that this is a bug. As per our\r\n[GitHub Policy](https://github.com/tensorflow/tensorflow/blob/master/ISSUES.md),\r\nwe only address code/doc bugs, performance issues, feature requests and\r\nbuild/installation issues on GitHub. tag:bug_template</em>\r\n\r\n**System information**\r\n- Have I written custom code (as opposed to using a stock example script provided in TensorFlow.js): No\r\n- OS Platform and Distribution (e.g., Linux Ubuntu 16.04): MacOSX 15\r\n- Mobile device (e.g. iPhone 8, Pixel 2, Samsung Galaxy) if the issue happens on mobile device: All\r\n- TensorFlow.js installed from (npm or script link): 3.11\r\n- TensorFlow.js version (use command below): 3.11\r\n- Browser version: latest\r\n- Tensorflow.js Converter Version: 3.11\r\n\r\n\r\n\r\n**Describe the current behavior**\r\nThe Pose detection model contains preprocessing steps that creates scalar variables for certain calcuators.\r\nfor example [this util](https://github.com/tensorflow/tfjs-models/blob/b5d49c0f5ba2057cc29b40317126c5f182495f96/pose-detection/src/posenet/calculators/decode_single_pose_util.ts#L24)\r\n\r\nThis applies to other models as well, might be good to check face/hand and other models that runs very frequently.\r\n\r\nEven though this tensor is disposed properly on each run, it will require continuous data upload for all detection runs.\r\n**Describe the expected behavior**\r\nUse static tensors to represent the constants created during the pre/post processes and dispose them after the model is disposed.\r\n\r\n**Standalone code to reproduce the issue**\r\nProvide a reproducible test case that is the bare minimum necessary to generate\r\nthe problem. If possible, please share a link to Colab/CodePen/any notebook.\r\n\r\n**Other info / logs** Include any logs or source code that would be helpful to\r\ndiagnose the problem. If including tracebacks, please include the full\r\ntraceback. Large logs and files should be attached.\r\n",
