        "author_association": "NONE",
        "active_lock_reason": null,
        "body": "I’ve been digging into finding a non-leaky way to use Face Landmarks Detections / facemesh.\r\n\r\nI’ve tested several different approaches all with demo code (no modifications) on chrome on osx using the webgl backend. \r\n\r\nHere is all the info about my testing incase it helps someone else. In each case, I ran the programs for 10 minutes and polled the JS heap size and GPU Process size (chrome task manager) every minute. \r\n\r\n\r\n### Face Landmarks Detections [Demo](https://github.com/tensorflow/tfjs-models/tree/master/face-landmarks-detection/demo) including the library via script tags/ unpkg\r\n\r\nVersions: \r\n```\r\ntfjs-core@3.1.0\r\ntfjs-converter@3.1.0\r\ntfjs-backend-webgl@3.1.0\r\ntfjs-backend-cpu@3.1.0\r\nface-landmarks-detection@0.0.3\r\n\r\n```\r\n\r\nResult: \r\n\r\n![Screen Shot 2021-11-15 at 7 11 14 PM](https://user-images.githubusercontent.com/3160465/141878431-88fd2fa8-a0e8-4f14-bc1d-5632917d24b0.png)\r\n\r\nHeap sizes\r\n\r\n`20.1,27.8,35.3,45.1,53.5,59.4,96.5,73.7,82.0,88.9`\r\n\r\nDelta- 68.8 mb\r\n\r\nGPU Process sizes \r\n\r\n`345,442,551,673,814,943,1000,1200,1300,1400`\r\n\r\nDelta- 1055 mb\r\n\r\nConclusion - significant memory problem. Has crashed chrome and caused the system to run out of memory frequently. \r\n\r\n### Face Landmarks Detections [Demo](https://github.com/tensorflow/tfjs-models/tree/master/face-landmarks-detection/demo) using NPM/Yarn/build tools in repo\r\n\r\nVersions: \r\n```\r\n    face-landmarks-detection\": \"link:../dist\",\r\n    \"@tensorflow/tfjs-backend-wasm\": \"^3.1.0\",\r\n    \"@tensorflow/tfjs-backend-webgl\": \"^3.1.0\",\r\n    \"@tensorflow/tfjs-backend-cpu\": \"^3.1.0\",\r\n    \"@tensorflow/tfjs-converter\": \"^3.1.0\",\r\n    \"@tensorflow/tfjs-core\": \"^3.1.0\",\r\n```\r\n\r\nResult: \r\n\r\n![Screen Shot 2021-11-15 at 6 54 16 PM](https://user-images.githubusercontent.com/3160465/141879236-f0d2bfac-0122-44c3-af0d-d87f436f1560.png)\r\n\r\nHeap sizes\r\n\r\n`17.3,18.9,18.7, 19.4,19.6,19.2,19.7,19.8,19.9`\r\nDelta- 2.6 mb\r\n\r\nGPU Process sizes \r\n`314,317,318,318,318,319,320,320,320`\r\nDelta- 6mb\r\n\r\nConclusion - still increases, but best option. Is it simply including via NPM or is it also about all the dev tools (babel, rollup, rollup, esbuild, yarn, etc ) that are being used?\r\n\r\n### Face Mesh [demo](https://codepen.io/mediapipe/pen/KKgVaPJ) run on a local server with linked / non-npm dependencies\r\n\r\nVersions\r\n```\r\ncamera_utils@0.3\r\ncontrol_utils@0.6\r\ndrawing_utils@0.3\r\nface_mesh@0.4\r\n```\r\n\r\nResult:\r\n\r\n![Screen Shot 2021-11-15 at 4 15 50 PM](https://user-images.githubusercontent.com/3160465/141879662-9ce94fa5-63f7-46f0-a1c6-0c6e70255286.png)\r\n\r\nHeap size\r\n`31.4,50.3,76.1,88.7,104,121,143,168,168,199`\r\nDelta - 167.6 mb\r\n\r\nGPU Process sizes \r\n`240 - 286 `\r\nDelta - 46 mb\r\n\r\n[More info on this issue](https://github.com/google/mediapipe/issues/1937#issuecomment-969348179)- also likely relevant thread about the details of webgl and memory. \r\n\r\n| demo+links heap delta | demo+links GPU delta | demo+npm heap delta | demo+npm GPU delta | facemesh heap delta | facemesh GPU delta |\r\n|-----------------------|----------------------|---------------------|--------------------|---------------------|--------------------|\r\n| 68.8 mb               | 1055 mb              | 2.6 mb              | 6 mb               | 167.6 mb            | 46   mb            |\r\n\r\nTo my non expert eyes - using npm + the dev dependencies seems to be the secret sauce. Which of these dev dependencies are making the difference if any? Why is that approach so much better? \r\n",
