        "body": "**System information**\r\n- OS Platform and Distribution (e.g., Linux Ubuntu 16.04): macOS 11.6\r\n- Mobile device (e.g. iPhone 8, Pixel 2, Samsung Galaxy) if the issue happens on mobile device: iOS Simulator\r\n- TensorFlow.js installed from (npm or script link): npm\r\n- TensorFlow.js version: 3.11.0\r\n- CUDA/cuDNN version:\r\n\r\n**Describe the problem**\r\nAfter spinning up a fresh react-native app and installing tfjs [per the instructions](https://www.npmjs.com/package/@tensorflow/tfjs-react-native) I'm getting the following error:\r\n\r\n\r\n<img width=\"300\" alt=\"CleanShot 2021-11-17 at 20 24 13@2x\" src=\"https://user-images.githubusercontent.com/53795920/142347037-29340711-81c6-4afd-b182-e2d2fdb2f893.png\">\r\n\r\n**Provide the exact sequence of commands / steps that you executed before running into the problem**\r\n1. Spin up a brand new react native app\r\n2.  Follow tfjs react native instructions\r\n\r\n**Any other info / logs**\r\nMinimal reproduction: https://github.com/kateinkim/tfjs-rn-example\r\n",
