        "author_association": "COLLABORATOR",
        "active_lock_reason": null,
        "body": "<em>Please make sure that this is a feature request. As per our [GitHub Policy](https://github.com/tensorflow/tensorflow/blob/master/ISSUES.md), we only address code/doc bugs, performance issues, feature requests and build/installation issues on GitHub. tag:feature_template</em>\r\n\r\n\r\n**System information**\r\n- TensorFlow.js version (you are using): 3.11\r\n- Are you willing to contribute it (Yes/No): Yes\r\n\r\nCurrently TFJS python converter uses PyInquirer for wizard CLI, given the lack of updates and support for new version of prompt-toolkit, it is causing some of the[ build issue](https://github.com/tensorflow/tfjs/issues/5860) as well.\r\n\r\nSuggestion to migrate to [questionary pip ](https://github.com/tmbo/questionary) and remove of support of wizard in py2.\r\n \r\n**Describe the feature and the current behavior/state.**\r\nThis would remove out-date deps fro PyInquirer and improve build compatibility.\r\n\r\n**Will this change the current api? How?**\r\n\r\n**Who will benefit with this feature?**\r\n\r\n**Any Other info.**\r\n",
