        "body": "<em>Please make sure that this is a bug. As per our\r\n[GitHub Policy](https://github.com/tensorflow/tensorflow/blob/master/ISSUES.md),\r\nwe only address code/doc bugs, performance issues, feature requests and\r\nbuild/installation issues on GitHub. tag:bug_template</em>\r\n\r\n**System information**\r\n- Have I written custom code (as opposed to using a stock example script provided in TensorFlow.js):\r\n- OS Platform and Distribution (e.g., Linux Ubuntu 16.04):Linux Ubuntu 20.04\r\n- Mobile device (e.g. iPhone 8, Pixel 2, Samsung Galaxy) if the issue happens on mobile device:\r\n- TensorFlow.js installed from (npm or script link): script link\r\n- TensorFlow.js version (use command below): 3.11.0\r\n- Browser version: 95.0.4638.69 (Official Build) (64-bit)\r\n- Tensorflow.js Converter Version:\r\n\r\n**Describe the current behavior**\r\nOn  backend CPU, When the input tensor shape is [1,3,3,1], and `dilationRate` is greater than the width and height of the input tensor (here, `dilationRate is [5,4]`), the shape of the output tensor is` [1,5,-2,-1]`, including `negative` numbers. \r\nBesides the webgl backend and wasm backend crashed as follows:\r\nthe error of webgl:\r\n![image](https://user-images.githubusercontent.com/68681463/143690766-a7546919-24a6-4660-b5a8-f25350b162ca.png)\r\n\r\nthe error of wasm:\r\n![image](https://user-images.githubusercontent.com/68681463/143690810-a1f4685b-295e-43bb-be73-baad4d71afb6.png)\r\n\r\n**Describe the expected behavior**\r\nThe shape value of output tensor should be greater than 0. Or Tell everyone the value range of dilationRate.\r\n\r\n**Standalone code to reproduce the issue**\r\nProvide a reproducible test case that is the bare minimum necessary to generate\r\nthe problem. If possible, please share a link to Colab/CodePen/any notebook.\r\n```\r\nasync function test(backend){\r\n    await tf.setBackend(backend);\r\n    await tf.ready()\r\n    var kwargs={\"filters\":5,\"kernelSize\":2,\"strides\":1,\"padding\":\"valid\",\"dataFormat\":\"channelsFirst\",\"dilationRate\":[5,4]};\r\n    var input_array=new Float32Array(27).fill(0.9);\r\n    var input=tf.tensor(input_array,[1,3,3,3]);\r\n    var layer=await tf.layers.conv2d(kwargs);\r\n    var result= await layer.apply(input);\r\n    console.log(result.shape);\r\n\r\n}\r\nasync function run(){\r\n    console.log(\"cpu result:\")\r\n    await test(\"cpu\");\r\n    console.log(\"wasm result:\")\r\n    await test(\"wasm\");\r\n    console.log(\"webgl result:\")\r\n    await test(\"webgl\");\r\n\r\n}\r\nrun();\r\n```\r\n**Other info / logs** Include any logs or source code that would be helpful to\r\ndiagnose the problem. If including tracebacks, please include the full\r\ntraceback. Large logs and files should be attached.\r\n",
