        "active_lock_reason": null,
        "body": "<em>Please make sure that this is a bug. As per our\r\n[GitHub Policy](https://github.com/tensorflow/tensorflow/blob/master/ISSUES.md),\r\nwe only address code/doc bugs, performance issues, feature requests and\r\nbuild/installation issues on GitHub. tag:bug_template</em>\r\n\r\n**System information**\r\n- Have I written custom code (as opposed to using a stock example script provided in TensorFlow.js):\r\n- OS Platform and Distribution (e.g., Linux Ubuntu 16.04):Linux Ubuntu 20.04\r\n- Mobile device (e.g. iPhone 8, Pixel 2, Samsung Galaxy) if the issue happens on mobile device:\r\n- TensorFlow.js installed from (npm or script link): script link\r\n- TensorFlow.js version (use command below): 3.11.0\r\n- Browser version: chrome 95.0.4638.69 (Official Build) (64-bit)\r\n- Tensorflow.js Converter Version:\r\n\r\n\r\n\r\n**Describe the current behavior**\r\n```\r\nvar weight0=[[[[0.147626, 0.0611362, 0.4833322],[0.1071634,0.3544759,0.188389],[0.4035106,-0.1818119,0.3718792]]],\r\n      [[[-0.1369221, 0.1789438, 0.0008314], [0.2409519 , -0.0587831, 0.5853602], [-0.2225002, 0.0479231 , 0.2069922]]]];\r\n    var weight1= [0, 0, 0];\r\n    var weights=[tf.tensor(weight0),tf.tensor(weight1)];\r\n    var args={\"filters\": 3, \"kernelSize\": [2, 1], \"strides\": [5, 2], \"padding\": \"same\", \"dataFormat\": \"channelsLast\",\"dilationRate\": 1,\"weights\":weights}\r\n    var iarr=new Array(27).fill(3);\r\n    var input = tf.tensor(iarr,[1,3,3,3]);\r\n    var layer=tf.layers.conv2d(args);\r\n    var layer_prediction=layer.apply(input);\r\n    layer_prediction.print();\r\n```\r\nFor the parameter configuration in the above code, the output of conv2d at the wasm backend is all 0, as follows\r\n![image](https://user-images.githubusercontent.com/68681463/144104470-325495d8-e29f-4f3a-bc6b-1eecd54e3951.png)\r\nHowever, for the same parameters and inputs, the output of conv2d in the webgl backend is different.\r\n![image](https://user-images.githubusercontent.com/68681463/144104697-5d004bbe-bc25-43b1-b978-6b2fb3f49e0e.png)\r\n\r\n`When I change strides to [2,2], the result of the webgl backend and the result of wasm become the same. The result is as follows`\r\n![image](https://user-images.githubusercontent.com/68681463/144105748-1e36add3-c062-4677-8132-c7f80b496848.png)\r\n\r\n**Describe the expected behavior**\r\nFor the same input and parameters, conv2d in different backends should output the same result.\r\n\r\n**Standalone code to reproduce the issue**\r\nProvide a reproducible test case that is the bare minimum necessary to generate\r\nthe problem. If possible, please share a link to Colab/CodePen/any notebook.\r\n```\r\n<!DOCTYPE html>\r\n<html lang=\"en\">\r\n<head>\r\n  <meta charset=\"UTF-8\">\r\n\r\n</head>\r\n<body>\r\n<script src=\"https://cdn.jsdelivr.net/npm/@tensorflow/tfjs\"> </script>\r\n<script src=\"https://cdn.jsdelivr.net/npm/@tensorflow/tfjs-backend-webgl\"></script>\r\n<script src=\"https://cdn.jsdelivr.net/npm/@tensorflow/tfjs-backend-wasm/dist/tf-backend-wasm.js\"></script>\r\n<script>\r\n\r\n  async function prediction (backend){\r\n    await tf.setBackend(backend);\r\n    await tf.ready();\r\n    var weight0=[[[[0.147626, 0.0611362, 0.4833322],[0.1071634,0.3544759, 0.188389 ],[0.4035106,-0.1818119, 0.3718792]]],\r\n      [[[-0.1369221, 0.1789438 , 0.0008314], [0.2409519 , -0.0587831, 0.5853602], [-0.2225002, 0.0479231 , 0.2069922]]]];\r\n    var weight1= [0, 0, 0];\r\n    var weights=[tf.tensor(weight0),tf.tensor(weight1)];\r\n    var args={\"filters\": 3, \"kernelSize\": [2, 1],\r\n      \"strides\": [5, 2],\r\n      \"padding\": \"same\",\r\n      \"dataFormat\": \"channelsLast\",\r\n      \"dilationRate\": 1,\r\n      \"weights\":weights}\r\n    var iarr=new Array(27).fill(3);\r\n    var input = tf.tensor(iarr,[1,3,3,3]);\r\n    var layer=tf.layers.conv2d(args);\r\n    var layer_prediction=layer.apply(input);\r\n    layer_prediction.print();\r\n\r\n  }\r\n  async function run(){\r\n    await prediction(\"webgl\");\r\n    await prediction(\"wasm\");\r\n  }\r\n  run();\r\n\r\n\r\n\r\n</script>\r\n</body>\r\n</html>\r\n\r\n```\r\n**Other info / logs** Include any logs or source code that would be helpful to\r\ndiagnose the problem. If including tracebacks, please include the full\r\ntraceback. Large logs and files should be attached.\r\n",
