        "active_lock_reason": null,
        "body": "Typically, to perform TFJS processing inside web worker, I need to gather data in main thread as an array, send it to worker thread (as transferrable object) and then create tensor from it inside worker. And if result is a tensor, do the same in the opposite direction once processing is complete.\r\n\r\nBut in cases where data in the main thread is already a tensor and already in GPU memory, this creates download GPU->CPU and then re-upload CPU->GPU  \r\n\r\nFor example, if data is created using\r\n> const image = tf.browser.fromPixels(input);\r\n\r\nFeature request is ability to \"export\" a tensor metadata so it can be \"created/imported\" in the worker thread - thus creating a tensor that points to the same data already in GPU. Such newly created tensor inside a worker would effectively be a \"view\" and would not be eligible for deallocation within worker.\r\n\r\nThis would apply to `WebGL` and `WebGPU` backends when actual tensor data is within GPU memory.\r\n\r\nThis would enhance usability of web worker based solutions significantly as currently performing the round trip adds significant latency thus limiting processing rate that can be achieved (even if actual processing is really fast)\r\n",
