        "body": "When I try to run the demo of the model : tfjs-models/pose-detection/ : https://storage.googleapis.com/tfjs-models/demos/pose-detection/index.html?model=movenet\r\n\r\nWith tfjs-v3.12.0 and Wasm 3.12.0 and configuration model MoveNet type Multipose and backend Wasm i got the following error :\r\n\r\nError: Kernel 'Reciprocal' not registered for backend 'wasm'\r\n\r\n![145433791-63df6bdb-87a1-4e08-a7cb-b72e41773c18](https://user-images.githubusercontent.com/32233417/145442149-e4f4c8e7-6c06-417b-92a3-8b591a4b64b1.png)\r\n\r\nThe demo Woks well for the singlepose type (lightning).\r\n\r\nRegards",
