        "body": "**System information**\r\n- I written custom code\r\n- Windows, issue on Firefox 94-95  compared to older versions of FF + chorme/edge)\r\n- PC\r\n- TensorFlow.js from jsdelivr.net/npm tried versions from 2.4.0 to 3.12.0\r\n\r\n**Describe the current behavior**\r\nRunning mediapipe facemesh estimateFaces on videoElement in Firefox 94/95 causes the video to be extremely jerky with frames jumping back and forth in time. I think this is related to tf.browser.fromPixels(HTMLVideoElement). It was OK in previous versions of FF (not sure which but it was OK a few months ago), and it is OK on chorme/edge and it is also OK if I use a camera stream instead of video. Link to demo showing the issue below (wait for the model loading to complete + you can hide/remove the mask to see that the issue is with the underlying video itself)\r\n\r\n**Describe the expected behavior**\r\nthe video frames should be displayed in order without jumping back and forth.\r\n\r\n**Standalone code to reproduce the issue**\r\ndemo: https://eyaler.github.io/tfjs_webgl_app/face_landmark/ \r\nthis is the line causing the issue: https://github.com/eyaler/tfjs_webgl_app/blob/master/face_landmark/webgl_main.js#L650\r\n\r\nthanks!",
