        "body": "**System information**\r\n- Have I written custom code (as opposed to using a stock example script provided in TensorFlow.js): no\r\n- OS Platform and Distribution (e.g., Linux Ubuntu 16.04): Mac OS 12.1, XCode 13.2.1 (13C100)\r\n- Mobile device (e.g. iPhone 8, Pixel 2, Samsung Galaxy) if the issue happens on mobile device: n/a\r\n- TensorFlow.js installed from (npm or script link): yarn via package.json at https://github.com/tensorflow/tfjs-examples/tree/master/react-native/image-classification/react-native-cli\r\n- TensorFlow.js version (use command below): 3.9.0\r\n- Browser version: n/a\r\n- Tensorflow.js Converter Version: n/a\r\n\r\n**Describe the current behavior**\r\n\r\nRunning `pod install` on the [`image-classification`](https://github.com/tensorflow/tfjs-examples/tree/master/react-native/image-classification/react-native-cli) react native CLI example fails with: \r\n\r\n```\r\nundefined method `react_native_post_install' for #<Pod::Podfile:0x00007fa755bc7240>\r\n```\r\n\r\n**Describe the expected behavior**\r\n\r\npod install should complete successfully. \r\n\r\n**Standalone code to reproduce the issue**\r\n\r\nhttps://github.com/tensorflow/tfjs-examples/tree/master/react-native/image-classification/react-native-cli\r\n\r\n----\r\n\r\nFrom https://stackoverflow.com/a/67136582/4965 it looks like the version of react-native in the [example](https://github.com/tensorflow/tfjs-examples/tree/master/react-native/image-classification/react-native-cli) needs to be bumped one minor release to 0.64. I was able to verify this, and can make a PR. Is there any CI on the react examples repo? Maybe I can contribute for that too.\r\n\r\n\r\n```\r\nreact-native-cli (master)> cd ios && pod install\r\nAuto-linking React Native modules for target `reactnativecli`: RNCAsyncStorage and RNFS\r\nAnalyzing dependencies\r\nFetching podspec for `DoubleConversion` from `../node_modules/react-native/third-party-podspecs/DoubleConversion.podspec`\r\nFetching podspec for `Folly` from `../node_modules/react-native/third-party-podspecs/Folly.podspec`\r\nFetching podspec for `glog` from `../node_modules/react-native/third-party-podspecs/glog.podspec`\r\nDownloading dependencies\r\nInstalling CocoaAsyncSocket (7.6.5)\r\nInstalling DoubleConversion (1.1.6)\r\nInstalling FBLazyVector (0.63.2)\r\nInstalling FBReactNativeSpec (0.63.2)\r\nInstalling Flipper (0.41.5)\r\nInstalling Flipper-Boost-iOSX (1.76.0.1.11)\r\nInstalling Flipper-DoubleConversion (1.1.7)\r\nInstalling Flipper-Fmt (7.1.7)\r\nInstalling Flipper-Folly (2.6.10)\r\nInstalling Flipper-Glog (0.3.6)\r\nInstalling Flipper-PeerTalk (0.0.4)\r\nInstalling Flipper-RSocket (1.4.3)\r\nInstalling FlipperKit (0.41.5)\r\nInstalling Folly (2020.01.13.00)\r\nInstalling OpenSSL-Universal (1.1.1100)\r\nInstalling RCTRequired (0.63.2)\r\nInstalling RCTTypeSafety (0.63.2)\r\nInstalling RNCAsyncStorage (1.15.8)\r\nInstalling RNFS (2.14.1)\r\nInstalling React (0.63.2)\r\nInstalling React-Core (0.63.2)\r\nInstalling React-CoreModules (0.63.2)\r\nInstalling React-RCTActionSheet (0.63.2)\r\nInstalling React-RCTAnimation (0.63.2)\r\nInstalling React-RCTBlob (0.63.2)\r\nInstalling React-RCTImage (0.63.2)\r\nInstalling React-RCTLinking (0.63.2)\r\nInstalling React-RCTNetwork (0.63.2)\r\nInstalling React-RCTSettings (0.63.2)\r\nInstalling React-RCTText (0.63.2)\r\nInstalling React-RCTVibration (0.63.2)\r\nInstalling React-callinvoker (0.63.2)\r\nInstalling React-cxxreact (0.63.2)\r\nInstalling React-jsi (0.63.2)\r\nInstalling React-jsiexecutor (0.63.2)\r\nInstalling React-jsinspector (0.63.2)\r\nInstalling ReactCommon (0.63.2)\r\nInstalling Yoga (1.14.0)\r\nInstalling YogaKit (1.18.1)\r\nInstalling boost-for-react-native (1.63.0)\r\nInstalling glog (0.3.5)\r\nInstalling libevent (2.1.12)\r\nGenerating Pods project\r\n[!] An error occurred while processing the post-install hook of the Podfile.\r\n\r\nundefined method `react_native_post_install' for #<Pod::Podfile:0x00007fa755bc7240>\r\n\r\n~/tfjs-examples/react-native/image-classification/react-native-cli/ios/Podfile:29:in `block (3 levels) in from_ruby'\r\n/usr/local/Cellar/cocoapods/1.11.2_1/libexec/gems/cocoapods-core-1.11.2/lib/cocoapods-core/podfile.rb:196:in `post_install!'\r\n/usr/local/Cellar/cocoapods/1.11.2_1/libexec/gems/cocoapods-1.11.2/lib/cocoapods/installer.rb:945:in `run_podfile_post_install_hook'\r\n/usr/local/Cellar/cocoapods/1.11.2_1/libexec/gems/cocoapods-1.11.2/lib/cocoapods/installer.rb:933:in `block in run_podfile_post_install_hooks'\r\n/usr/local/Cellar/cocoapods/1.11.2_1/libexec/gems/cocoapods-1.11.2/lib/cocoapods/user_interface.rb:149:in `message'\r\n/usr/local/Cellar/cocoapods/1.11.2_1/libexec/gems/cocoapods-1.11.2/lib/cocoapods/installer.rb:932:in `run_podfile_post_install_hooks'\r\n/usr/local/Cellar/cocoapods/1.11.2_1/libexec/gems/cocoapods-1.11.2/lib/cocoapods/installer.rb:331:in `block (2 levels) in create_and_save_projects'\r\n/usr/local/Cellar/cocoapods/1.11.2_1/libexec/gems/cocoapods-1.11.2/lib/cocoapods/installer/xcode/pods_project_generator/pods_project_writer.rb:61:in `write!'\r\n/usr/local/Cellar/cocoapods/1.11.2_1/libexec/gems/cocoapods-1.11.2/lib/cocoapods/installer.rb:330:in `block in create_and_save_projects'\r\n/usr/local/Cellar/cocoapods/1.11.2_1/libexec/gems/cocoapods-1.11.2/lib/cocoapods/user_interface.rb:64:in `section'\r\n/usr/local/Cellar/cocoapods/1.11.2_1/libexec/gems/cocoapods-1.11.2/lib/cocoapods/installer.rb:309:in `create_and_save_projects'\r\n/usr/local/Cellar/cocoapods/1.11.2_1/libexec/gems/cocoapods-1.11.2/lib/cocoapods/installer.rb:301:in `generate_pods_project'\r\n/usr/local/Cellar/cocoapods/1.11.2_1/libexec/gems/cocoapods-1.11.2/lib/cocoapods/installer.rb:180:in `integrate'\r\n/usr/local/Cellar/cocoapods/1.11.2_1/libexec/gems/cocoapods-1.11.2/lib/cocoapods/installer.rb:167:in `install!'\r\n/usr/local/Cellar/cocoapods/1.11.2_1/libexec/gems/cocoapods-1.11.2/lib/cocoapods/command/install.rb:52:in `run'\r\n/usr/local/Cellar/cocoapods/1.11.2_1/libexec/gems/claide-1.0.3/lib/claide/command.rb:334:in `run'\r\n/usr/local/Cellar/cocoapods/1.11.2_1/libexec/gems/cocoapods-1.11.2/lib/cocoapods/command.rb:52:in `run'\r\n/usr/local/Cellar/cocoapods/1.11.2_1/libexec/gems/cocoapods-1.11.2/bin/pod:55:in `<top (required)>'\r\n/usr/local/Cellar/cocoapods/1.11.2_1/libexec/bin/pod:23:in `load'\r\n/usr/local/Cellar/cocoapods/1.11.2_1/libexec/bin/pod:23:in `<main>'\r\n```",
