        "body": "<em>console print : [Error: Only 3 channels is supported at this time]</em>\r\n\r\n\r\nWhen use  \"1 channel or zero channel\" in decodeJpeg(contents: Uint8Array, channels?: 0 | 1 | 3) function then catch error \"Error: Only 3 channels is supported at this time\".\r\nBut when using \"3 channels\" on function decodeJpeg(), my code worked well.\r\n\r\nWe want from @tensorflow/tfjs-react-native {decodeJpeg(Uint8Array,1)} to be supported.\r\n\r\nI used these packages versions:\r\n-\"@tensorflow/tfjs\": \"^3.12.0\",\r\n-\"@tensorflow/tfjs-react-native\": \"^0.8.0\",\r\n-\"expo\": \"~43.0.2\",\r\n-\"expo-gl\": \"^11.0.3\",\r\n-\"expo-camera\": \"^12.0.3\",\r\n\r\n![Screen Shot 2021-12-27 at 11 17 20 AM](https://user-images.githubusercontent.com/38249806/147456486-d4cf08a9-efa5-4d5b-9834-2752b6aadd06.png)\r\n\r\n",
