        "active_lock_reason": null,
        "body": "Currently TensorFlow.js does not support the new GNN (Graph based neural networks) as [detailed here](https://distill.pub/2021/gnn-intro/). A growing number of members of the community are keen to see this feature implemented in TensorFlow.js to keep up to date with the latest research.\r\n\r\n**Will this change the current api? How?**\r\nThis will extend the current existing API to support new features related to GNNs\r\n\r\n**Who will benefit with this feature?**\r\nAll users of TensorFlow.js using to create GNN based models.\r\n\r\n**Any Other info.**\r\nPlease also see this forum discussion:\r\nhttps://discuss.tensorflow.org/t/gnn-for-tensorflow-js/6747\r\n",
