        "author_association": "MEMBER",
        "active_lock_reason": null,
        "body": "**System information**\r\n- OS Platform and Distribution : Appears agnostic to platform - happens on all platforms.\r\n- TensorFlow.js installed from (npm or script link): Script\r\n- TensorFlow.js version: 3.11.0\r\n- Browser version: Latest Chrome\r\n\r\n**Describe the current behavior**\r\n\r\nCurrently when calling model.fit with shuffle set to true and also setting aside some of the data to use as validation data a simple multi layered perceptron trained on MNIST data overfits with validation accuracy staying close to 0. Have tried with 20% validation ratio. When I change the ratio to 5% it works fine. This suggests to me that there is a bug where by the validation data is being set aside PRIOR to the shuffle of the training data, which is not working as expected.\r\n\r\n**Describe the expected behavior**\r\nThe expectation of the user is that the training data will be shuffled in case it is in some order and the validation split will be taken from that shuffled data after the shuffle has taken place.\r\n\r\n\r\n**Standalone code to reproduce the issue**\r\n\r\nWorking demo here. For now I have worked around the issue by MANUALLY shuffling the training data arrays before I convert them to Tensors (using tf.util.shuffleCombo(INPUTS, OUTPUTS)). IF you remove this single line of code (on line 27), you will see the error explained above.\r\n\r\nhttps://glitch.com/edit/#!/tensorflowjs-mnist-classifier?path=script.js%3A59%3A0\r\n\r\n\r\n",
