        "body": "**System information**\r\n- Have I written custom code (as opposed to using a stock example script provided in TensorFlow.js): yes\r\n- OS Platform and Distribution (e.g., Linux Ubuntu 16.04): Safari (iOS / macOS)\r\n- TensorFlow.js installed from (npm or script link): npm\r\n- TensorFlow.js version (use command below): 3.12.0\r\n- Browser version: Safari Version 15.2 (17612.3.6.1.6)\r\n\r\n\r\n\r\n**Describe the current behavior**\r\nPassing an `ImageBitmap` to `tf.browser.fromPixels` in a webworker in safari results in an error:\r\n\r\n> Error: Uncaught (in promise): Error: Cannot parse input in current context. Reason: OffscreenCanvas Context2D rendering is not supported. fromPixels_@http://localhost:4200/@tensorflow/tfjs.js:68820:26 \r\n\r\n**Describe the expected behavior**\r\n`createImageBitmap` is supported in Safari, so `tf.browser.fromPixels` should work in a worker without requiring `OffscreenCanvas` (or it should be polyfilled otherwise)\r\n\r\n\r\n**Standalone code to reproduce the issue**\r\n\r\nMain code:\r\n```js\r\nimport * as comlink from 'comlink';\r\n\r\nconst canvas = document.createElement('canvas');\r\ncanvas.width = 256;\r\ncanvas.height = 256;\r\n\r\nconst bitmap = await createImageBitmap(canvas);\r\nconst transferable = comlink.transfer(bitmap, [bitmap]);\r\n\r\nconst worker = comlink.wrap(new Worker(new URL('./worker', import.meta.url)));\r\nworker.run(transferable);\r\n```\r\n\r\nWorker code:\r\n```js\r\nimport * as comlink from 'comlink';\r\nimport * as tf from '@tensorflow/tfjs';\r\n\r\nasync function run(image: ImageBitmap): Promise<Uint8ClampedArray> {\r\n  tf.browser.fromPixels(image);\r\n}\r\n\r\ncomlink.expose({run});\r\n```\r\n\r\n\r\n**Other info / logs**\r\n\r\n- This does work on Google Chrome.\r\n- This does work if instead of an `ImageBitmap` one passes `ImageData`",
