        "author_association": "NONE",
        "active_lock_reason": null,
        "body": "**System information**\r\nChrome Mac OS\r\nTensorflow.js and hand pose libraries imported through CDN\r\n\r\nhttps://cdn.jsdelivr.net/npm/@mediapipe/hands\r\nhttps://cdn.jsdelivr.net/npm/@tensorflow/tfjs-core\r\nhttps://cdn.jsdelivr.net/npm/@tensorflow/tfjs-backend-webgl\r\nhttps://cdn.jsdelivr.net/npm/@tensorflow-models/hand-pose-detection\r\n\r\n\r\n**Describe the current behavior**\r\n\r\nwhen I use the function handPoseDetection.createDetector using the mediapipe runtime chrome shows the following error on the console. \r\n\r\npromise error TypeError: e.Hands is not a constructor\r\n    at new t (hand-pose-detection:17)\r\n    at hand-pose-detection:17\r\n    at hand-pose-detection:17\r\n    at Object.next (hand-pose-detection:17)\r\n    at hand-pose-detection:17\r\n    at new Promise (<anonymous>)\r\n    at o (hand-pose-detection:17)\r\n    at l (hand-pose-detection:17)\r\n    at Object.<anonymous> (hand-pose-detection:17)\r\n    at hand-pose-detection:17\r\n\r\n\r\n**Describe the expected behavior**\r\n\r\nThe detector is created without error\r\n\r\n**Standalone code to reproduce the issue**\r\n\r\nImport the following libraries through CDN:\r\n<!-- Require the peer dependencies of hand-pose-detection. -->\r\n<script src=\"https://cdn.jsdelivr.net/npm/@mediapipe/hands\"></script>\r\n<script src=\"https://cdn.jsdelivr.net/npm/@tensorflow/tfjs-core\"></script>\r\n <script src=\"https://cdn.jsdelivr.net/npm/@tensorflow/tfjs-converter\"></script>\r\n <!-- You must explicitly require a TF.js backend if you're not using the TF.js union bundle. -->\r\n <script src=\"https://cdn.jsdelivr.net/npm/@tensorflow/tfjs-backend-webgl\"></script>\r\n <script src=\"https://cdn.jsdelivr.net/npm/@tensorflow-models/hand-pose-detection\"></script>\r\n\r\nRun the following script:\r\n\r\nlet modelTemp = handPoseDetection.SupportedModels.MediaPipeHands;\r\n      handPoseDetection.createDetector(modelTemp, {\r\n        runtime: 'mediapipe', // or 'tfjs'\r\n        maxHands:2,\r\n        modelType:'full',\r\n      }).then((detector)=>{\r\n        console.log(\"promise response\",detector);\r\n      }).catch((err)=>{\r\n        console.log(\"promise error\",err);\r\n      });\r\n\r\n****Other Logs****\r\nIm using the documentation from https://github.com/tensorflow/tfjs-models/tree/master/hand-pose-detection/src/mediapipe . Also when y run the code in tfjs runtime it works fine\r\n",
