        "active_lock_reason": null,
        "body": "**System information**\r\n- Have I written custom code (as opposed to using a stock example script provided in TensorFlow.js): Yes\r\n- OS Platform and Distribution (e.g., Linux Ubuntu 16.04): MAC OSX / Windows 10 \r\n- Mobile device (e.g. iPhone 8, Pixel 2, Samsung Galaxy) if the issue happens on mobile device: Haven't checked\r\n- TensorFlow.js installed from (npm or script link): npm\r\n- TensorFlow.js version (use command below): 3.12.0\r\n- Browser version: Chrome 96\r\n- Tensorflow.js Converter Version: 3.11.0\r\n\r\n**Describe the current behavior**\r\nWhen training in python training and validation accuracy and loss are getting better and better.\r\nWhen training in tfjs the validation accuracy and loss are very different than their python counterparts.\r\nHowever the training accuracy and loss in tfjs are very similar to their python counterparts.\r\n\r\n**Describe the expected behavior**\r\nTraining and validation accuracies and losses expected to be similar to their python counterparts.\r\n\r\n**Standalone code to reproduce the issue**\r\nWe've use the same 128 samples (With batch size 128) for training and validation, to remove any doubts.\r\nRepository: https://github.com/ronigober/tfjs-validation-issue\r\nCodepen: https://codepen.io/RoniGober/pen/yLzxmvd\r\n\r\n**Other info / logs** \r\nComparisons between python and javascript (Densenet121, (10 last layers not frozen), **same** 128 samples for training and validation.\r\nWhat we've tried:\r\n* Running the same experiment with MNIST - converted from .h5 - Same results \r\n* Building the same MNIST Model from scratch on python and TF.js (Same seed)  - Same results \r\n* Different Densenet architectures - Same results.\r\n* Changed the [loss function](https://github.com/tensorflow/tfjs/blob/master/tfjs-layers/src/engine/training.ts#L1313) in the [testFunction](https://github.com/tensorflow/tfjs/blob/master/tfjs-layers/src/engine/training.ts#L1389) to be the same as in [trainFunction](https://github.com/tensorflow/tfjs/blob/master/tfjs-layers/src/engine/training.ts#L1297).\r\n\r\n![](https://github.com/ronigober/tfjs-validation-issue/blob/main/pics/densenet_121_cifar10_128_samples_train_acc.png?raw=true)\r\n![](https://github.com/ronigober/tfjs-validation-issue/blob/main/pics/densenet_121_cifar10_128_samples_train_loss.png?raw=true)\r\n![](https://github.com/ronigober/tfjs-validation-issue/blob/main/pics/densenet_121_cifar10_128_samples_valid_acc.png?raw=true)\r\n![](https://github.com/ronigober/tfjs-validation-issue/blob/main/pics/densenet_121_cifar10_128_samples_valid_loss.png?raw=true)\r\n\r\n",
