        "author_association": "NONE",
        "active_lock_reason": null,
        "body": "https://js.tensorflow.org/api/latest/#losses.cosineDistance\r\nI tried to figure out the parameter of axis, but it's not as easy as I expected. By the way, could you please add the formula for all the loss functions in js version in documentation. For people who prefer to know all the details, this could be very helpful. \r\n\r\nEdit: I recently work on a proj to remake the very basic part of tensorflow with both pure typescript and \"tf.grads & tf.variablegrad only\". If more details are provided, new comers can learn tf in an easier way.\r\n\r\nEdit the 2nd time:\r\n```\r\nconst axis = 1;\r\n\t\tconsole.log(axis);\r\n\t\ttf.losses.cosineDistance(\r\n\t\t\ttf.tensor2d([[1, 1], [1, 1], [1, 1]], [3, 2]),\r\n\t\t\ttf.tensor2d([[1, 1], [0, 1], [0, 1]], [3, 2]),\r\n\t\t\taxis).print();\r\n```\r\naxis: 0  result:    -1\r\naxis: 1  result:    -0.333333\r\nI calculated it manually, \r\n1-(dot([1,1],[1,1])+dot([1,1],[0,1])+dot([1,1],[0,1]))/3 === -1/3\r\n1-(dot([1,1,1],[1,0,0])+dot([1,1,1],[1,1,1]))/2 === -1\r\nMeans the structure is [the 1 axis][the 0 axis]. But I remember some of the functions treat the axis in the opposite sequence, for instance, [the 0 axis][the 1 axis][the 2 axis][the 3...]\r\nI really recommend that you add more detail or examples to help people handle these details.\r\n\r\nBut, what I would like to ask is that, since this function calculates the cosine distance, it should give out result only impacted by the angle. I mean cosine distance should be 1-cos, but your function returns 1-cos*(geometric length of label vector)*(geometric length of predict vector). The 2 vectors are not normalized. Is it intentional? How is this loss function supposed to be used? If normalization is necessary, then what should I do?\r\n\r\nThanks and have a good day.",
