        "body": "In the profile mode, timestamp will be resolved per op, the gpu burden is relatively heavy. This PR introduced a lightweight way to get timestamp, resolve timestamp when read. This feature is guarded behind flag TRACING.\r\n\r\nIn addition to the resolve method difference, the time returned in profile mode is gpu execution time (milliseconds). The time returned by TRACING is the start time and end time of gpu execution (nanoseconds).\r\n\r\nFor e2e, add tracing=true into the url will turn on tracing. For user application, set flag TRACING to true before model predict.\r\n\r\nTo see the logs from the Cloud Build CI, please join either our [discussion](https://groups.google.com/a/tensorflow.org/forum/#!forum/tfjs) or [announcement](https://groups.google.com/a/tensorflow.org/forum/#!forum/tfjs-announce) mailing list.\n\n<!-- Reviewable:start -->\n---\nThis change is [<img src=\"https://reviewable.io/review_button.svg\" height=\"34\" align=\"absmiddle\" alt=\"Reviewable\"/>](https://reviewable.io/reviews/tensorflow/tfjs/6006)\n<!-- Reviewable:end -->\n",
