        "body": "**System information**\r\n- OS Platform and Distribution (Windows 10):\r\n- Mobile device (Xiaomi Redmi Note 9)\r\n- TensorFlow.js installed from ([https://github.com/tensorflow/tfjs/tree/master/tfjs-react-native](https://github.com/tensorflow/tfjs/tree/master/tfjs-react-native)):\r\n- TensorFlow.js version: \"^3.13.0\"\r\n- CUDA/cuDNN version: 11.6\r\n\r\n\r\n**Describe the problem**\r\n\r\nCan't build the app (`yarn run android`) after following the instruction\r\n\r\n![image](https://user-images.githubusercontent.com/36694324/149379065-1637ef77-0144-4d7a-85dc-dd885baeb3e4.png)\r\n\r\n**Dependencies**\r\n  {\r\n    \"@react-native-async-storage/async-storage\": \"react-native-async-storage/async-storage\",\r\n    \"@tensorflow/tfjs\": \"^3.13.0\",\r\n    \"@tensorflow/tfjs-react-native\": \"^0.8.0\",\r\n    \"expo-camera\": \"^12.1.0\",\r\n    \"expo-gl\": \"^11.1.1\",\r\n    \"expo-gl-cpp\": \"^11.1.0\",\r\n    \"react\": \"17.0.2\",\r\n    \"react-native\": \"0.66.4\",\r\n    \"react-native-fs\": \"^2.18.0\",\r\n    \"react-native-unimodules\": \"^0.14.10\"\r\n  }\r\n\r\n**Any other info / logs**\r\ni create new react native project with typescript template and then start installing tensorflow by following the instruction on github\r\n\r\nLog : \r\n```\r\nerror: Error: Unable to resolve module ./LogBoxImages/close.png from D:\\Development\\frontend\\react native\\tensorflow\\node_modules\\react-native\\Libraries\\LogBox\\UI\\LogBoxNotification.js:\r\n\r\nNone of these files exist:\r\n  * node_modules\\react-native\\Libraries\\LogBox\\UI\\LogBoxImages\\close.png(.native|.android.js|.native.js|.js|.android.json|.native.json|.json|.android.ts|.native.ts|.ts|.android.tsx|.native.tsx|.tsx)\r\n  * node_modules\\react-native\\Libraries\\LogBox\\UI\\LogBoxImages\\close.png\\index(.native|.android.js|.native.js|.js|.android.json|.native.json|.json|.android.ts|.native.ts|.ts|.android.tsx|.native.tsx|.tsx)\r\n  103 |         style={dismissStyles.press}>\r\n  104 |         <Image\r\n> 105 |           source={require('./LogBoxImages/close.png')}\r\n      |                            ^\r\n  106 |           style={dismissStyles.image}\r\n  107 |         />\r\n  108 |       </LogBoxButton>\r\n    at ModuleResolver.resolveDependency (D:\\Development\\frontend\\react native\\tensorflow\\node_modules\\metro\\src\\node-haste\\DependencyGraph\\ModuleResolution.js:107:15)\r\n    at DependencyGraph.resolveDependency (D:\\Development\\frontend\\react native\\tensorflow\\node_modules\\metro\\src\\node-haste\\DependencyGraph.js:288:43)\r\n    at Object.resolve (D:\\Development\\frontend\\react native\\tensorflow\\node_modules\\metro\\src\\lib\\transformHelpers.js:129:24)\r\n    at resolve (D:\\Development\\frontend\\react native\\tensorflow\\node_modules\\metro\\src\\DeltaBundler\\traverseDependencies.js:396:33)\r\n    at D:\\Development\\frontend\\react native\\tensorflow\\node_modules\\metro\\src\\DeltaBundler\\traverseDependencies.js:412:26\r\n    at Array.reduce (<anonymous>)\r\n    at resolveDependencies (D:\\Development\\frontend\\react native\\tensorflow\\node_modules\\metro\\src\\DeltaBundler\\traverseDependencies.js:411:33)\r\n    at processModule (D:\\Development\\frontend\\react native\\tensorflow\\node_modules\\metro\\src\\DeltaBundler\\traverseDependencies.js:140:31)\r\n    at async addDependency (D:\\Development\\frontend\\react native\\tensorflow\\node_modules\\metro\\src\\DeltaBundler\\traverseDependencies.js:230:18)\r\n    at async Promise.all (index 6)\r\n```\r\n\r\n\r\n",
