        "active_lock_reason": null,
        "body": "**System information**\r\n- `Node.js` (v16.13.1)\r\n- `@tensorflow/tfjs-node` (v3.12.0 - v3.13.0) (might still happens in previous version)\r\n- `npm` (v8.3.1)\r\n- `Linux, Ubuntu 20.0.4` (Server)\r\n\r\n\r\n**Describe the current behavior**\r\nThe memory usage is keep increasing while/after predicting the content.\r\nTidying/disposing the tensor won't change anything.\r\n\r\n**Describe the expected behavior**\r\nThe memory usage should be either stay or decreased or any.\r\n\r\n**Standalone code to reproduce the issue**\r\n```js\r\ntf.engine().startScope();\r\n\r\nlet imageData = tf.node.decodeJpeg(new Uint8Array(image_Buffer), 3);\r\nlet model = await tf.loadLayersModel(`file://model/model.json`);\r\n\r\nlet model_checking = tf.tidy(() => {\r\n  let normalized = tf.scalar(255);\r\n  let img = imageData.toFloat().div(normalized);\r\n  let RB = tf.image.resizeBilinear(img, [224, 224], true);\r\n  let batched = RB.reshape([1, 224, 224, 3]);\r\n  return model.predictOnBatch(batched);\r\n});\r\n\r\nconst classes = [\"Cat\", \"Dog\"]; // leetcode\r\nlet values = model_checking.dataSync();\r\n\r\nconst topK = Math.min(classes.length, values.length);\r\n\r\nfor (let i = 0; i < values.length; i++) value_index.push({ value: values[i], index: i });\r\n\r\nvalue_index.sort((a, b) => b.value - a.value);\r\n\r\nconst topk = new Float32Array(topK), topkI = new Int32Array(topK);\r\n\r\nfor (let i = 0; i < topK; i++) {\r\n  topk[i] = value_index[i].value;\r\n  topkI[i] = value_index[i].index;\r\n};\r\n\r\nconsole.log({ className: classes[topkI[0]], probability: topk[0] });\r\n\r\nimageData.dispose();\r\nmodel.dispose();\r\ntf.dispose(model_checking);\r\ntf.engine().disposeTensor(model_checking);\r\ntf.engine().disposeVariables();\r\ntf.engine().endScope();\r\n```\r\n\r\n**Other info / logs**\r\n- Same things happened with non-real content (dummy) like `tf.predict(tf.zeros([1, 299, 299, 3]))`\r\n- Everything works fine until we hit the memory usage limit. **TensorFlow** creates a kind-of \"dump\" file called **core**, which extensively tear up our hard disk usage (usually around 4-10 GB per file)\r\n\r\n![image](https://user-images.githubusercontent.com/33544674/149602641-d0b9d007-bc0d-4dde-acd4-efd5dd678eec.png)\r\n\r\n**5 hours later:**\r\n![image](https://user-images.githubusercontent.com/33544674/149602597-a6c2b990-241a-456f-93df-3cd4ea2e4fd9.png)",
