        "body": "**System information**\r\n- Windows 10 Pro 1909, 18363.1198\r\n- Intel(R) Core (TM) i3 CPU M350 @ 2.27 GHz\r\n- TensorFlow.js installed from (npm or script link): `npm install tensorflow/tfjs-node`\r\n- TensorFlow.js version: ^3.13.0\r\n\r\nI run into the following error message when i try to build my TFJS project\r\n\r\n```\r\nPS D:\\Projects\\art-review-bot> npm run build\r\n\r\n> art-review-bot@1.0.0 build\r\n> tsc && ts-node src/engine.ts\r\n\r\nError: A dynamic link library (DLL) initialization routine failed.\r\n\\\\?\\D:\\Projects\\art-review-bot\\node_modules\\@tensorflow\\tfjs-node\\lib\\napi-v8\\tfjs_binding.node\r\n    at Object.Module._extensions..node (node:internal/modules/cjs/loader:1183:18)\r\n    at Function.Module._load (node:internal/modules/cjs/loader:822:12)\r\n    at Module.require (node:internal/modules/cjs/loader:1005:19)\r\n    at require (node:internal/modules/cjs/helpers:102:18)\r\n    at Object.<anonymous> (D:\\Projects\\art-review-bot\\node_modules\\@tensorflow\\tfjs-node\\dist\\index.js:60:16)\r\n    at Module._compile (node:internal/modules/cjs/loader:1101:14)\r\n    at Object.Module._extensions..js (node:internal/modules/cjs/loader:1153:10)\r\n    at Module.load (node:internal/modules/cjs/loader:981:32)\r\n    at Function.Module._load (node:internal/modules/cjs/loader:822:12) {\r\n  code: 'ERR_DLOPEN_FAILED'\r\n```\r\n\r\n**Provide the exact sequence of commands / steps that you executed before running into the problem**\r\n* Installed TFJS/Node succesfully from npm\r\n* Ran this sample code i got online\r\n ```\r\n import TensorFlow from '@tensorflow/tfjs-node'\r\nimport MobileNet from '@tensorflow-models/mobilenet'\r\nimport fs from 'fs'\r\n\r\nlet path = '../data/test/IMG_2989.JPG'\r\nconst imageBuffer = fs.readFileSync(path)\r\nconst tImage = TensorFlow.node.decodeImage(imageBuffer) as TensorFlow.Tensor3D\r\n\r\nconst classifyImage = async () => {\r\n    const mobilenetmodel = await MobileNet.load()\r\n    const predicton = await mobilenetmodel.classify(tImage)\r\n    console.log('Classificction : ', predicton)\r\n}\r\n\r\nif (process.argv.length !== 3)\r\n    throw new Error('Incorrect argument blah blah ')\r\n\r\nclassifyImage()\r\n```\r\n* Got the error message\r\n\r\nWhat does this mean, and what do i do?\r\nAlso, is it possible the problem i steming from my hardware (CPU)?",
