        "author_association": "NONE",
        "active_lock_reason": null,
        "body": "<em>Please make sure that this is a build/installation issue. As per our [GitHub Policy](https://github.com/tensorflow/tensorflow/blob/master/ISSUES.md), we only address code/doc bugs, performance issues, feature requests and build/installation issues on GitHub. tag:build_template</em>\r\n\r\n**System information**\r\n- OS Platform and Distribution (e.g., Linux Ubuntu 16.04):Linux Ubuntu 1804\r\n- Mobile device (e.g. iPhone 8, Pixel 2, Samsung Galaxy) if the issue happens on mobile device:\r\n- TensorFlow.js installed from (npm or script link): npm\r\n- TensorFlow.js version: [3.13.0](https://www.npmjs.com/package/@tensorflow/tfjs-node)\r\n- CUDA/cuDNN version: 8.2\r\n\r\n\r\n**Describe the problem**\r\nHello, I am training a [deeplab2 panoptic segmentation](https://github.com/google-research/deeplab2) model without custom code, and use tensorflowjs_converter --input_format=tf_saved_model .... to convert my model to TFJS web model, however, I got the error\r\n\r\n```\r\nUnsupported Ops in the model before Optimization\r\nTensorListResize, EnsureShape, TensorListLength\r\n```\r\n\r\nI am wondering if it is a version thing? At the moment, are these ops not supported? Are there any other ways to convert my model to tfjs without modifying these ops? I need to use this model in NodeRed.  Thanks very much! I appreciate any help and hints!\r\n**Provide the exact sequence of commands / steps that you executed before running into the problem**\r\n\r\n\r\n**Any other info / logs**\r\nInclude any logs or source code that would be helpful to diagnose the problem. If including tracebacks, please include the full traceback. Large logs and files should be attached.\r\n",
