        "active_lock_reason": null,
        "body": "Hey there,\r\nrecently I have been working with the toxicity model and noticed that the \"severe_toxicity\" value is outputing essentially random numbers, they don't match the input at all. \r\n\r\nSystem information:\r\n- Windows 10 Home 20H2\r\n- TFJS 3.13.0\r\n- Toxicity module: 1.2.2 (NPM)\r\n\r\nThis is the code that's running, I'm using NodeJS 16, I have tried switching to NodeJS 14 and even a different operating system with the same outcome:\r\n\r\n```js\r\nrequire('@tensorflow/tfjs');\r\nconst fs = require(\"fs\")\r\nconst toxicity = require('@tensorflow-models/toxicity');\r\nconst threshold = 0.9;\r\n\r\ntoxicity.load(threshold).then(model => {\r\n    const sentences = ['You god damn cunt you better fucking not show yourself here for the rest of your life or I will fucking kill you you dickhead'];\r\n\r\n    model.classify(sentences).then(predictions => {\r\n        console.log(predictions);\r\n        fs.writeFileSync(Date.now() + \".json\", JSON.stringify(predictions));\r\n    });\r\n});\r\n```\r\n\r\nThis is the complete output of that code:\r\n```json\r\n[\r\n  {\r\n    \"label\": \"identity_attack\",\r\n    \"results\": [\r\n      {\r\n        \"probabilities\": {\r\n          \"0\": 0.930976152420044,\r\n          \"1\": 0.06902386248111725\r\n        },\r\n        \"match\": false\r\n      }\r\n    ]\r\n  },\r\n  {\r\n    \"label\": \"insult\",\r\n    \"results\": [\r\n      {\r\n        \"probabilities\": {\r\n          \"0\": 0.13015836477279663,\r\n          \"1\": 0.8698415756225586\r\n        },\r\n        \"match\": null\r\n      }\r\n    ]\r\n  },\r\n  {\r\n    \"label\": \"obscene\",\r\n    \"results\": [\r\n      {\r\n        \"probabilities\": {\r\n          \"0\": 0.15273529291152954,\r\n          \"1\": 0.8472647070884705\r\n        },\r\n        \"match\": null\r\n      }\r\n    ]\r\n  },\r\n  {\r\n    \"label\": \"severe_toxicity\",\r\n    \"results\": [\r\n      {\r\n        \"probabilities\": {\r\n          \"0\": 0.9946616291999817,\r\n          \"1\": 0.00533833634108305\r\n        },\r\n        \"match\": false\r\n      }\r\n    ]\r\n  },\r\n  {\r\n    \"label\": \"sexual_explicit\",\r\n    \"results\": [\r\n      {\r\n        \"probabilities\": {\r\n          \"0\": 0.7045894265174866,\r\n          \"1\": 0.2954106032848358\r\n        },\r\n        \"match\": null\r\n      }\r\n    ]\r\n  },\r\n  {\r\n    \"label\": \"threat\",\r\n    \"results\": [\r\n      {\r\n        \"probabilities\": {\r\n          \"0\": 0.8953554034233093,\r\n          \"1\": 0.10464458167552948\r\n        },\r\n        \"match\": null\r\n      }\r\n    ]\r\n  },\r\n  {\r\n    \"label\": \"toxicity\",\r\n    \"results\": [\r\n      {\r\n        \"probabilities\": {\r\n          \"0\": 0.03702698275446892,\r\n          \"1\": 0.9629729986190796\r\n        },\r\n        \"match\": true\r\n      }\r\n    ]\r\n  }\r\n]\r\n```\r\n\r\nI have seen the \"severe_toxicity\" value go over 1 as well. I tried running the module with the recommended TFJS version (1.7.4) with no change in behavior. Is there anything I can do to fix this or is this module \"long gone\"?",
