        "body": "<em>Please make sure that this is a bug. As per our\r\n[GitHub Policy](https://github.com/tensorflow/tensorflow/blob/master/ISSUES.md),\r\nwe only address code/doc bugs, performance issues, feature requests and\r\nbuild/installation issues on GitHub. tag:bug_template</em>\r\n\r\n**System information**\r\n- Have I written custom code (as opposed to using a stock example script provided in TensorFlow.js): No\r\n- OS Platform and Distribution (e.g., Linux Ubuntu 16.04): Android\r\n- Mobile device (e.g. iPhone 8, Pixel 2, Samsung Galaxy) if the issue happens on mobile device: Samsung Galaxy S10\r\n- TensorFlow.js installed from (npm or script link): Cloned [tfjs-examples/react-native-pose-detection](https://github.com/tensorflow/tfjs-examples/tree/master/react-native/pose-detection)\r\n- TensorFlow.js version (use command below): Cloned [tfjs-examples/react-native-pose-detection](https://github.com/tensorflow/tfjs-examples/tree/master/react-native/pose-detection)\r\n- Browser version: -\r\n- Tensorflow.js Converter Version: -\r\n\r\n**Describe the current behavior**\r\nI launched the pose detection example and take pose just like the image, but keypoints not detected like the image on [README.md](https://github.com/tensorflow/tfjs-examples/tree/master/react-native/pose-detection)\r\n\r\n**Describe the expected behavior**\r\nKeypoints should be detected just like the example image.\r\n\r\n**Standalone code to reproduce the issue**\r\nProvide a reproducible test case that is the bare minimum necessary to generate\r\nthe problem. If possible, please share a link to Colab/CodePen/any notebook.\r\n\r\n**Test Process**\r\n1. clone repo\r\n2. `yarn` => Failed with ```error An unexpected error occurred: \"https://registry.yarnpkg.com/colors/-/colors-1.4.2.tgz: Request failed \\\"404 Not Found\\\"\".```\r\n3. `rm yarn.lock`\r\n4. `yarn && yarn start`\r\n5. set camera to front and adjust position to show my face and shoulder. (just like image on `README.md`)\r\n\r\n**Other info / logs** Include any logs or source code that would be helpful to\r\ndiagnose the problem. If including tracebacks, please include the full\r\ntraceback. Large logs and files should be attached.\r\n",
